B.zI=A.a(s(["\n                    \u062c-\n\u0661- \u0627\u0644\u0648\u0627\u062c\u0628.\n\u0662- \u0627\u0644\u0645\u0633\u062a\u062d\u0628.\n\u0663- \u0627\u0644\u0645\u062d\u0631\u0645.\n\u0664- \u0627\u0644\u0645\u0643\u0631\u0648\u0647.\n\u0665- \u0627\u0644\u0645\u0628\u0627\u062d.                    ","\n                    \u062c-\n\u0661- \u0627\u0644\u0648\u0627\u062c\u0628: \u0645\u062b\u0644 \u0627\u0644\u0635\u0644\u0648\u0627\u062a \u0627\u0644\u062e\u0645\u0633\u060c \u0648\u0635\u064a\u0627\u0645 \u0631\u0645\u0636\u0627\u0646 \u0648\u0628\u0631 \u0627\u0644\u0648\u0627\u0644\u062f\u064a\u0646.\n- \u0627\u0644\u0648\u0627\u062c\u0628 \u064a\u062b\u0627\u0628 \u0641\u0627\u0639\u0644\u0647 \u0648\u064a\u0639\u0627\u0642\u0628 \u062a\u0627\u0631\u0643\u0647.\n\u0662- \u0627\u0644\u0645\u0633\u062a\u062d\u0628: \u0645\u062b\u0644 \u0627\u0644\u0633\u0646\u0646 \u0627\u0644\u0631\u0648\u0627\u062a\u0628\u060c \u0648\u0642\u064a\u0627\u0645 \u0627\u0644\u0644\u064a\u0644 \u0648\u0625\u0637\u0639\u0627\u0645 \u0627\u0644\u0637\u0639\u0627\u0645 \u0648\u0627\u0644\u0633\u0644\u0627\u0645. \u0648\u064a\u0633\u0645\u0649 \u0627\u0644\u0633\u0646\u0629 \u0648\u0627\u0644\u0645\u0646\u062f\u0648\u0628.\n- \u0627\u0644\u0645\u0633\u062a\u062d\u0628 \u064a\u062b\u0627\u0628 \u0641\u0627\u0639\u0644\u0647 \u0648\u0644\u0627 \u064a\u0639\u0627\u0642\u0628 \u062a\u0627\u0631\u0643\u0647.\n\u0645\u0644\u0627\u062d\u0638\u0629 \u0645\u0647\u0645\u0629:\n\u064a\u0646\u0628\u063a\u064a \u0644\u0644\u0645\u0633\u0644\u0645 \u0639\u0646\u062f\u0645\u0627 \u064a\u0633\u0645\u0639 \u0623\u0646 \u0647\u0630\u0627 \u0627\u0644\u0623\u0645\u0631 \u0633\u0646\u0629 \u0623\u0648 \u0645\u0633\u062a\u062d\u0628 \u0623\u0646 \u064a\u0628\u0627\u062f\u0631 \u0625\u0644\u0649 \u0641\u0639\u0644\u0647\u060c \u0648\u0627\u0644\u0627\u0642\u062a\u062f\u0627\u0621 \u0628\u0627\u0644\u0646\u0628\u064a \ufdfa .\n\u0663- \u0627\u0644\u0645\u062d\u0631\u0645: \u0645\u062b\u0644 \u0634\u0631\u0628 \u0627\u0644\u062e\u0645\u0631 \u0648\u0639\u0642\u0648\u0642 \u0627\u0644\u0648\u0627\u0644\u062f\u064a\u0646 \u0648\u0642\u0637\u0639 \u0627\u0644\u0623\u0631\u062d\u0627\u0645.\n- \u0627\u0644\u0645\u062d\u0631\u0645 \u064a\u062b\u0627\u0628 \u062a\u0627\u0631\u0643\u0647 \u0648\u064a\u0639\u0627\u0642\u0628 \u0641\u0627\u0639\u0644\u0647.\n\u0664- \u0627\u0644\u0645\u0643\u0631\u0648\u0647: \u0645\u062b\u0644 \u0627\u0644\u0623\u062e\u0630 \u0648\u0627\u0644\u0625\u0639\u0637\u0627\u0621 \u0628\u0627\u0644\u064a\u062f \u0627\u0644\u0634\u0645\u0627\u0644\u060c \u0643\u0641 \u0627\u0644\u062b\u0648\u0628 \u0641\u064a \u0627\u0644\u0635\u0644\u0627\u0629.\n- \u0627\u0644\u0645\u0643\u0631\u0648\u0647 \u064a\u062b\u0627\u0628 \u062a\u0627\u0631\u0643\u0647 \u0648\u0644\u0627 \u064a\u0639\u0627\u0642\u0628 \u0641\u0627\u0639\u0644\u0647.\n\u0665- \u0627\u0644\u0645\u0628\u0627\u062d: \u0645\u062b\u0644 \u0623\u0643\u0644 \u0627\u0644\u062a\u0641\u0627\u062d\u0629 \u0648\u0634\u0631\u0628 \u0627\u0644\u0634\u0627\u064a\u060c \u0648\u064a\u0633\u0645\u0649: \u0627\u0644\u062c\u0627\u0626\u0632 \u0648\u0627\u0644\u062d\u0644\u0627\u0644.\n- \u0627\u0644\u0645\u0628\u0627\u062d \u0644\u0627 \u064a\u062b\u0627\u0628 \u062a\u0627\u0631\u0643\u0647 \u0648\u0644\u0627 \u064a\u0639\u0627\u0642\u0628 \u0641\u0627\u0639\u0644\u0647.                    ","\n                    \u062c- \u0627\u0644\u0623\u0635\u0644 \u0641\u064a \u0643\u0644 \u0627\u0644\u0628\u064a\u0648\u0639 \u0648\u0627\u0644\u0645\u0639\u0627\u0645\u0644\u0627\u062a \u0623\u0646\u0647\u0627 \u062d\u0644\u0627\u0644 \u0625\u0644\u0627 \u0628\u0639\u0636 \u0627\u0644\u0623\u0646\u0648\u0627\u0639 \u0645\u0645\u0627 \u062d\u0631\u0645 \u0627\u0644\u0644\u0647 \u062a\u064e\u0639\u064e\u0627\u0644\u064e\u0649.\n\u0642\u0627\u0644 \u062a\u064e\u0639\u064e\u0627\u0644\u064e\u0649: \ufd3f\u0648\u064e\u0623\u064e\u062d\u064e\u0644\u0651\u064e \u0627\u0644\u0644\u0651\u064e\u0647\u064f \u0627\u0644\u0652\u0628\u064e\u064a\u0652\u0639\u064e \u0648\u064e\u062d\u064e\u0631\u0651\u064e\u0645\u064e \u0671\u0644\u0631\u0651\u0650\u0628\u064e\u0648\u0670\u0627\u06da\ufd3e [\u0633\u0648\u0631\u0629 \u0627\u0644\u0628\u0642\u0631\u0629: \u0662\u0667\u0665].                    ","\n                    \u062c-\n\u0661- \u0627\u0644\u063a\u0634\u060c \u0648\u0645\u0646\u0647: \u0625\u062e\u0641\u0627\u0621 \u0639\u064a\u0628 \u0627\u0644\u0633\u0644\u0639\u0629.\n\u0641\u0639\u0646 \u0623\u0628\u064a \u0647\u0631\u064a\u0631\u0629 \u0631\u064e\u0636\u0650\u064a\u064e \u0627\u0644\u0644\u0651\u064e\u0647\u064f \u0639\u064e\u0646\u0652\u0647\u064f\u060c \u0623\u0646\u0651\u064e \u0631\u0633\u0648\u0644 \u0627\u0644\u0644\u0647 \ufdfa \u0645\u0631\u0651\u064e \u0639\u0644\u0649 \u0635\u0628\u0631\u0629- \u0623\u064a: \u0643\u0648\u0645\u0629- \u0637\u0639\u0627\u0645\u060c \u0641\u0623\u062f\u062e\u0644 \u064a\u062f\u0647 \u0641\u064a\u0647\u0627\u060c \u0641\u0646\u0627\u0644\u062a \u0623\u0635\u0627\u0628\u0639\u0647 \u0628\u0644\u0644\u064b\u0627. \u0641\u0642\u0627\u0644: \xab\u0645\u0627 \u0647\u0630\u0627 \u064a\u0627 \u0635\u0627\u062d\u0628 \u0627\u0644\u0637\u0651\u064e\u0639\u0627\u0645\u061f\xbb \u0642\u0627\u0644: \u0623\u0635\u0627\u0628\u062a\u0647 \u0627\u0644\u0633\u0651\u064e\u0645\u0627\u0621 \u064a\u0627 \u0631\u0633\u0648\u0644 \u0627\u0644\u0644\u0647. \u0642\u0627\u0644: \xab\u0623\u0641\u0644\u0627 \u062c\u0639\u0644\u062a\u0647 \u0641\u0648\u0642 \u0627\u0644\u0637\u0651\u064e\u0639\u0627\u0645 \u0643\u064a \u064a\u0631\u0627\u0647 \u0627\u0644\u0646\u0651\u064e\u0627\u0633\u061f \u0645\u0646 \u063a\u0634\u0651\u064e \u0641\u0644\u064a\u0633 \u0645\u0646\u0651\u0650\u064a\xbb \u0631\u0648\u0627\u0647 \u0645\u0633\u0644\u0645.\n\u0662- \u0627\u0644\u0631\u0628\u0627: \u0648\u0645\u0646\u0647 \u0623\u0646 \u0622\u062e\u0630 \u0623\u0644\u0641\u0627 \u0645\u0646 \u0625\u0646\u0633\u0627\u0646 \u062f\u064a\u0646\u0627 \u0639\u0644\u0649 \u0623\u0646 \u0623\u0631\u062f\u0647\u0627 \u0625\u0644\u064a\u0647 \u0623\u0644\u0641\u064a\u0646.\n\u0648\u0627\u0644\u0632\u064a\u0627\u062f\u0629 \u0647\u064a \u0627\u0644\u0631\u0628\u0627 \u0627\u0644\u0645\u062d\u0631\u0645.\n\u0642\u0627\u0644 \u062a\u064e\u0639\u064e\u0627\u0644\u064e\u0649: \ufd3f\u0648\u064e\u0623\u064e\u062d\u064e\u0644\u0651\u064e \u0627\u0644\u0644\u0651\u064e\u0647\u064f \u0627\u0644\u0652\u0628\u064e\u064a\u0652\u0639\u064e \u0648\u064e\u062d\u064e\u0631\u0651\u064e\u0645\u064e \u0671\u0644\u0631\u0651\u0650\u0628\u064e\u0648\u0670\u0627\u06da\ufd3e [\u0633\u0648\u0631\u0629 \u0627\u0644\u0628\u0642\u0631\u0629: \u0662\u0667\u0665].\n\u0663- \u0627\u0644\u063a\u0631\u0631 \u0648\u0627\u0644\u062c\u0647\u0627\u0644\u0629: \u0643\u0623\u0646 \u0623\u0628\u064a\u0639\u0643 \u0627\u0644\u062d\u0644\u064a\u0628 \u0641\u064a \u0636\u0631\u0639 \u0627\u0644\u0634\u0627\u0629\u060c \u0623\u0648 \u0627\u0644\u0633\u0645\u0643\u0629 \u0641\u064a \u0627\u0644\u0645\u0627\u0621 \u0648\u0644\u0645 \u0627\u0635\u0637\u062f\u0647\u0627 \u0628\u0639\u062f.\n\u0641\u0641\u064a \u0627\u0644\u062d\u062f\u064a\u062b: (\u0646\u0647\u0649 \u0631\u0633\u0648\u0644 \u0627\u0644\u0644\u0647 \ufdfa \u0639\u0646 \u0628\u064a\u0639 \u0627\u0644\u063a\u0631\u0631) \u0631\u0648\u0627\u0647 \u0645\u0633\u0644\u0645.                    ","\n                    \u062c- \u0661 - \u0646\u0639\u0645\u0629 \u0627\u0644\u0625\u0633\u0644\u0627\u0645\u060c \u0648\u0623\u0646\u0643 \u0644\u0633\u062a \u0645\u0646 \u0623\u0647\u0644 \u0627\u0644\u0643\u0641\u0631.\n\u0662- \u0646\u0639\u0645\u0629 \u0627\u0644\u0633\u0646\u0629\u060c \u0648\u0623\u0646\u0643 \u0644\u0633\u062a \u0645\u0646 \u0623\u0647\u0644 \u0627\u0644\u0628\u062f\u0639.\n\u0663- \u0646\u0639\u0645\u0629 \u0627\u0644\u0635\u062d\u0629 \u0648\u0627\u0644\u0639\u0627\u0641\u064a\u0629\u060c \u0645\u0646 \u0627\u0644\u0633\u0645\u0639 \u0648\u0627\u0644\u0628\u0635\u0631 \u0648\u0627\u0644\u0645\u0634\u064a \u0648\u063a\u064a\u0631\u0647\u0627.\n\u0664- \u0646\u0639\u0645\u0629 \u0627\u0644\u0637\u0639\u0627\u0645 \u0648\u0627\u0644\u0634\u0631\u0627\u0628 \u0648\u0627\u0644\u0645\u0644\u0628\u0633.\n\u0648\u0646\u0639\u0645\u0647 \u062a\u064e\u0639\u064e\u0627\u0644\u064e\u0649 \u0639\u0644\u064a\u0646\u0627 \u0643\u062b\u064a\u0631\u0629 \u0644\u0627 \u062a\u0639\u062f \u0648\u0644\u0627 \u062a\u062d\u0635\u0649.\n\u0642\u0627\u0644 \u062a\u064e\u0639\u064e\u0627\u0644\u064e\u0649: \ufd3f\u0648\u0625\u0646 \u062a\u064e\u0639\u064f\u062f\u0651\u064f\u0648\u0627 \u0646\u0650\u0639\u06e1\u0645\u064e\u0629\u064e \u0671\u0644\u0644\u0651\u064e\u0647\u0650 \u0644\u064e\u0627 \u062a\u064f\u062d\u06e1\u0635\u064f\u0648\u0647\u064e\u0627\u06d7 \u0625\u0650\u0646\u0651\u064e \u0671\u0644\u0644\u0651\u064e\u0647\u064e \u0644\u064e\u063a\u064e\u0641\u064f\u0648\u0631\u064c \u0631\u064e\u062d\u0650\u064a\u0645\u064c 18\ufd3e [\u0633\u0648\u0631\u0629 \u0627\u0644\u0646\u062d\u0644: \u0661\u0668].                    ","\n                    \u062c- \u0627\u0644\u0648\u0627\u062c\u0628: \u0634\u0643\u0631\u0647\u0627 \u0648\u0630\u0644\u0643 \u0628\u0627\u0644\u062b\u0646\u0627\u0621 \u0639\u0644\u0649 \u0627\u0644\u0644\u0647 \u0648\u062d\u0645\u062f\u0647 \u0628\u0627\u0644\u0644\u0633\u0627\u0646 \u0648\u0623\u0646\u0647 \u0644\u0647 \u0627\u0644\u0641\u0636\u0644 \u0648\u062d\u062f\u0647\u060c \u0648\u0627\u0633\u062a\u0639\u0645\u0627\u0644 \u0647\u0630\u0647 \u0627\u0644\u0646\u0639\u0645 \u0628\u0645\u0627 \u064a\u0631\u0636\u064a \u0627\u0644\u0644\u0647 \u062a\u064e\u0639\u064e\u0627\u0644\u064e\u0649\u060c \u0644\u0627 \u0628\u0645\u0639\u0635\u064a\u062a\u0647.                    ","\n                    \u062c- \u0639\u064a\u062f \u0627\u0644\u0641\u0637\u0631 \u0648\u0639\u064a\u062f \u0627\u0644\u0623\u0636\u062d\u0649.\n- \u0643\u0645\u0627 \u0641\u064a \u062d\u062f\u064a\u062b \u0623\u064e\u0646\u064e\u0633\u064d\u060c \u0642\u064e\u0627\u0644\u064e: \u0642\u064e\u062f\u0650\u0645\u064e \u0631\u064e\u0633\u064f\u0648\u0644\u064f \u0627\u0644\u0644\u0651\u064e\u0647\u0650 \ufdfa \u0627\u0644\u0652\u0645\u064e\u062f\u0650\u064a\u0646\u064e\u0629\u064e \u0648\u064e\u0644\u064e\u0647\u064f\u0645\u0652 \u064a\u064e\u0648\u0652\u0645\u064e\u0627\u0646\u0650 \u064a\u064e\u0644\u0652\u0639\u064e\u0628\u064f\u0648\u0646\u064e \u0641\u0650\u064a\u0647\u0650\u0645\u064e\u0627\u060c \u0641\u064e\u0642\u064e\u0627\u0644\u064e: \xab\u0645\u064e\u0627 \u0647\u064e\u0630\u064e\u0627\u0646\u0650 \u0627\u0644\u0652\u064a\u064e\u0648\u0652\u0645\u064e\u0627\u0646\u0650\u061f\xbb\u060c \u0642\u064e\u0627\u0644\u064f\u0648\u0627: \u0643\u064f\u0646\u0651\u064e\u0627 \u0646\u064e\u0644\u0652\u0639\u064e\u0628\u064f \u0641\u0650\u064a\u0647\u0650\u0645\u064e\u0627 \u0641\u0650\u064a \u0627\u0644\u0652\u062c\u064e\u0627\u0647\u0650\u0644\u0650\u064a\u0651\u064e\u0629\u0650\u060c \u0641\u064e\u0642\u064e\u0627\u0644\u064e \u0631\u064e\u0633\u064f\u0648\u0644\u064f \u0627\u0644\u0644\u0651\u064e\u0647\u0650 \ufdfa : \xab\u0625\u0650\u0646\u0651\u064e \u0627\u0644\u0644\u0651\u064e\u0647\u064e \u0642\u064e\u062f\u0652 \u0623\u064e\u0628\u0652\u062f\u064e\u0644\u064e\u0643\u064f\u0645\u0652 \u0628\u0650\u0647\u0650\u0645\u064e\u0627 \u062e\u064e\u064a\u0652\u0631\u064b\u0627 \u0645\u0650\u0646\u0652\u0647\u064f\u0645\u064e\u0627: \u064a\u064e\u0648\u0652\u0645\u064e \u0627\u0644\u0652\u0623\u064e\u0636\u0652\u062d\u064e\u0649\u060c \u0648\u064e\u064a\u064e\u0648\u0652\u0645\u064e \u0627\u0644\u0652\u0641\u0650\u0637\u0652\u0631\u0650\xbb \u0631\u0648\u0627\u0647 \u0623\u0628\u0648\u062f\u0627\u0648\u062f.\n\u0648\u0645\u0627 \u0633\u0648\u0627\u0647\u0645\u0627 \u0645\u0646 \u0627\u0644\u0623\u0639\u064a\u0627\u062f \u0641\u0645\u0646 \u0627\u0644\u0628\u062f\u0639.                    ","\n                    \u062c- \u0634\u0647\u0631 \u0631\u0645\u0636\u0627\u0646.                    ","\n                    \u062c- \u064a\u0648\u0645 \u0627\u0644\u062c\u0645\u0639\u0629.                    ","\n                    \u062c- \u064a\u0648\u0645 \u0639\u0631\u0641\u0629.                    ","\n                    \u062c- \u0644\u064a\u0644\u0629 \u0627\u0644\u0642\u062f\u0631.                    ","\n                    \u062c: \u0627\u0644\u0648\u0627\u062c\u0628 \u063a\u0636 \u0627\u0644\u0628\u0635\u0631\u060c \u0642\u0627\u0644 \u062a\u064e\u0639\u064e\u0627\u0644\u064e\u0649: \ufd3f\u0642\u064f\u0644\u0652 \u0644\u0650\u0644\u0652\u0645\u064f\u0624\u0652\u0645\u0650\u0646\u0650\u064a\u0646\u064e \u064a\u064e\u063a\u064f\u0636\u0651\u064f\u0648\u0627 \u0645\u0650\u0646\u0652 \u0623\u064e\u0628\u0652\u0635\u064e\u0627\u0631\u0650\u0647\u0650\u0645\u0652\ufd3e [\u0633\u0648\u0631\u0629 \u0627\u0644\u0646\u0648\u0631: \u0663\u0660].                    ","\n                    \u0661- \u0627\u0644\u0646\u0641\u0633 \u0627\u0644\u0623\u0645\u0627\u0631\u0629 \u0628\u0627\u0644\u0633\u0648\u0621: \u0648\u0630\u0644\u0643 \u0623\u0646 \u064a\u062a\u0628\u0639 \u0627\u0644\u0625\u0646\u0633\u0627\u0646 \u0645\u0627 \u062a\u0645\u0644\u064a\u0647 \u0639\u0644\u064a\u0647 \u0646\u0641\u0633\u0647 \u0648\u0647\u0648\u0627\u0647 \u0641\u064a \u0645\u0639\u0635\u064a\u0629 \u0627\u0644\u0644\u0647 \u062a\u064e\u0628\u064e\u0627\u0631\u064e\u0643\u064e \u0648\u064e\u062a\u064e\u0639\u064e\u0627\u0644\u064e\u0649\u060c \u0642\u0627\u0644 \u0633\u064f\u0628\u0652\u062d\u064e\u0627\u0646\u064e\u0647\u064f: \ufd3f\u0625\u0650\u0646\u0651\u064e \u0671\u0644\u0646\u0651\u064e\u0641\u06e1\u0633\u064e \u0644\u064e\u0623\u064e\u0645\u0651\u064e\u0627\u0631\u064e\u0629\u064f\u06e2 \u0628\u0650\u0671\u0644\u0633\u0651\u064f\u0648\u06e4\u0621\u0650 \u0625\u0650\u0644\u0651\u064e\u0627 \u0645\u064e\u0627 \u0631\u064e\u062d\u0650\u0645\u064e \u0631\u064e\u0628\u0651\u0650\u064a\u06da \u0625\u0650\u0646\u0651\u064e \u0631\u064e\u0628\u0651\u0650\u064a \u063a\u064e\u0641\u064f\u0648\u0631\u064c \u0631\u0651\u064e\u062d\u0650\u064a\u0645\u064c\ufd3e [\u0633\u0648\u0631\u0629 \u064a\u0648\u0633\u0641: \u0665\u0663]. \u0662- \u0627\u0644\u0634\u064a\u0637\u0627\u0646: \u0648\u0647\u0648 \u0639\u062f\u0648 \u0627\u0628\u0646 \u0622\u062f\u0645 \u0648\u063a\u0627\u064a\u062a\u0647 \u0623\u0646 \u064a\u0636\u0644 \u0627\u0644\u0625\u0646\u0633\u0627\u0646 \u0648\u064a\u0648\u0633\u0648\u0633 \u0644\u0647 \u0641\u064a \u0627\u0644\u0634\u0631 \u0648\u064a\u062f\u062e\u0644\u0647 \u0627\u0644\u0646\u0627\u0631. \u0642\u0627\u0644 \u062a\u064e\u0639\u064e\u0627\u0644\u064e\u0649: \ufd3f\u0648\u064e\u0644\u064e\u0627 \u062a\u064e\u062a\u0651\u064e\u0628\u0650\u0639\u064f\u0648\u0627 \u062e\u064f\u0637\u064f\u0648\u064e\u200a\u0670\u2060\u062a\u0650 \u0671\u0644\u0634\u0651\u064e\u064a\u0637\u064e\u0640\u0670\u0646\u0650\u06da \u0625\u0650\u0646\u0651\u064e\u0647\u064f\u06e5 \u0644\u064e\u0643\u064f\u0645\u06e1 \u0639\u064e\u062f\u064f\u0648\u0651\u064c \u0645\u0651\u064f\u0628\u0650\u064a\u0646\u064c\ufd3e [\u0633\u0648\u0631\u0629 \u0627\u0644\u0628\u0642\u0631\u0629: \u0661\u0666\u0668]. 3- \u0623\u0635\u062d\u0627\u0628 \u0627\u0644\u0633\u0648\u0621: \u0627\u0644\u0630\u064a\u0646 \u064a\u062d\u062b\u0651\u0648\u0646 \u0639\u0644\u0649 \u0627\u0644\u0634\u0631\u060c \u0648\u064a\u0635\u062f\u0651\u0648\u0646 \u0639\u0646 \u0627\u0644\u062e\u064a\u0631. \u0642\u0627\u0644 \u062a\u064e\u0639\u064e\u0627\u0644\u064e\u0649: \ufd3f\u0627\u0644\u0652\u0623\u064e\u062e\u0650\u0644\u0651\u064e\u0627\u0621\u064f \u064a\u064e\u0648\u0652\u0645\u064e\u0626\u0650\u0630\u064d \u0628\u064e\u0639\u0652\u0636\u064f\u0647\u064f\u0645\u0652 \u0644\u0650\u0628\u064e\u0639\u0652\u0636\u064d \u0639\u064e\u062f\u064f\u0648\u0651\u064c \u0625\u0650\u0644\u0651\u064e\u0627 \u0627\u0644\u0652\u0645\u064f\u062a\u0651\u064e\u0642\u0650\u064a\u0646\u064e\ufd3e [\u0633\u0648\u0631\u0629 \u0627\u0644\u0632\u062e\u0631\u0641: 67].                    ","\n                    \u062c- \u0627\u0644\u062a\u0648\u0628\u0629: \u0647\u064a \u0627\u0644\u0631\u062c\u0648\u0639 \u0639\u0646 \u0645\u0639\u0635\u064a\u0629 \u0627\u0644\u0644\u0647 \u062a\u064e\u0639\u064e\u0627\u0644\u064e\u0649 \u0625\u0644\u0649 \u0637\u0627\u0639\u062a\u0647. \u0642\u0627\u0644 \u062a\u064e\u0639\u064e\u0627\u0644\u064e\u0649: \ufd3f\u0648\u064e\u0625\u0650\u0646\u0651\u0650\u064a \u0644\u064e\u063a\u064e\u0641\u0651\u064e\u0627\u0631\u064c \u0644\u0651\u0650\u0645\u064e\u0646 \u062a\u064e\u0627\u0628\u064e \u0648\u064e\u0621\u064e\u0627\u0645\u064e\u0646\u064e \u0648\u064e\u0639\u064e\u0645\u0650\u0644\u064e \u0635\u064e\u0640\u0670\u0644\u0650\u062d\u064b\u0627 \u062b\u064f\u0645\u0651\u064e \u0671\u0647\u06e1\u062a\u064e\u062f\u064e\u0649\u0670\ufd3e [\u0633\u0648\u0631\u0629 \u0637\u0647: \u0668\u0662].                    ","\n                    \u062c- \u0661 - \u0627\u0644\u0625\u0642\u0644\u0627\u0639 \u0639\u0646 \u0627\u0644\u0630\u0646\u0628.\n\u0662 - \u0627\u0644\u0646\u062f\u0645 \u0639\u0644\u0649 \u0645\u0627 \u0641\u0627\u062a.\n\u0663 - \u0627\u0644\u0639\u0632\u0645 \u0639\u0644\u0649 \u0639\u062f\u0645 \u0627\u0644\u0639\u0648\u062f\u0629 \u0625\u0644\u064a\u0647.\n\u0664- \u0631\u062f \u0627\u0644\u062d\u0642\u0648\u0642 \u0648\u0627\u0644\u0645\u0638\u0627\u0644\u0645 \u0644\u0623\u0647\u0644\u0647\u0627.\n\u0642\u0627\u0644 \u062a\u064e\u0639\u064e\u0627\u0644\u064e\u0649: \ufd3f\u0648\u064e\u0671\u0644\u0651\u064e\u0630\u0650\u064a\u0646\u064e \u0625\u0650\u0630\u064e\u0627 \u0641\u064e\u0639\u064e\u0644\u064f\u0648\u0627 \u0641\u064e\u0640\u0670\u062d\u0650\u0634\u064e\u0629\u064b \u0623\u064e\u0648\u06e1 \u0638\u064e\u0644\u064e\u0645\u064f\u0648\u06e4\u0627 \u0623\u064e\u0646\u0641\u064f\u0633\u064e\u0647\u064f\u0645\u06e1 \u0630\u064e\u0643\u064e\u0631\u064f\u0648\u0627 \u0671\u0644\u0644\u0651\u064e\u0647\u064e \u0641\u064e\u0671\u0633\u06e1\u062a\u064e\u063a\u06e1\u0641\u064e\u0631\u064f\u0648\u0627 \u0644\u0650\u0630\u064f\u0646\u064f\u0648\u0628\u0650\u0647\u0650\u0645\u06e1 \u0648\u064e\u0645\u064e\u0646 \u064a\u064e\u063a\u06e1\u0641\u0650\u0631\u064f \u0671\u0644\u0630\u0651\u064f\u0646\u064f\u0648\u0628\u064e \u0625\u0650\u0644\u0651\u064e\u0627 \u0671\u0644\u0644\u0651\u064e\u0647\u064f \u0648\u064e\u0644\u064e\u0645\u06e1 \u064a\u0635\u0650\u0631\u0651\u064f\u0648\u0627 \u0639\u064e\u0644\u064e\u0649\u0670 \u0645\u064e\u0627 \u0641\u064e\u0639\u064e\u0644\u064f\u0648\u0627 \u0648\u064e\u0647\u064f\u0645\u06e1 \u064a\u064e\u0639\u06e1\u0644\u064e\u0645\u064f\u0648\u0646\u064e 135\ufd3e [\u0633\u0648\u0631\u0629 \u0622\u0644 \u0639\u0645\u0631\u0627\u0646: \u0661\u0663\u0665].                    ","\n                    \u062c- \u0645\u0639\u0646\u0627\u0647\u0627 \u0623\u0646\u0643 \u062a\u062f\u0639\u0648 \u0627\u0644\u0644\u0647 \u0623\u0646 \u064a\u062b\u0646\u064a \u0639\u0644\u0649 \u0646\u0628\u064a\u0647 \ufdfa \u0641\u064a \u0627\u0644\u0645\u0644\u0623 \u0627\u0644\u0623\u0639\u0644\u0649.                    ","\n                    \u062c- \u0627\u0644\u062a\u0633\u0628\u064a\u062d \u0648\u0647\u0648 \u062a\u0646\u0632\u064a\u0647\u0647 \u0633\u064f\u0628\u0652\u062d\u064e\u0627\u0646\u064e\u0647\u064f \u0648\u064e\u062a\u064e\u0639\u064e\u0627\u0644\u064e\u0649 \u0639\u0646 \u0643\u0644 \u0646\u0642\u0635 \u0648\u0639\u064a\u0628 \u0648\u0633\u0648\u0621.                    ","\n                    \u062c- \u0647\u0648 \u0627\u0644\u062b\u0646\u0627\u0621 \u0639\u0644\u0649 \u0627\u0644\u0644\u0647 \u062a\u064e\u0639\u064e\u0627\u0644\u064e\u0649\u060c \u0648\u0648\u0635\u0641\u0647 \u0628\u0643\u0644 \u0635\u0641\u0627\u062a \u0627\u0644\u0643\u0645\u0627\u0644.                    ","\n                    \u062c- \u0623\u064a \u0623\u0646\u0647 \u0633\u064f\u0628\u0652\u062d\u064e\u0627\u0646\u064e\u0647\u064f \u0623\u0643\u0628\u0631 \u0645\u0646 \u0643\u0644 \u0634\u064a\u0621 \u0648\u0623\u062c\u0644 \u0648\u0623\u0639\u0638\u0645 \u0648\u0623\u0639\u0632 \u0645\u0646 \u0643\u0644 \u0634\u064a\u0621.                    ","\n                    \u062c- \u0645\u0639\u0646\u0627\u0647\u0627: \u0644\u0627 \u062a\u062d\u0648\u0644 \u0644\u0644\u0639\u0628\u062f \u0645\u0646 \u062d\u0627\u0644 \u0625\u0644\u0649 \u062d\u0627\u0644\u060c \u0648\u0644\u0627 \u0642\u0648\u0629 \u0644\u0647 \u0639\u0644\u0649 \u0630\u0644\u0643 \u0625\u0644\u0627 \u0628\u0627\u0644\u0644\u0647.                    ","\n                    \u062c- \u0623\u064a: \u0637\u0644\u0628 \u0627\u0644\u0639\u0628\u062f \u0645\u0650\u0646 \u0631\u0628\u0651\u0650\u0647 \u0623\u0646 \u064a\u0645\u062d\u0648 \u0630\u0646\u0648\u0628\u064e\u0647 \u0648\u064a\u0633\u062a\u0631 \u0639\u064a\u0648\u0628\u064e\u0647.                    "]),t.s)
