B.Aj=A.a(s(["\n                    \u062c- \u0627\u0644\u0637\u0647\u0627\u0631\u0629: \u0647\u064a \u0631\u0641\u0639 \u0627\u0644\u062d\u062f\u062b\u060c \u0648\u0632\u0648\u0627\u0644 \u0627\u0644\u062e\u0628\u062b.\n\u0637\u0647\u0627\u0631\u0629 \u0627\u0644\u062e\u0628\u062b: \u0648\u0647\u064a \u0623\u0646 \u064a\u0632\u064a\u0644 \u0627\u0644\u0645\u0633\u0644\u0645 \u0645\u0627 \u0648\u0642\u0639 \u0645\u0646 \u0627\u0644\u0646\u062c\u0627\u0633\u0629 \u0639\u0644\u0649 \u0628\u062f\u0646\u0647\u060c \u0623\u0648 \u0639\u0644\u0649 \u062b\u0648\u0628\u0647\u060c \u0623\u0648 \u0639\u0644\u0649 \u0627\u0644\u0628\u0642\u0639\u0629 \u0648\u0627\u0644\u0645\u0643\u0627\u0646 \u0627\u0644\u0630\u064a \u064a\u0635\u0644\u064a \u0641\u064a\u0647.\n\u0637\u0647\u0627\u0631\u0629 \u0627\u0644\u062d\u062f\u062b: \u0648\u0647\u064a \u0627\u0644\u062a\u064a \u062a\u0643\u0648\u0646 \u0628\u0627\u0644\u0648\u0636\u0648\u0621 \u0623\u0648 \u0627\u0644\u063a\u0633\u0644\u060c \u0628\u0627\u0644\u0645\u0627\u0621 \u0627\u0644\u0637\u0647\u0648\u0631\u060c \u0623\u0648 \u0627\u0644\u062a\u064a\u0645\u0645 \u0644\u0645\u0646 \u0641\u0642\u062f \u0627\u0644\u0645\u0627\u0621\u060c \u0623\u0648 \u062a\u0639\u0630\u0631 \u0639\u0644\u064a\u0647 \u0627\u0633\u062a\u0639\u0645\u0627\u0644\u0647.                    ","\n                    \u062c- \u0628\u063a\u0633\u0644\u0647 \u0628\u0627\u0644\u0645\u0627\u0621 \u062d\u062a\u0649 \u064a\u0637\u0647\u0631.\n- \u0648\u0623\u0645\u0627 \u0645\u0627 \u0648\u0644\u063a \u0628\u0647 \u0627\u0644\u0643\u0644\u0628\u061b \u0641\u064a\u063a\u0633\u0644 \u0633\u0628\u0639 \u0645\u0631\u0627\u062a \u0627\u0644\u0623\u0648\u0644\u0649 \u0628\u0627\u0644\u062a\u0631\u0627\u0628.                    ","\n                    \u062c- \u0642\u0627\u0644 \u0627\u0644\u0646\u0628\u064a \u0639\u064e\u0644\u064e\u064a\u0652\u0647\u0650 \u0627\u0644\u0635\u0651\u064e\u0644\u064e\u0627\u0629\u064f \u0648\u064e\u0627\u0644\u0633\u0651\u064e\u0644\u064e\u0627\u0645\u064f: \xab\u0625\u0630\u0627 \u062a\u0648\u0636\u0623 \u0627\u0644\u0639\u0628\u062f \u0627\u0644\u0645\u0633\u0644\u0645\xbb - \u0623\u0648 \xab\u0627\u0644\u0645\u0624\u0645\u0646\xbb- \xab\u0641\u063a\u0633\u0644 \u0648\u062c\u0647\u0647\u061b \u062e\u0631\u062c \u0645\u0646 \u0648\u062c\u0647\u0647 \u0643\u0644 \u062e\u0637\u064a\u0626\u0629\u064d \u0646\u0638\u0631 \u0625\u0644\u064a\u0647\u0627 \u0628\u0639\u064a\u0646\u064a\u0647 \u0645\u0639 \u0627\u0644\u0645\u0627\u0621\xbb - \u0623\u0648 \xab\u0645\u0639 \u0622\u062e\u0631 \u0642\u0637\u0631 \u0627\u0644\u0645\u0627\u0621\xbb - \xab\u0641\u0625\u0630\u0627 \u063a\u0633\u0644 \u064a\u062f\u064a\u0647\u061b \u062e\u0631\u062c \u0645\u0646 \u064a\u062f\u064a\u0647 \u0643\u0644 \u062e\u0637\u064a\u0626\u0629 \u0643\u0627\u0646 \u0628\u0637\u0634\u062a\u0647\u0627 \u064a\u062f\u0627\u0647 \u0645\u0639 \u0627\u0644\u0645\u0627\u0621\xbb -\u0623\u0648 \xab\u0645\u0639 \u0622\u062e\u0631 \u0642\u0637\u0631 \u0627\u0644\u0645\u0627\u0621\xbb - \xab\u0641\u0625\u0630\u0627 \u063a\u0633\u0644 \u0631\u062c\u0644\u064a\u0647\u061b \u062e\u0631\u062c\u062a \u0643\u0644 \u062e\u0637\u064a\u0626\u0629 \u0645\u0634\u062a\u0647\u0627 \u0631\u062c\u0644\u0627\u0647 \u0645\u0639 \u0627\u0644\u0645\u0627\u0621\xbb -\u0623\u0648 \xab\u0645\u0639 \u0622\u062e\u0631 \u0642\u0637\u0631 \u0627\u0644\u0645\u0627\u0621\xbb - \xab\u062d\u062a\u0649 \u064a\u062e\u0631\u062c \u0646\u0642\u064a\u0627 \u0645\u0646 \u0627\u0644\u0630\u0646\u0648\u0628\xbb. \u0631\u0648\u0627\u0647 \u0645\u0633\u0644\u0645.                    ",'\n                    \u062c- \u063a\u0633\u0644 \u0627\u0644\u0643\u0641\u064a\u0646 \u062b\u0644\u0627\u062b\u064b\u0627.\n\u0648\u062a\u062a\u0645\u0636\u0645\u0636 \u0648\u062a\u0633\u062a\u0646\u0634\u0642 \u0648\u062a\u0633\u062a\u0646\u062b\u0631 \u062b\u0644\u0627\u062b\u064b\u0627.\n\u0648\u0627\u0644\u0645\u0636\u0645\u0636\u0629: \u062c\u0639\u0644 \u0627\u0644\u0645\u0627\u0621 \u0641\u064a \u0627\u0644\u0641\u0645 \u0648\u0645\u062c\u0647 \u0648\u0637\u0631\u062d\u0647.\n\u0648\u0627\u0644\u0627\u0633\u062a\u0646\u0634\u0627\u0642: \u062c\u0630\u0628 \u0627\u0644\u0645\u0627\u0621 \u0628\u0627\u0644\u0647\u0648\u0627\u0621 \u0625\u0644\u0649 \u062f\u0627\u062e\u0644 \u0627\u0644\u0623\u0646\u0641 \u0628\u064a\u0645\u064a\u0646\u0647.\n\u0648\u062a\u0633\u062a\u0646\u062b\u0631: \u0648\u0647\u0648 \u0625\u062e\u0631\u0627\u062c \u0627\u0644\u0645\u0627\u0621 \u0645\u0646 \u0627\u0644\u0623\u0646\u0641 \u0628\u0639\u062f \u0627\u0644\u0627\u0633\u062a\u0646\u0634\u0627\u0642 \u0628\u064a\u0633\u0627\u0631\u0647.\n\u062b\u0645 \u063a\u0633\u0644 \u0627\u0644\u0648\u062c\u0647 \u062b\u0644\u0627\u062b\u064b\u0627.\n\u062b\u0645 \u063a\u0633\u0644 \u0627\u0644\u064a\u062f\u064a\u0646 \u0625\u0644\u0649 \u0627\u0644\u0645\u0631\u0641\u0642\u064a\u0646 \u062b\u0644\u0627\u062b\u064b\u0627.\n\u062b\u0645 \u0645\u0633\u062d \u0627\u0644\u0631\u0623\u0633 \u062a\u0642\u0628\u0644 \u0628\u064a\u062f\u064a\u0643 \u0648\u062a\u062f\u0628\u0631\u060c \u0648\u062a\u0645\u0633\u062d \u0627\u0644\u0623\u0630\u0646\u064a\u0646.\n\u062b\u0645 \u062a\u063a\u0633\u0644 \u0631\u062c\u0644\u064a\u0643 \u0625\u0644\u0649 \u0627\u0644\u0643\u0639\u0628\u064a\u0646 \u062b\u0644\u0627\u062b\u064b\u0627.\n\u0647\u0630\u0627 \u0647\u0648 \u0627\u0644\u0623\u0643\u0645\u0644\u060c \u0648\u0642\u062f \u062b\u0628\u062a \u0630\u0644\u0643 \u0639\u0646 \u0627\u0644\u0646\u0628\u064a \ufdfa \u0641\u064a \u0623\u062d\u0627\u062f\u064a\u062b \u0641\u064a \u0627\u0644\u0628\u062e\u0627\u0631\u064a \u0648\u0645\u0633\u0644\u0645\u060c \u0631\u0648\u0627\u0647\u0627 \u0639\u0646\u0647 \u0639\u062b\u0645\u0627\u0646 \u0648\u0639\u0628\u062f \u0627\u0644\u0644\u0647 \u0628\u0646 \u0632\u064a\u062f \u0648\u063a\u064a\u0631\u0647\u0645\u0627\u060c \u0648\u0642\u062f \u062b\u0628\u062a \u0623\u064a\u0636\u064b\u0627 \u0639\u0646\u0647 \u0641\u064a \u0627\u0644\u0628\u062e\u0627\u0631\u064a \u0648\u063a\u064a\u0631\u0647: "\u0623\u0646\u0647 \u062a\u0648\u0636\u0623 \u0645\u0631\u0629 \u0645\u0631\u0629\u060c \u0648\u0623\u0646\u0647 \u062a\u0648\u0636\u0623 \u0645\u0631\u062a\u064a\u0646 \u0645\u0631\u062a\u064a\u0646" \u0628\u0645\u0639\u0646\u0649: \u0623\u0646\u0647 \u064a\u063a\u0633\u0644 \u0643\u0644 \u0639\u0636\u0648 \u0645\u0646 \u0623\u0639\u0636\u0627\u0621 \u0627\u0644\u0648\u0636\u0648\u0621 \u0645\u0631\u0629\u060c \u0623\u0648 \u0645\u0631\u062a\u064a\u0646.                    ',"\n                    \u062c- \u0647\u064a \u0627\u0644\u062a\u064a \u0644\u0627 \u064a\u0635\u062d \u0648\u0636\u0648\u0621 \u0627\u0644\u0645\u0633\u0644\u0645 \u0625\u0630\u0627 \u062a\u0631\u0643 \u0648\u0627\u062d\u062f\u0629 \u0645\u0646\u0647\u0627.\n1- \u063a\u0633\u0644 \u0627\u0644\u0648\u062c\u0647 \u0648\u0645\u0646\u0647 \u0627\u0644\u0645\u0636\u0645\u0636\u0629 \u0627\u0644\u0627\u0633\u062a\u0646\u0634\u0627\u0642.\n2- \u063a\u0633\u0644 \u0627\u0644\u064a\u062f\u064a\u0646 \u0625\u0644\u0649 \u0627\u0644\u0645\u0631\u0641\u0642\u064a\u0646.\n3- \u0645\u0633\u062d \u0627\u0644\u0631\u0623\u0633 \u0648\u0645\u0646\u0647 \u0627\u0644\u0623\u0630\u0646\u064a\u0646.\n4- \u063a\u0633\u0644 \u0627\u0644\u0631\u062c\u0644\u064a\u0646 \u0625\u0644\u0649 \u0627\u0644\u0643\u0639\u0628\u064a\u0646.\n5- \u0627\u0644\u062a\u0631\u062a\u064a\u0628 \u0628\u064a\u0646 \u0627\u0644\u0627\u0639\u0636\u0627\u0621\u060c \u0628\u0623\u0646 \u064a\u063a\u0633\u0644 \u0627\u0644\u0648\u062c\u0647\u060c \u062b\u0645 \u0627\u0644\u064a\u062f\u064a\u0646\u060c \u062b\u0645 \u0645\u0633\u062d \u0627\u0644\u0631\u0623\u0633\u060c \u062b\u0645 \u063a\u0633\u0644 \u0627\u0644\u0631\u062c\u0644\u064a\u0646.\n6- \u0627\u0644\u0645\u0648\u0627\u0644\u0627\u0629: \u0648\u0647\u064a \u0627\u0644\u0648\u0636\u0648\u0621 \u0641\u064a \u0648\u0642\u062a \u0645\u062a\u0648\u0627\u0635\u0644\u060c \u062f\u0648\u0646 \u0641\u0627\u0635\u0644 \u0645\u0646 \u0627\u0644\u0648\u0642\u062a \u062d\u062a\u0649 \u062a\u062c\u0641 \u0627\u0644\u0623\u0639\u0636\u0627\u0621 \u0645\u0646 \u0627\u0644\u0645\u0627\u0621.\n- \u0643\u0623\u0646 \u064a\u062a\u0648\u0636\u0623 \u0646\u0635\u0641 \u0648\u0636\u0648\u0621\u060c \u0648\u064a\u0643\u0645\u0644 \u0641\u064a \u0648\u0642\u062a \u0622\u062e\u0631\u060c \u0641\u0644\u0627 \u064a\u0635\u062d \u0648\u0636\u0648\u0621\u0647.                    ","\n                    \u062c- \u0633\u0646\u0646 \u0627\u0644\u0648\u0636\u0648\u0621: \u0648\u0647\u064a \u0627\u0644\u062a\u064a \u0644\u0648 \u0641\u0639\u0644\u0647\u0627\u061b \u0644\u0647 \u0645\u0632\u064a\u062f \u0645\u0646 \u0627\u0644\u0623\u062c\u0631 \u0648\u0627\u0644\u062b\u0648\u0627\u0628\u060c \u0648\u0644\u0648 \u062a\u0631\u0643\u0647\u0627\u061b \u0641\u0644\u0627 \u0625\u062b\u0645 \u0639\u0644\u064a\u0647\u060c \u0648\u0648\u0636\u0648\u0624\u0647 \u0635\u062d\u064a\u062d.\n1- \u0627\u0644\u062a\u0633\u0645\u064a\u0629: \u0628\u0633\u0645 \u0627\u0644\u0644\u0647.\n2-\u0627\u0644\u0633\u0648\u0627\u0643.\n3- \u063a\u0633\u0644 \u0627\u0644\u0643\u0641\u064a\u0646.\n4- \u062a\u062e\u0644\u064a\u0644 \u0627\u0644\u0623\u0635\u0627\u0628\u0639.\n5- \u0627\u0644\u063a\u0633\u0644\u0629 \u0627\u0644\u062b\u0627\u0646\u064a\u0629 \u0648\u0627\u0644\u062b\u0627\u0644\u062b\u0629 \u0644\u0644\u0623\u0639\u0636\u0627\u0621.\n6- \u0627\u0644\u0628\u062f\u0621 \u0628\u0627\u0644\u064a\u0645\u064a\u0646.\n7- \u0627\u0644\u0630\u0643\u0631 \u0628\u0639\u062f \u0627\u0644\u0648\u0636\u0648\u0621: \xab\u0623\u0634\u0647\u062f \u0623\u0646 \u0644\u0627 \u0625\u0644\u0647 \u0625\u0644\u0627 \u0627\u0644\u0644\u0647\u060c \u0648\u062d\u062f\u0647 \u0644\u0627 \u0634\u0631\u064a\u0643 \u0644\u0647\u060c \u0648\u0623\u0634\u0647\u062f \u0623\u0646 \u0645\u062d\u0645\u062f\u064b\u0627 \u0639\u0628\u062f\u0647 \u0648\u0631\u0633\u0648\u0644\u0647\xbb.\n8-\u0627\u0644\u0635\u0644\u0627\u0629 \u0631\u0643\u0639\u062a\u064a\u0646 \u0628\u0639\u062f\u0647.                    ","\n                    \u062c- \u0645\u0627 \u062e\u0631\u062c \u0645\u0646 \u0627\u0644\u0633\u0628\u064a\u0644\u064a\u0646 \u0627\u0644\u0642\u0628\u0644 \u0648\u0627\u0644\u062f\u0628\u0631\u060c \u0645\u0646 \u0628\u0648\u0644 \u0623\u0648 \u063a\u0627\u0626\u0637 \u0623\u0648 \u0631\u064a\u062d.\n\u0627\u0644\u0646\u0648\u0645\u060c \u0623\u0648 \u0627\u0644\u062c\u0646\u0648\u0646 \u0623\u0648 \u0627\u0644\u0625\u063a\u0645\u0627\u0621.\n\u0623\u0643\u0644 \u0644\u062d\u0645 \u0627\u0644\u0625\u0628\u0644.\n\u0645\u0633 \u0627\u0644\u0642\u0628\u0644 \u0623\u0648 \u0627\u0644\u062f\u0628\u0631 \u0628\u0627\u0644\u064a\u062f \u0628\u062f\u0648\u0646 \u062d\u0627\u0626\u0644.                    ","\n                    \u062c- \u0627\u0644\u062a\u064a\u0645\u0645: \u0647\u0648 \u0627\u0633\u062a\u0639\u0645\u0627\u0644 \u0627\u0644\u062a\u0631\u0627\u0628 \u0648\u063a\u064a\u0631\u0647 \u0645\u0646 \u0635\u0639\u064a\u062f \u0627\u0644\u0623\u0631\u0636\u060c \u0639\u0646\u062f \u0641\u0642\u062f \u0627\u0644\u0645\u0627\u0621 \u0623\u0648 \u062a\u0639\u0630\u0631 \u0627\u0633\u062a\u0639\u0645\u0627\u0644\u0647.                    ","\n                    \u062c- \u0636\u0631\u0628 \u0627\u0644\u062a\u0631\u0627\u0628 \u0636\u0631\u0628\u0629 \u0648\u0627\u062d\u062f\u0629 \u0628\u0628\u0627\u0637\u0646 \u0627\u0644\u0643\u0641\u064a\u0646\u060c \u0648\u0645\u0633\u062d \u0627\u0644\u0648\u062c\u0647 \u0648\u0638\u0627\u0647\u0631 \u0627\u0644\u0643\u0641\u064a\u0646 \u0645\u0631\u0629 \u0648\u0627\u062d\u062f\u0629.                    ","\n                    \u062c- \u0643\u0644 \u0646\u0648\u0627\u0642\u0636 \u0627\u0644\u0648\u0636\u0648\u0621.\n\u0625\u0630\u0627 \u0648\u062c\u062f \u0627\u0644\u0645\u0627\u0621.                    ","\n                    \u062c- \u0627\u0644\u062e\u0641\u064a\u0646: \u0645\u0627 \u064a\u0644\u0628\u0633 \u0641\u064a \u0627\u0644\u0631\u0651\u0650\u062c\u0644\u0650 \u0645\u0646 \u0627\u0644\u062c\u0644\u062f.\n\u0627\u0644\u062c\u0648\u0631\u0628\u064a\u0646: \u0645\u0627 \u064a\u0644\u0628\u0633 \u0641\u064a \u0627\u0644\u0631\u0651\u0650\u062c\u0644\u0650 \u0645\u0646 \u063a\u064a\u0631 \u0627\u0644\u062c\u0644\u062f.\n\u0648\u064a\u0634\u0631\u0639 \u0627\u0644\u0645\u0633\u062d \u0639\u0644\u064a\u0647\u0645\u0627 \u0628\u062f\u0644 \u063a\u0633\u0644 \u0627\u0644\u0631\u062c\u0644\u064a\u0646.                    ","\n                    \u062c- \u0627\u0644\u062a\u064a\u0633\u064a\u0631 \u0648\u0627\u0644\u062a\u062e\u0641\u064a\u0641 \u0639\u0644\u0649 \u0627\u0644\u0639\u0628\u0627\u062f\u060c \u062e\u0627\u0635\u0629 \u0641\u064a \u0623\u0648\u0642\u0627\u062a \u0627\u0644\u0628\u0631\u062f \u0648\u0627\u0644\u0634\u062a\u0627\u0621 \u0648\u0627\u0644\u0633\u0641\u0631\u060c \u062d\u064a\u062b \u064a\u0634\u0642 \u0646\u0632\u0639 \u0645\u0627 \u0641\u064a \u0627\u0644\u0631\u062c\u0644\u064a\u0646.                    ","\n                    \u062c- \u0661- \u0623\u0646 \u064a\u0644\u0628\u0633 \u0627\u0644\u062e\u0641\u064a\u0646 \u0639\u0644\u0649 \u0637\u0647\u0627\u0631\u0629\u060c \u0623\u064a \u0628\u0639\u062f \u0648\u0636\u0648\u0621.\n\u0662- \u0623\u0646 \u064a\u0643\u0648\u0646 \u0627\u0644\u062e\u0641 \u0637\u0627\u0647\u0631\u060c \u0641\u0644\u0627 \u064a\u062c\u0648\u0632 \u0627\u0644\u0645\u0633\u062d \u0639\u0644\u0649 \u0627\u0644\u0646\u062c\u0633.\n\u0663- \u0623\u0646 \u064a\u0643\u0648\u0646 \u0627\u0644\u062e\u0641 \u0633\u0627\u062a\u0631\u0627\u064b \u0644\u0644\u0645\u062d\u0644 \u0627\u0644\u0645\u0641\u0631\u0648\u0636 \u063a\u0633\u0644\u0647 \u0641\u064a \u0627\u0644\u0648\u0636\u0648\u0621.\n\u0664- \u0623\u0646 \u064a\u0643\u0648\u0646 \u0627\u0644\u0645\u0633\u062d \u062e\u0644\u0627\u0644 \u0627\u0644\u0645\u062f\u0629 \u0627\u0644\u0645\u062d\u062f\u062f\u0629\u060c \u0644\u0644\u0645\u0642\u064a\u0645 \u063a\u064a\u0631 \u0627\u0644\u0645\u0633\u0627\u0641\u0631: \u064a\u0648\u0645 \u0648\u0644\u064a\u0644\u0629\u060c \u0648\u0644\u0644\u0645\u0633\u0627\u0641\u0631: \u062b\u0644\u0627\u062b\u0629 \u0623\u064a\u0627\u0645 \u0648\u0644\u064a\u0627\u0644\u064a\u0647\u0627.                    ","\n                    \u062c- \u0623\u0645\u0627 \u0635\u0641\u0629 \u0627\u0644\u0645\u0633\u062d \u0641\u0647\u064a: \u0623\u0646 \u064a\u0636\u0639 \u0623\u0635\u0627\u0628\u0639 \u064a\u062f\u064a\u0647 \u0645\u0628\u0644\u0648\u0644\u062a\u064a\u0646 \u0628\u0627\u0644\u0645\u0627\u0621 \u0639\u0644\u0649 \u0623\u0635\u0627\u0628\u0639 \u0631\u062c\u0644\u064a\u0647 \u062b\u0645\u0651\u064e \u064a\u064f\u0645\u0631\u0651\u064f\u0647\u0645\u0627 \u0625\u0644\u0649 \u0633\u0627\u0642\u0647\u060c \u064a\u0645\u0633\u062d \u0627\u0644\u0631\u062c\u0644 \u0627\u0644\u064a\u0645\u0646\u0649 \u0628\u0627\u0644\u064a\u062f \u0627\u0644\u064a\u0645\u0646\u0649\u060c \u0648\u0627\u0644\u0631\u062c\u0644 \u0627\u0644\u064a\u0633\u0631\u0649 \u0628\u0627\u0644\u064a\u062f \u0627\u0644\u064a\u0633\u0631\u0649\u060c \u0648\u064a\u064f\u0641\u0631\u0651\u0650\u062c \u0623\u0635\u0627\u0628\u0639\u0647 \u0625\u0630\u0627 \u0645\u0633\u062d \u0648\u0644\u0627 \u064a\u0643\u0631\u0631.                    ","\n                    \u062c- \u0661- \u0627\u0646\u0642\u0636\u0627\u0621 \u0645\u062f\u0629 \u0627\u0644\u0645\u0633\u062d\u060c \u0641\u0644\u0627 \u064a\u062c\u0648\u0632 \u0627\u0644\u0645\u0633\u062d \u0639\u0644\u0649 \u0627\u0644\u062e\u0641\u064a\u0646 \u0628\u0639\u062f \u0627\u0646\u0642\u0636\u0627\u0621 \u0645\u062f\u0629 \u0627\u0644\u0645\u0633\u062d \u0627\u0644\u0645\u062d\u062f\u062f\u0629 \u0634\u0631\u0639\u0627\u064b\u060c \u064a\u0648\u0645 \u0648\u0644\u064a\u0644\u0629 \u0644\u0644\u0645\u0642\u064a\u0645 \u0648\u062b\u0644\u0627\u062b\u0629 \u0623\u064a\u0627\u0645 \u0628\u0644\u064a\u0627\u0644\u064a\u0647\u0627 \u0644\u0644\u0645\u0633\u0627\u0641\u0631.\n\u0662 - \u062e\u0644\u0639 \u0627\u0644\u062e\u0641\u064a\u0646 \u0641\u0625\u0630\u0627 \u0646\u0632\u0639 \u0627\u0644\u0625\u0646\u0633\u0627\u0646 \u0627\u0644\u062e\u0641\u064a\u0646 \u0623\u0648 \u0623\u062d\u062f\u0647\u0645\u0627 \u0628\u0639\u062f \u0645\u0633\u062d\u0647 \u0628\u0637\u0644\xa0\u0627\u0644\u0645\u0633\u062d\xa0\u0639\u0644\u064a\u0647\u0645\u0627.                    ","\n                    \u062c- \u0627\u0644\u0635\u0644\u0627\u0629: \u0647\u064a \u0627\u0644\u062a\u0639\u0628\u062f \u0644\u0644\u0647 \u0628\u0623\u0642\u0648\u0627\u0644 \u0648\u0623\u0639\u0645\u0627\u0644 \u0645\u062e\u0635\u0648\u0635\u0629\u060c \u0645\u0641\u062a\u062a\u062d\u0629 \u0628\u0627\u0644\u062a\u0643\u0628\u064a\u0631\u060c \u0645\u062e\u062a\u062a\u0645\u0629 \u0628\u0627\u0644\u062a\u0633\u0644\u064a\u0645.                    ","\n                    \u062c- \u0627\u0644\u0635\u0644\u0627\u0629 \u0641\u0631\u064a\u0636\u0629 \u0639\u0644\u0649 \u0643\u0644 \u0645\u0633\u0644\u0645.\n\u0642\u0627\u0644 \u062a\u064e\u0639\u064e\u0627\u0644\u064e\u0649: \ufd3f\u0625\u0650\u0646\u0651\u064e \u0627\u0644\u0635\u0651\u064e\u0644\u064e\u0627\u0629\u064e \u0643\u064e\u0627\u0646\u064e\u062a\u0652 \u0639\u064e\u0644\u064e\u0649 \u0627\u0644\u0652\u0645\u064f\u0624\u0652\u0645\u0650\u0646\u0650\u064a\u0646\u064e \u0643\u0650\u062a\u064e\u0627\u0628\u064b\u0627 \u0645\u064e\u0648\u0652\u0642\u064f\u0648\u062a\u064b\u0627 103\ufd3e [\u0633\u0648\u0631\u0629 \u0627\u0644\u0646\u0633\u0627\u0621: 103].                    ","\n                    \u062c- \u062a\u0631\u0643 \u0627\u0644\u0635\u0644\u0627\u0629 \u0643\u0641\u0631\u060c \u0642\u0627\u0644 \u0627\u0644\u0646\u0628\u064a \u0639\u064e\u0644\u064e\u064a\u0652\u0647\u0650 \u0627\u0644\u0635\u0651\u064e\u0644\u064e\u0627\u0629\u064f \u0648\u064e\u0627\u0644\u0633\u0651\u064e\u0644\u064e\u0627\u0645\u064f:\n\xab\u0627\u0644\u0639\u0647\u062f \u0627\u0644\u0630\u064a \u0628\u064a\u0646\u0646\u0627 \u0648\u0628\u064a\u0646\u0647\u0645 \u0627\u0644\u0635\u0644\u0627\u0629\u060c \u0641\u0645\u0646 \u062a\u0631\u0643\u0647\u0627 \u0641\u0642\u062f \u0643\u0641\u0631\xbb\n\u0631\u0648\u0627\u0647 \u0623\u062d\u0645\u062f \u0648\u0627\u0644\u062a\u0631\u0645\u0630\u064a \u0648\u063a\u064a\u0631\u0647\u0645\u0627.                    ","\n                    \u062c- \u062e\u0645\u0633 \u0635\u0644\u0648\u0627\u062a \u0641\u064a \u0627\u0644\u064a\u0648\u0645 \u0648\u0627\u0644\u0644\u064a\u0644\u0629\u060c \u0635\u0644\u0627\u0629 \u0627\u0644\u0641\u062c\u0631: \u0631\u0643\u0639\u062a\u0627\u0646\u060c \u0648\u0635\u0644\u0627\u0629 \u0627\u0644\u0638\u0647\u0631: \u0623\u0631\u0628\u0639 \u0631\u0643\u0639\u0627\u062a\u060c \u0648\u0635\u0644\u0627\u0629 \u0627\u0644\u0639\u0635\u0631: \u0623\u0631\u0628\u0639 \u0631\u0643\u0639\u0627\u062a\u060c \u0648\u0635\u0644\u0627\u0629 \u0627\u0644\u0645\u063a\u0631\u0628: \u062b\u0644\u0627\u062b \u0631\u0643\u0639\u0627\u062a\u060c \u0648\u0635\u0644\u0627\u0629 \u0627\u0644\u0639\u0634\u0627\u0621: \u0623\u0631\u0628\u0639 \u0631\u0643\u0639\u0627\u062a.                    ","\n                    \u062c- 1- \u0627\u0644\u0625\u0633\u0644\u0627\u0645\u061b \u0641\u0644\u0627 \u062a\u0635\u062d \u0645\u0646 \u0643\u0627\u0641\u0631.\n2- \u0627\u0644\u0639\u0642\u0644\u061b \u0641\u0644\u0627 \u062a\u0635\u062d \u0645\u0646 \u0645\u062c\u0646\u0648\u0646.\n3-\u0627\u0644\u062a\u0645\u064a\u064a\u0632\u061b \u0641\u0644\u0627 \u062a\u0635\u062d \u0645\u0646 \u0635\u063a\u064a\u0631 \u063a\u064a\u0631 \u0645\u0645\u064a\u0632.\n4- \u0627\u0644\u0646\u064a\u0629.\n5- \u062f\u062e\u0648\u0644 \u0627\u0644\u0648\u0642\u062a.\n6- \u0627\u0644\u0637\u0647\u0627\u0631\u0629 \u0641\u064a \u0631\u0641\u0639 \u0627\u0644\u062d\u062f\u062b.\n7- \u0627\u0644\u062a\u0637\u0647\u0631 \u0645\u0646 \u0627\u0644\u0646\u062c\u0627\u0633\u0629.\n8- \u0633\u062a\u0631 \u0627\u0644\u0639\u0648\u0631\u0629.\n9- \u0627\u0633\u062a\u0642\u0628\u0627\u0644 \u0627\u0644\u0642\u0628\u0644\u0629.                    ",'\n                    \u062c- \u0647\u064a \u0623\u0631\u0628\u0639\u0629 \u0639\u0634\u0631 \u0631\u0643\u0646\u0627\u064b\u060c \u0643\u0645\u0627 \u064a\u0644\u064a:\n\u0623\u062d\u062f\u0647\u0627: \u0627\u0644\u0642\u064a\u0627\u0645 \u0641\u064a \u0627\u0644\u0641\u0631\u0636 \u0639\u0644\u0649 \u0627\u0644\u0642\u0627\u062f\u0631.\n\u062a\u0643\u0628\u064a\u0631\u0629 \u0627\u0644\u0625\u062d\u0631\u0627\u0645\u060c \u0648\u0647\u064a: "\u0627\u0644\u0644\u0647 \u0623\u0643\u0628\u0631".\n\u0642\u0631\u0627\u0621\u0629 \u0627\u0644\u0641\u0627\u062a\u062d\u0629.\n\u0627\u0644\u0631\u0643\u0648\u0639\u060c \u0648\u064a\u0645\u062f \u0638\u0647\u0631\u0647 \u0645\u0633\u062a\u0648\u064a\u0627 \u0648\u064a\u062c\u0639\u0644 \u0631\u0623\u0633\u0647 \u062d\u064a\u0627\u0644\u0647.\n\u0627\u0644\u0631\u0641\u0639 \u0645\u0646\u0647.\n\u0627\u0644\u0627\u0639\u062a\u062f\u0627\u0644 \u0642\u0627\u0626\u0645\u064b\u0627.\n\u0627\u0644\u0633\u062c\u0648\u062f\u060c \u0648\u062a\u0645\u0643\u064a\u0646 \u062c\u0628\u0647\u062a\u0647\u060c \u0648\u0623\u0646\u0641\u0647\u060c \u0648\u0643\u0641\u064a\u0647\u060c \u0648\u0631\u0643\u0628\u062a\u064a\u0647\u060c \u0648\u0623\u0637\u0631\u0627\u0641 \u0623\u0635\u0627\u0628\u0639 \u0642\u062f\u0645\u064a\u0647 \u0645\u0646 \u0645\u062d\u0644 \u0633\u062c\u0648\u062f\u0647.\n\u0627\u0644\u0631\u0641\u0639 \u0645\u0646 \u0627\u0644\u0633\u062c\u0648\u062f.\n\u0627\u0644\u062c\u0644\u0648\u0633 \u0628\u064a\u0646 \u0627\u0644\u0633\u062c\u062f\u062a\u064a\u0646.\n\u0648\u0627\u0644\u0633\u0651\u064f\u0646\u0651\u064e\u0629: \u0623\u0646 \u064a\u062c\u0644\u0633 \u0645\u0641\u062a\u0631\u0634\u0627 \u0639\u0644\u0649 \u0631\u062c\u0644\u0647 \u0627\u0644\u064a\u0633\u0631\u0649\u060c \u0648\u064a\u0646\u0635\u0628 \u0627\u0644\u064a\u0645\u0646\u0649\u060c \u0648\u064a\u0648\u062c\u0647\u0647\u0627 \u0625\u0644\u0649 \u0627\u0644\u0642\u0628\u0644\u0629.\n\u0627\u0644\u0637\u0645\u0623\u0646\u064a\u0646\u0629\u060c \u0648\u0647\u064a \u0627\u0644\u0633\u0643\u0648\u0646 \u0641\u064a \u0643\u0644 \u0631\u0643\u0646 \u0641\u0639\u0644\u064a.\n\u0627\u0644\u062a\u0634\u0647\u062f \u0627\u0644\u0623\u062e\u064a\u0631.\n\u0627\u0644\u062c\u0644\u0648\u0633 \u0644\u0647.\n\u0627\u0644\u062a\u0633\u0644\u064a\u0645\u062a\u0627\u0646\u060c \u0648\u0647\u0648 \u0623\u0646 \u064a\u0642\u0648\u0644 \u0645\u0631\u062a\u064a\u0646: "\u0627\u0644\u0633\u0651\u064e\u0644\u0627\u0645 \u0639\u0644\u064a\u0643\u0645 \u0648\u0631\u062d\u0645\u0629 \u0627\u0644\u0644\u0647".\n\u062a\u0631\u062a\u064a\u0628 \u0627\u0644\u0623\u0631\u0643\u0627\u0646 -\u0643\u0645\u0627 \u0630\u0643\u0631\u0646\u0627-\u060c \u0641\u0644\u0648 \u0633\u062c\u062f \u0645\u062b\u0644\u064b\u0627 \u0642\u0628\u0644 \u0631\u0643\u0648\u0639\u0647 \u0639\u0645\u062f\u064b\u0627\u061b \u0628\u0637\u0644\u062a\u060c \u0648\u0633\u0647\u0648\u0627\u064b\u061b \u0644\u0632\u0645\u0647 \u0627\u0644\u0631\u062c\u0648\u0639 \u0644\u064a\u0631\u0643\u0639\u060c \u062b\u0645 \u064a\u0633\u062c\u062f.                    ',"\n                    \u062c- \u0648\u0627\u062c\u0628\u0627\u062a \u0627\u0644\u0635\u0644\u0627\u0629\u060c \u0648\u0647\u064a \u062b\u0645\u0627\u0646\u064a\u0629\u060c \u0643\u0645\u0627 \u064a\u0644\u064a:\n1- \u0627\u0644\u062a\u0643\u0628\u064a\u0631\u0627\u062a \u063a\u064a\u0631 \u062a\u0643\u0628\u064a\u0631\u0629 \u0627\u0644\u0625\u062d\u0631\u0627\u0645.\n2- \u0642\u0648\u0644: \xab\u0633\u0645\u0639 \u0627\u0644\u0644\u0647 \u0644\u0645\u0646 \u062d\u0645\u062f\u0647\xbb \u0644\u0644\u0625\u0645\u0627\u0645 \u0648\u0644\u0644\u0645\u0646\u0641\u0631\u062f.\n3- \u0642\u0648\u0644: \xab\u0631\u0628\u0646\u0627 \u0648\u0644\u0643 \u0627\u0644\u062d\u0645\u062f\xbb.\n4- \u0642\u0648\u0644: \xab\u0633\u0628\u062d\u0627\u0646 \u0631\u0628\u064a \u0627\u0644\u0639\u0638\u064a\u0645\xbb \u0645\u0631\u0629 \u0641\u064a \u0627\u0644\u0631\u0643\u0648\u0639.\n5- \u0642\u0648\u0644: \xab\u0633\u0628\u062d\u0627\u0646 \u0631\u0628\u064a \u0627\u0644\u0623\u0639\u0644\u0649\xbb \u0645\u0631\u0629 \u0641\u064a \u0627\u0644\u0633\u062c\u0648\u062f.\n6- \u0642\u0648\u0644: \xab\u0631\u0628 \u0627\u063a\u0641\u0631 \u0644\u064a\xbb \u0628\u064a\u0646 \u0627\u0644\u0633\u062c\u062f\u062a\u064a\u0646.\n7- \u0627\u0644\u062a\u0634\u0647\u062f \u0627\u0644\u0623\u0648\u0644.\n8- \u0627\u0644\u062c\u0644\u0648\u0633 \u0644\u0644\u062a\u0634\u0647\u062f \u0627\u0644\u0623\u0648\u0644.                    ",'\n                    \u062c- \u0625\u062d\u062f\u0649 \u0639\u0634\u0631\u0629 \u0633\u0646\u0629\u060c \u0643\u0645\u0627 \u064a\u0644\u064a:\n1- \u0642\u0648\u0644\u0647 \u0628\u0639\u062f \u062a\u0643\u0628\u064a\u0631\u0629 \u0627\u0644\u0625\u062d\u0631\u0627\u0645: "\u0633\u0628\u062d\u0627\u0646\u0643 \u0627\u0644\u0644\u0647\u0645 \u0648\u0628\u062d\u0645\u062f\u0643\u060c \u0648\u062a\u0628\u0627\u0631\u0643 \u0627\u0633\u0645\u0643\u060c \u0648\u062a\u064e\u0639\u064e\u0627\u0644\u064e\u0649\u0670 \u062c\u062f\u0643\u060c \u0648\u0644\u0627 \u0625\u0644\u0647 \u063a\u064a\u0631\u0643" \u0648\u064a\u0633\u0645\u0649: \u062f\u0639\u0627\u0621 \u0627\u0644\u0627\u0633\u062a\u0641\u062a\u0627\u062d.\n2- \u0627\u0644\u062a\u0639\u0648\u0630.\n3- \u0627\u0644\u0628\u0633\u0645\u0644\u0629.\n4- \u0642\u0648\u0644: \u0622\u0645\u064a\u0646.\n5- \u0642\u0631\u0627\u0621\u0629 \u0627\u0644\u0633\u0648\u0631\u0629 \u0628\u0639\u062f \u0627\u0644\u0641\u0627\u062a\u062d\u0629.\n6- \u0627\u0644\u062c\u0647\u0631 \u0628\u0627\u0644\u0642\u0631\u0627\u0621\u0629 \u0644\u0644\u0625\u0645\u0627\u0645.\n7- \u0627\u0644\u0642\u0648\u0644 \u0628\u0639\u062f \u0627\u0644\u062a\u062d\u0645\u064a\u062f: "\u0645\u0644\u0621 \u0627\u0644\u0633\u0651\u064e\u0645\u0670\u0648\u0627\u062a\u060c \u0648\u0645\u0644\u0621 \u0627\u0644\u0623\u0631\u0636\u060c \u0648\u0645\u0644\u0621 \u0645\u0627 \u0634\u0626\u062a \u0645\u0646 \u0634\u064a\u0621 \u0628\u0639\u062f".\n8- \u0645\u0627 \u0632\u0627\u062f \u0639\u0644\u0649 \u0627\u0644\u0645\u0631\u0629 \u0641\u064a \u062a\u0633\u0628\u064a\u062d \u0627\u0644\u0631\u0643\u0648\u0639. \u0623\u064a: \u0627\u0644\u062a\u0633\u0628\u064a\u062d\u0629 \u0627\u0644\u062b\u0627\u0646\u064a\u0629 \u0648\u0627\u0644\u062b\u0627\u0644\u062b\u0629\u060c \u0648\u0645\u0627 \u0632\u0627\u062f \u0639\u0644\u0649 \u0630\u0644\u0643.\n9- \u0645\u0627 \u0632\u0627\u062f \u0639\u0644\u0649 \u0627\u0644\u0645\u0631\u0629 \u0641\u064a \u062a\u0633\u0628\u064a\u062d \u0627\u0644\u0633\u062c\u0648\u062f.\n10- \u0645\u0627 \u0632\u0627\u062f \u0639\u0644\u0649 \u0627\u0644\u0645\u0631\u0629 \u0641\u064a \u0642\u0648\u0644\u0647 \u0628\u064a\u0646 \u0627\u0644\u0633\u062c\u062f\u062a\u064a\u0646: \xab\u0631\u0628 \u0627\u063a\u0641\u0631 \u0644\u064a\xbb.\n11- \u0627\u0644\u0635\u0644\u0627\u0629 \u0641\u064a \u0627\u0644\u062a\u0634\u0647\u062f \u0627\u0644\u0623\u062e\u064a\u0631 \u0639\u0644\u0649 \u0622\u0644\u0647 \u0639\u064e\u0644\u064e\u064a\u0652\u0647\u064f\u0645 \u0627\u0644\u0633\u0651\u064e\u0644\u064e\u0627\u0645\u064f\u060c \u0648\u0627\u0644\u0628\u0631\u0643\u0629 \u0639\u0644\u064a\u0647 \u0648\u0639\u0644\u064a\u0647\u0645\u060c \u0648\u0627\u0644\u062f\u0639\u0627\u0621 \u0628\u0639\u062f\u0647.\n\u0631\u0627\u0628\u0639\u064b\u0627: \u0633\u0646\u0646 \u0627\u0644\u0623\u0641\u0639\u0627\u0644\u060c \u0648\u062a\u0633\u0645\u0649 \u0627\u0644\u0647\u064a\u0626\u0627\u062a:\n1- \u0631\u0641\u0639 \u0627\u0644\u064a\u062f\u064a\u0646 \u0645\u0639 \u062a\u0643\u0628\u064a\u0631\u0629 \u0627\u0644\u0625\u062d\u0631\u0627\u0645.\n2- \u0648\u0639\u0646\u062f \u0627\u0644\u0631\u0643\u0648\u0639.\n3- \u0648\u0639\u0646\u062f \u0627\u0644\u0631\u0641\u0639 \u0645\u0646\u0647.\n4- \u0648\u062d\u0637\u0647\u0645\u0627 \u0639\u0642\u0628 \u0630\u0644\u0643.\n5- \u0648\u0636\u0639 \u0627\u0644\u064a\u0645\u064a\u0646 \u0639\u0644\u0649 \u0627\u0644\u0634\u0645\u0627\u0644.\n6- \u0646\u0638\u0631\u0647 \u0625\u0644\u0649 \u0645\u0648\u0636\u0639 \u0633\u062c\u0648\u062f\u0647.\n7- \u062a\u0641\u0631\u0642\u062a\u0647 \u0628\u064a\u0646 \u0642\u062f\u0645\u064a\u0647 \u0642\u0627\u0626\u0645\u064b\u0627.\n8- \u0642\u0628\u0636 \u0631\u0643\u0628\u062a\u064a\u0647 \u0628\u064a\u062f\u064a\u0647 \u0645\u0641\u0631\u062c\u062a\u064a \u0627\u0644\u0623\u0635\u0627\u0628\u0639 \u0641\u064a \u0631\u0643\u0648\u0639\u0647\u060c \u0648\u0645\u062f \u0638\u0647\u0631\u0647 \u0641\u064a\u0647\u060c \u0648\u062c\u0639\u0644 \u0631\u0623\u0633\u0647 \u062d\u064a\u0627\u0644\u0647.\n9- \u062a\u0645\u0643\u064a\u0646 \u0623\u0639\u0636\u0627\u0621 \u0627\u0644\u0633\u062c\u0648\u062f \u0645\u0646 \u0627\u0644\u0623\u0631\u0636\u060c \u0648\u0645\u0628\u0627\u0634\u0631\u062a\u0647\u0627 \u0644\u0645\u062d\u0644 \u0627\u0644\u0633\u062c\u0648\u062f.\n10- \u0645\u062c\u0627\u0641\u0627\u0629 \u0639\u0636\u062f\u064a\u0647 \u0639\u0646 \u062c\u0646\u0628\u064a\u0647\u060c \u0648\u0628\u0637\u0646\u0647 \u0639\u0646 \u0641\u062e\u0630\u064a\u0647\u060c \u0648\u0641\u062e\u0630\u064a\u0647 \u0639\u0646 \u0633\u0627\u0642\u064a\u0647\u060c \u0648\u062a\u0641\u0631\u064a\u0642\u0647 \u0628\u064a\u0646 \u0631\u0643\u0628\u062a\u064a\u0647\u060c \u0648\u0625\u0642\u0627\u0645\u0629 \u0642\u062f\u0645\u064a\u0647\u060c \u0648\u062c\u0639\u0644 \u0628\u0637\u0648\u0646 \u0623\u0635\u0627\u0628\u0639\u0647\u0645\u0627 \u0639\u0644\u0649 \u0627\u0644\u0623\u0631\u0636 \u0645\u0641\u0631\u0642\u0629\u064b\u060c \u0648\u0648\u0636\u0639 \u064a\u062f\u064a\u0647 \u062d\u0630\u0648 \u0645\u0646\u0643\u0628\u064a\u0647 \u0645\u0628\u0633\u0648\u0637\u0629\u064b \u0645\u0636\u0645\u0648\u0645\u0629\u064e \u0627\u0644\u0623\u0635\u0627\u0628\u0639.\n11- \u0627\u0644\u0627\u0641\u062a\u0631\u0627\u0634 \u0641\u064a \u0627\u0644\u062c\u0644\u0648\u0633 \u0628\u064a\u0646 \u0627\u0644\u0633\u062c\u062f\u062a\u064a\u0646\u060c \u0648\u0641\u064a \u0627\u0644\u062a\u0634\u0647\u062f \u0627\u0644\u0623\u0648\u0644\u060c \u0648\u0627\u0644\u062a\u0648\u0631\u0643 \u0641\u064a \u0627\u0644\u062b\u0627\u0646\u064a.\n12- \u0648\u0636\u0639 \u0627\u0644\u064a\u062f\u064a\u0646 \u0639\u0644\u0649 \u0627\u0644\u0641\u062e\u0630\u064a\u0646 \u0645\u0628\u0633\u0648\u0637\u062a\u064a\u0646 \u0645\u0636\u0645\u0648\u0645\u062a\u064a \u0627\u0644\u0623\u0635\u0627\u0628\u0639 \u0628\u064a\u0646 \u0627\u0644\u0633\u062c\u062f\u062a\u064a\u0646\u060c \u0648\u0643\u0630\u0627 \u0641\u064a \u0627\u0644\u062a\u0634\u0647\u062f \u0625\u0644\u0627 \u0623\u0646\u0647 \u064a\u0642\u0628\u0636 \u0645\u0646 \u0627\u0644\u064a\u0645\u0646\u0649 \u0627\u0644\u062e\u0646\u0635\u0631 \u0648\u0627\u0644\u0628\u0646\u0635\u0631\u060c \u0648\u064a\u062d\u0644\u0642 \u0625\u0628\u0647\u0627\u0645\u0647\u0627 \u0645\u0639 \u0627\u0644\u0648\u0633\u0637\u0649\u060c \u0648\u064a\u0634\u064a\u0631 \u0628\u0633\u0628\u0627\u0628\u062a\u0647\u0627 \u0639\u0646\u062f \u0630\u0643\u0631 \u0627\u0644\u0644\u0647.\n13- \u0627\u0644\u062a\u0641\u0627\u062a\u0647 \u064a\u0645\u064a\u0646\u064b\u0627 \u0648\u0634\u0645\u0627\u0644\u064b\u0627 \u0641\u064a \u062a\u0633\u0644\u064a\u0645\u0647.                    ',"\n                    \u062c- (1) \u062a\u0631\u0643 \u0631\u0643\u0646 \u0623\u0648 \u0634\u0631\u0637 \u0645\u0646 \u0634\u0631\u0648\u0637 \u0627\u0644\u0635\u0644\u0627\u0629.\n(2) \u0627\u0644\u062a\u0643\u0644\u0645 \u0639\u0645\u062f\u064b\u0627.\n(3) \u0627\u0644\u0623\u0643\u0644 \u0623\u0648 \u0627\u0644\u0634\u0631\u0628.\n(4) \u0627\u0644\u062d\u0631\u0643\u0627\u062a \u0627\u0644\u0643\u062b\u064a\u0631\u0629 \u0627\u0644\u0645\u062a\u0648\u0627\u0644\u064a\u0629.\n(5)\u062a\u0631\u0643 \u0648\u0627\u062c\u0628 \u0645\u0646 \u0648\u0627\u062c\u0628\u0627\u062a \u0627\u0644\u0635\u0644\u0627\u0629 \u0639\u0645\u062f\u0627\u064b.                    ","\n                    \u062c- \u0643\u064a\u0641\u064a\u0629 \u0627\u0644\u0635\u0644\u0627\u0629:\n1- \u0623\u0646 \u064a\u0633\u062a\u0642\u0628\u0644 \u0627\u0644\u0642\u0628\u0644\u0629 \u0628\u062c\u0645\u064a\u0639 \u0628\u062f\u0646\u0647\u060c \u0628\u062f\u0648\u0646 \u0627\u0646\u062d\u0631\u0627\u0641 \u0648\u0644\u0627 \u0627\u0644\u062a\u0641\u0627\u062a.\n2 - \u062b\u0645 \u064a\u0646\u0648\u064a \u0627\u0644\u0635\u0644\u0627\u0629 \u0627\u0644\u062a\u064a \u064a\u0631\u064a\u062f \u0623\u0646 \u064a\u0635\u0644\u064a\u0647\u0627 \u0628\u0642\u0644\u0628\u0647 \u0628\u062f\u0648\u0646 \u0646\u0637\u0642 \u0627\u0644\u0646\u064a\u0629.\n3 - \u062b\u0645 \u064a\u0643\u0628\u0631 \u062a\u0643\u0628\u064a\u0631\u0629 \u0627\u0644\u0625\u062d\u0631\u0627\u0645 \u0641\u064a\u0642\u0648\u0644: (\u0627\u0644\u0644\u0647 \u0623\u0643\u0628\u0631)\u060c \u0648\u064a\u0631\u0641\u0639 \u064a\u062f\u064a\u0647 \u0625\u0644\u0649 \u062d\u0630\u0648 \u0645\u0646\u0643\u0628\u064a\u0647 \u0639\u0646\u062f \u0627\u0644\u062a\u0643\u0628\u064a\u0631.\n4 - \u062b\u0645 \u064a\u0636\u0639 \u0643\u0641 \u064a\u062f\u0647 \u0627\u0644\u064a\u0645\u0646\u0649 \u0639\u0644\u0649 \u0638\u0647\u0631 \u0643\u0641 \u064a\u062f\u0647 \u0627\u0644\u064a\u0633\u0631\u0649 \u0641\u0648\u0642 \u0635\u062f\u0631\u0647.\n5 - \u062b\u0645 \u064a\u0633\u062a\u0641\u062a\u062d \u0641\u064a\u0642\u0648\u0644: \xab\u0627\u0644\u0644\u0647\u0645 \u0628\u0627\u0639\u062f \u0628\u064a\u0646\u064a \u0648\u0628\u064a\u0646 \u062e\u0637\u0627\u064a\u0627\u064a \u0643\u0645\u0627 \u0628\u0627\u0639\u062f\u062a \u0628\u064a\u0646 \u0627\u0644\u0645\u0634\u0631\u0642 \u0648\u0627\u0644\u0645\u063a\u0631\u0628\u060c \u0627\u0644\u0644\u0647\u0645 \u0646\u0642\u0646\u064a \u0645\u0646 \u062e\u0637\u0627\u064a\u0627\u064a \u0643\u0645\u0627 \u064a\u064f\u0646\u0642\u0649 \u0627\u0644\u062b\u0648\u0628 \u0627\u0644\u0623\u0628\u064a\u0636 \u0645\u0646 \u0627\u0644\u062f\u0646\u0633\u060c \u0627\u0644\u0644\u0647\u0645 \u0627\u063a\u0633\u0644\u0646\u064a \u0645\u0646 \u062e\u0637\u0627\u064a\u0627\u064a \u0628\u0627\u0644\u0645\u0627\u0621 \u0648\u0627\u0644\u062b\u0644\u062c \u0648\u0627\u0644\u0628\u0631\u062f\xbb.\n\u0623\u0648 \u064a\u0642\u0648\u0644: \xab\u0633\u0628\u062d\u0627\u0646\u0643 \u0627\u0644\u0644\u0647\u0645 \u0648\u0628\u062d\u0645\u062f\u0643\u060c \u0648\u062a\u0628\u0627\u0631\u0643 \u0627\u0633\u0645\u0643\u060c \u0648\u062a\u064e\u0639\u064e\u0627\u0644\u064e\u0649\u0670 \u062c\u062f\u0643\u060c \u0648\u0644\u0627 \u0625\u0644\u0647 \u063a\u064a\u0631\u0643\xbb.\n6 - \u062b\u0645 \u064a\u062a\u0639\u0648\u0630 \u0641\u064a\u0642\u0648\u0644: \xab\u0623\u0639\u0648\u0630 \u0628\u0627\u0644\u0644\u0647 \u0645\u0646 \u0627\u0644\u0634\u064a\u0637\u0627\u0646 \u0627\u0644\u0631\u062c\u064a\u0645\xbb. 7 - \u062b\u0645 \u064a\u0628\u0633\u0645\u0644 \u0648\u064a\u0642\u0631\u0623 \u0627\u0644\u0641\u0627\u062a\u062d\u0629 \u0641\u064a\u0642\u0648\u0644: \ufd3f\u0628\u0650\u0633\u0652\u0645\u0650 \u0627\u0644\u0644\u0647\u0650 \u0627\u0644\u0631\u0651\u064e\u062d\u0652\u0645\u0646\u0650 \u0627\u0644\u0631\u0651\u064e\u062d\u0650\u064a\u0645\u0650 1 \u0627\u0644\u0652\u062d\u064e\u0645\u0652\u062f\u064f \u0644\u0644\u0651\u0647\u0650 \u0631\u064e\u0628\u0651\u0650 \u0627\u0644\u0652\u0639\u064e\u0627\u0644\u064e\u0645\u0650\u064a\u0646\u064e 2 \u0627\u0644\u0631\u0651\u064e\u062d\u0652\u0645\u0640\u0646\u0650 \u0627\u0644\u0631\u0651\u064e\u062d\u0650\u064a\u0645\u0650 3 \u0645\u064e\u0627\u0644\u0650\u0643\u0650 \u064a\u064e\u0648\u0652\u0645\u0650 \u0627\u0644\u062f\u0651\u0650\u064a\u0646\u0650 4 \u0625\u0650\u064a\u0651\u064e\u0627\u0643\u064e \u0646\u064e\u0639\u0652\u0628\u064f\u062f\u064f \u0648\u0625\u0650\u064a\u0651\u064e\u0627\u0643\u064e \u0646\u064e\u0633\u0652\u062a\u064e\u0639\u0650\u064a\u0646\u064f 5 \u0627\u0647\u062f\u0650\u0646\u064e\u0640\u0640\u0640\u0640\u0627 \u0627\u0644\u0635\u0651\u0650\u0631\u064e\u0627\u0637\u064e \u0627\u0644\u0645\u064f\u0633\u062a\u064e\u0642\u0650\u064a\u0645\u064e 6 \u0635\u0650\u0631\u064e\u0627\u0637\u064e \u0627\u0644\u0651\u064e\u0630\u0650\u064a\u0646\u064e \u0623\u064e\u0646\u0639\u064e\u0645\u062a\u064e \u0639\u064e\u0644\u064e\u064a\u0647\u0650\u0645\u0652 \u063a\u064e\u064a\u0631\u0650 \u0627\u0644\u0645\u064e\u063a\u0636\u064f\u0648\u0628\u0650 \u0639\u064e\u0644\u064e\u064a\u0647\u0650\u0645\u0652 \u0648\u064e\u0644\u0627\u064e \u0627\u0644\u0636\u0651\u064e\u0627\u0644\u0651\u0650\u064a\u0646\u064e 7\ufd3e [\u0633\u0648\u0631\u0629 \u0627\u0644\u0641\u0627\u062a\u062d\u0629:1-7].\n\u062b\u0645 \u064a\u0642\u0648\u0644: (\u0622\u0645\u064a\u0646) \u064a\u0639\u0646\u064a: \u0627\u0644\u0644\u0647\u0645 \u0627\u0633\u062a\u062c\u0628.\n8 - \u062b\u0645 \u064a\u0642\u0631\u0623 \u0645\u0627 \u062a\u064a\u0633\u0631 \u0645\u0646 \u0627\u0644\u0642\u0631\u0622\u0646\u060c \u0648\u064a\u0637\u064a\u0644 \u0627\u0644\u0642\u0631\u0627\u0621\u0629 \u0641\u064a \u0635\u0644\u0627\u0629 \u0627\u0644\u0635\u0628\u062d.\n9 - \u062b\u0645 \u064a\u0631\u0643\u0639\u060c \u0623\u064a: \u064a\u062d\u0646\u064a \u0638\u0647\u0631\u0647 \u062a\u0639\u0638\u064a\u0645\u0627\u064b \u0644\u0644\u0647\u060c \u0648\u064a\u064f\u0643\u0628\u0631 \u0639\u0646\u062f \u0631\u0643\u0648\u0639\u0647\u060c \u0648\u064a\u0631\u0641\u0639 \u064a\u062f\u064a\u0647 \u0625\u0644\u0649 \u062d\u0630\u0648 \u0645\u0646\u0643\u0628\u064a\u0647. \u0648\u0627\u0644\u0633\u0651\u064f\u0646\u0651\u064e\u0629: \u0623\u0646 \u064a\u0645\u062f \u0638\u0647\u0631\u0647\u060c \u0648\u064a\u062c\u0639\u0644 \u0631\u0623\u0633\u0647 \u062d\u064a\u0627\u0644\u0647\u060c \u0648\u064a\u0636\u0639 \u064a\u062f\u064a\u0647 \u0639\u0644\u0649 \u0631\u0643\u0628\u062a\u064a\u0647 \u0645\u0641\u0631\u062c\u062a\u064a \u0627\u0644\u0623\u0635\u0627\u0628\u0639.\n10 - \u0648\u064a\u0642\u0648\u0644 \u0641\u064a \u0631\u0643\u0648\u0639\u0647: \xab\u0633\u0628\u062d\u0627\u0646 \u0631\u0628\u064a \u0627\u0644\u0639\u0638\u064a\u0645\xbb \u062b\u0644\u0627\u062b \u0645\u0631\u0627\u062a\u060c \u0648\u0625\u0646 \u0632\u0627\u062f: \xab\u0633\u0628\u062d\u0627\u0646\u0643 \u0627\u0644\u0644\u0647\u0645 \u0648\u0628\u062d\u0645\u062f\u0643\u060c \u0627\u0644\u0644\u0647\u0645 \u0627\u063a\u0641\u0631 \u0644\u064a\xbb \u0641\u062d\u0633\u0646.\n11 - \u062b\u0645 \u064a\u0631\u0641\u0639 \u0631\u0623\u0633\u0647 \u0645\u0646 \u0627\u0644\u0631\u0643\u0648\u0639 \u0642\u0627\u0626\u0644\u0627\u064b: \xab\u0633\u0645\u0639 \u0627\u0644\u0644\u0647 \u0644\u0645\u0646 \u062d\u0645\u062f\u0647\xbb\u060c \u0648\u064a\u0631\u0641\u0639 \u064a\u062f\u064a\u0647 \u062d\u064a\u0646\u0626\u0630 \u0625\u0644\u0649 \u062d\u0630\u0648 \u0645\u0646\u0643\u0628\u064a\u0647. \u0648\u0627\u0644\u0645\u0623\u0645\u0648\u0645 \u0644\u0627 \u064a\u0642\u0648\u0644: \xab\u0633\u0645\u0639 \u0627\u0644\u0644\u0647 \u0644\u0645\u0646 \u062d\u0645\u062f\u0647\xbb\u060c \u0648\u0625\u0646\u0645\u0627 \u064a\u0642\u0648\u0644 \u0628\u062f\u0644\u0647\u0627: \xab\u0631\u0628\u0646\u0627 \u0648\u0644\u0643 \u0627\u0644\u062d\u0645\u062f\xbb.\n12 - \u062b\u0645 \u064a\u0642\u0648\u0644 \u0628\u0639\u062f \u0631\u0641\u0639\u0647: \xab\u0631\u0628\u0646\u0627 \u0648\u0644\u0643 \u0627\u0644\u062d\u0645\u062f\u060c \u0645\u0644\u0621 \u0627\u0644\u0633\u0645\u0627\u0648\u0627\u062a \u0648\u0627\u0644\u0623\u0631\u0636\u060c \u0648\u0645\u0644\u0621 \u0645\u0627 \u0634\u0626\u062a \u0645\u0646 \u0634\u064a\u0621 \u0628\u0639\u062f\xbb.\n13 - \u062b\u0645 \u064a\u0633\u062c\u062f \u0627\u0644\u0633\u062c\u062f\u0629 \u0627\u0644\u0623\u0648\u0644\u0649\u060c \u0648\u064a\u0642\u0648\u0644 \u0639\u0646\u062f \u0633\u062c\u0648\u062f\u0647: \xab\u0627\u0644\u0644\u0647 \u0623\u0643\u0628\u0631\xbb\u060c \u0648\u064a\u0633\u062c\u062f \u0639\u0644\u0649 \u0623\u0639\u0636\u0627\u0626\u0647 \u0627\u0644\u0633\u0628\u0639\u0629: \u0627\u0644\u062c\u0628\u0647\u0629 \u0648\u0627\u0644\u0623\u0646\u0641\u060c \u0648\u0627\u0644\u0643\u0641\u064a\u0646\u060c \u0648\u0627\u0644\u0631\u0643\u0628\u062a\u064a\u0646\u060c \u0648\u0623\u0637\u0631\u0627\u0641 \u0627\u0644\u0642\u062f\u0645\u064a\u0646\u060c \u0648\u064a\u062c\u0627\u0641\u064a \u0639\u0636\u062f\u064a\u0647 \u0639\u0646 \u062c\u0646\u0628\u064a\u0647\u060c \u0648\u0644\u0627 \u064a\u0628\u0633\u0637 \u0630\u0631\u0627\u0639\u064a\u0647 \u0639\u0644\u0649 \u0627\u0644\u0623\u0631\u0636\u060c \u0648\u064a\u0633\u062a\u0642\u0628\u0644 \u0628\u0631\u0624\u0648\u0633 \u0623\u0635\u0627\u0628\u0639\u0647 \u0627\u0644\u0642\u0628\u0644\u0629.\n14 - \u0648\u064a\u0642\u0648\u0644 \u0641\u064a \u0633\u062c\u0648\u062f\u0647: \xab\u0633\u0628\u062d\u0627\u0646 \u0631\u0628\u064a \u0627\u0644\u0623\u0639\u0644\u0649\xbb \u062b\u0644\u0627\u062b \u0645\u0631\u0627\u062a\u060c \u0648\u0625\u0646 \u0632\u0627\u062f: \xab\u0633\u0628\u062d\u0627\u0646\u0643 \u0627\u0644\u0644\u0647\u0645 \u0631\u0628\u0646\u0627 \u0648\u0628\u062d\u0645\u062f\u0643\u060c \u0627\u0644\u0644\u0647\u0645 \u0627\u063a\u0641\u0631 \u0644\u064a\xbb \u0641\u062d\u0633\u0646.\n15 - \u062b\u0645 \u064a\u0631\u0641\u0639 \u0631\u0623\u0633\u0647 \u0645\u0646 \u0627\u0644\u0633\u062c\u0648\u062f \u0642\u0627\u0626\u0644\u0627\u064b: \xab\u0627\u0644\u0644\u0647 \u0623\u0643\u0628\u0631\xbb.\n16 - \u062b\u0645 \u064a\u062c\u0644\u0633 \u0628\u064a\u0646 \u0627\u0644\u0633\u062c\u062f\u062a\u064a\u0646 \u0639\u0644\u0649 \u0642\u062f\u0645\u0647 \u0627\u0644\u064a\u0633\u0631\u0649\u060c \u0648\u064a\u0646\u0635\u0628 \u0642\u062f\u0645\u0647 \u0627\u0644\u064a\u0645\u0646\u0649\u060c \u0648\u064a\u0636\u0639 \u064a\u062f\u0647 \u0627\u0644\u064a\u0645\u0646\u0649 \u0639\u0644\u0649 \u0637\u0631\u0641 \u0641\u062e\u0630\u0647 \u0627\u0644\u0623\u064a\u0645\u0646 \u0645\u0645\u0627 \u064a\u0644\u064a \u0631\u0643\u0628\u062a\u0647\u060c \u0648\u064a\u0642\u0628\u0636 \u0645\u0646\u0647\u0627 \u0627\u0644\u062e\u0646\u0635\u0631 \u0648\u0627\u0644\u0628\u0646\u0635\u0631\u060c \u0648\u064a\u0631\u0641\u0639 \u0627\u0644\u0633\u0628\u0627\u0628\u0629 \u0648\u064a\u062d\u0631\u0643\u0647\u0627 \u0639\u0646\u062f \u062f\u0639\u0627\u0626\u0647\u060c \u0648\u064a\u062c\u0639\u0644 \u0637\u0631\u0641 \u0627\u0644\u0625\u0628\u0647\u0627\u0645 \u0645\u0642\u0631\u0648\u0646\u0627\u064b \u0628\u0637\u0631\u0641 \u0627\u0644\u0648\u0633\u0637\u0649 \u0643\u0627\u0644\u062d\u0644\u0642\u0629\u060c \u0648\u064a\u0636\u0639 \u064a\u062f\u0647 \u0627\u0644\u064a\u0633\u0631\u0649 \u0645\u0628\u0633\u0648\u0637\u0629 \u0627\u0644\u0623\u0635\u0627\u0628\u0639 \u0639\u0644\u0649 \u0637\u0631\u0641 \u0641\u062e\u0630\u0647 \u0627\u0644\u0623\u064a\u0633\u0631 \u0645\u0645\u0627 \u064a\u0644\u064a \u0627\u0644\u0631\u0643\u0628\u0629.\n17 - \u0648\u064a\u0642\u0648\u0644 \u0641\u064a \u062c\u0644\u0648\u0633\u0647 \u0628\u064a\u0646 \u0627\u0644\u0633\u062c\u062f\u062a\u064a\u0646: \xab\u0631\u0628 \u0627\u063a\u0641\u0631 \u0644\u064a\u060c \u0648\u0627\u0631\u062d\u0645\u0646\u064a\u060c \u0648\u0627\u0647\u062f\u0646\u064a\u060c \u0648\u0627\u0631\u0632\u0642\u0646\u064a\u060c \u0648\u0627\u062c\u0628\u0631\u0646\u064a\u060c \u0648\u0639\u0627\u0641\u0646\u064a\xbb.\n18 - \u062b\u0645 \u064a\u0633\u062c\u062f \u0627\u0644\u0633\u062c\u062f\u0629 \u0627\u0644\u062b\u0627\u0646\u064a\u0629 \u0643\u0627\u0644\u0623\u0648\u0644\u0649 \u0641\u064a\u0645\u0627 \u064a\u064f\u0642\u0627\u0644 \u0648\u064a\u064f\u0641\u0639\u0644\u060c \u0648\u064a\u0643\u0628\u0631 \u0639\u0646\u062f \u0633\u062c\u0648\u062f\u0647.\n19 - \u062b\u0645 \u064a\u0642\u0648\u0645 \u0645\u0646 \u0627\u0644\u0633\u062c\u062f\u0629 \u0627\u0644\u062b\u0627\u0646\u064a\u0629 \u0642\u0627\u0626\u0644\u0627\u064b: \xab\u0627\u0644\u0644\u0647 \u0623\u0643\u0628\u0631\xbb \u0648\u064a\u0635\u0644\u064a \u0627\u0644\u0631\u0643\u0639\u0629 \u0627\u0644\u062b\u0627\u0646\u064a\u0629 \u0643\u0627\u0644\u0623\u0648\u0644\u0649 \u0641\u064a\u0645\u0627 \u064a\u064f\u0642\u0627\u0644 \u0648\u064a\u0641\u0639\u0644\u060c \u0625\u0644\u0627 \u0623\u0646\u0647 \u0644\u0627 \u064a\u0633\u062a\u0641\u062a\u062d \u0641\u064a\u0647\u0627.\n20 - \u062b\u0645 \u064a\u062c\u0644\u0633 \u0628\u0639\u062f \u0627\u0646\u062a\u0647\u0627\u0621 \u0627\u0644\u0631\u0643\u0639\u0629 \u0627\u0644\u062b\u0627\u0646\u064a\u0629 \u0642\u0627\u0626\u0644\u0627\u064b: \xab\u0627\u0644\u0644\u0647 \u0623\u0643\u0628\u0631\xbb\u060c \u0648\u064a\u062c\u0644\u0633 \u0643\u0645\u0627 \u064a\u062c\u0644\u0633 \u0628\u064a\u0646 \u0627\u0644\u0633\u062c\u062f\u062a\u064a\u0646 \u0633\u0648\u0627\u0621.\n21 - \u0648\u064a\u0642\u0631\u0623 \u0627\u0644\u062a\u0634\u0647\u062f \u0641\u064a \u0647\u0630\u0627 \u0627\u0644\u062c\u0644\u0648\u0633\u060c \u0641\u064a\u0642\u0648\u0644: \xab\u0627\u0644\u062a\u062d\u064a\u0627\u062a \u0644\u0644\u0647 \u0648\u0627\u0644\u0635\u0644\u0648\u0627\u062a \u0648\u0627\u0644\u0637\u064a\u0628\u0627\u062a\u060c \u0627\u0644\u0633\u0644\u0627\u0645 \u0639\u0644\u064a\u0643 \u0623\u064a\u0647\u0627 \u0627\u0644\u0646\u0628\u064a \u0648\u0631\u062d\u0645\u0629 \u0627\u0644\u0644\u0647 \u0648\u0628\u0631\u0643\u0627\u062a\u0647\u060c \u0627\u0644\u0633\u0644\u0627\u0645 \u0639\u0644\u064a\u0646\u0627 \u0648\u0639\u0644\u0649 \u0639\u0628\u0627\u062f \u0627\u0644\u0644\u0647 \u0627\u0644\u0635\u0627\u0644\u062d\u064a\u0646\u060c \u0623\u0634\u0647\u062f \u0623\u0646 \u0644\u0627 \u0625\u0644\u0647 \u0625\u0644\u0627 \u0627\u0644\u0644\u0647\u060c \u0648\u0623\u0634\u0647\u062f \u0623\u0646 \u0645\u062d\u0645\u062f\u0627\u064b \u0639\u0628\u062f\u0647 \u0648\u0631\u0633\u0648\u0644\u0647\u060c \u0627\u0644\u0644\u0647\u0645 \u0635\u0644\u0651\u0650 \u0639\u0644\u0649 \u0645\u062d\u0645\u062f \u0648\u0639\u0644\u0649 \u0622\u0644 \u0645\u062d\u0645\u062f\u060c \u0643\u0645\u0627 \u0635\u0644\u064a\u062a \u0639\u0644\u0649 \u0625\u0628\u0631\u0627\u0647\u064a\u0645 \u0648\u0639\u0644\u0649 \u0622\u0644 \u0625\u0628\u0631\u0627\u0647\u064a\u0645\u060c \u0625\u0646\u0643 \u062d\u0645\u064a\u062f \u0645\u062c\u064a\u062f\u060c \u0648\u0628\u0627\u0631\u0643 \u0639\u0644\u0649 \u0645\u062d\u0645\u062f \u0648\u0639\u0644\u0649 \u0622\u0644 \u0645\u062d\u0645\u062f\u060c \u0643\u0645\u0627 \u0628\u0627\u0631\u0643\u062a \u0639\u0644\u0649 \u0625\u0628\u0631\u0627\u0647\u064a\u0645 \u0648\u0639\u0644\u0649 \u0622\u0644 \u0625\u0628\u0631\u0627\u0647\u064a\u0645\u060c \u0625\u0646\u0643 \u062d\u0645\u064a\u062f \u0645\u062c\u064a\u062f. \u0623\u0639\u0648\u0630 \u0628\u0627\u0644\u0644\u0647 \u0645\u0646 \u0639\u0630\u0627\u0628 \u062c\u0647\u0646\u0645\u060c \u0648\u0645\u0646 \u0639\u0630\u0627\u0628 \u0627\u0644\u0642\u0628\u0631\u060c \u0648\u0645\u0646 \u0641\u062a\u0646\u0629 \u0627\u0644\u0645\u062d\u064a\u0627 \u0648\u0627\u0644\u0645\u0645\u0627\u062a\u060c \u0648\u0645\u0646 \u0641\u062a\u0646\u0629 \u0627\u0644\u0645\u0633\u064a\u062d \u0627\u0644\u062f\u062c\u0627\u0644\xbb\u060c \u062b\u0645 \u064a\u062f\u0639\u0648 \u0631\u0628\u0647 \u0628\u0645\u0627 \u0623\u062d\u0628 \u0645\u0646 \u062e\u064a\u0631\u064a \u0627\u0644\u062f\u0646\u064a\u0627 \u0648\u0627\u0644\u0622\u062e\u0631\u0629.\n22 - \u062b\u0645 \u064a\u0633\u0644\u0645 \u0639\u0646 \u064a\u0645\u064a\u0646\u0647 \u0642\u0627\u0626\u0644\u0627\u064b: \xab\u0627\u0644\u0633\u0651\u064e\u0644\u0627\u0645 \u0639\u0644\u064a\u0643\u0645 \u0648\u0631\u062d\u0645\u0629 \u0627\u0644\u0644\u0647\xbb\u060c \u0648\u0639\u0646 \u064a\u0633\u0627\u0631\u0647 \u0643\u0630\u0644\u0643.\n23 - \u0648\u0625\u0630\u0627 \u0643\u0627\u0646\u062a \u0627\u0644\u0635\u0644\u0627\u0629 \u062b\u0644\u0627\u062b\u064a\u0629 \u0623\u0648 \u0631\u0628\u0627\u0639\u064a\u0629\u061b \u0648\u0642\u0641 \u0639\u0646\u062f \u0645\u0646\u062a\u0647\u0649 \u0627\u0644\u062a\u0634\u0647\u062f \u0627\u0644\u0623\u0648\u0644\u060c \u0648\u0647\u0648: \xab\u0623\u0634\u0647\u062f \u0623\u0646 \u0644\u0627 \u0625\u0644\u0647 \u0625\u0644\u0627 \u0627\u0644\u0644\u0647\u060c \u0648\u0623\u0634\u0647\u062f \u0623\u0646 \u0645\u062d\u0645\u062f\u0627\u064b \u0639\u0628\u062f\u0647 \u0648\u0631\u0633\u0648\u0644\u0647\xbb.\n24 - \u062b\u0645 \u064a\u0646\u0647\u0636 \u0642\u0627\u0626\u0645\u0627\u064b \u0642\u0627\u0626\u0644\u0627\u064b: \xab\u0627\u0644\u0644\u0647 \u0623\u0643\u0628\u0631\xbb\u060c \u0648\u064a\u0631\u0641\u0639 \u064a\u062f\u064a\u0647 \u0625\u0644\u0649 \u062d\u0630\u0648 \u0645\u0646\u0643\u0628\u064a\u0647 \u062d\u064a\u0646\u0626\u0630.\n25 - \u062b\u0645 \u064a\u0635\u0644\u064a \u0645\u0627 \u0628\u0642\u064a \u0645\u0646 \u0635\u0644\u0627\u062a\u0647 \u0639\u0644\u0649 \u0635\u0641\u0629 \u0627\u0644\u0631\u0643\u0639\u0629 \u0627\u0644\u062b\u0627\u0646\u064a\u0629\u060c \u0625\u0644\u0627 \u0623\u0646\u0647 \u064a\u0642\u062a\u0635\u0631 \u0639\u0644\u0649 \u0642\u0631\u0627\u0621\u0629 \u0627\u0644\u0641\u0627\u062a\u062d\u0629.\n26 - \u062b\u0645 \u064a\u062c\u0644\u0633 \u0645\u062a\u0648\u0631\u0643\u0627\u064b\u060c \u0641\u064a\u0646\u0635\u0628 \u0642\u062f\u0645\u0647 \u0627\u0644\u064a\u0645\u0646\u0649\u060c \u0648\u064a\u062e\u0631\u062c \u0642\u062f\u0645\u0647 \u0627\u0644\u064a\u0633\u0631\u0649 \u0645\u0646 \u062a\u062d\u062a \u0633\u0627\u0642\u0647 \u0627\u0644\u064a\u0645\u0646\u0649\u060c \u0648\u064a\u064f\u0645\u0643\u0646 \u0645\u0642\u0639\u062f\u062a\u0647 \u0645\u0646 \u0627\u0644\u0623\u0631\u0636\u060c \u0648\u064a\u0636\u0639 \u064a\u062f\u064a\u0647 \u0639\u0644\u0649 \u0641\u062e\u0630\u064a\u0647 \u0639\u0644\u0649 \u0635\u0641\u0629 \u0648\u0636\u0639\u0647\u0627 \u0641\u064a \u0627\u0644\u062a\u0634\u0647\u062f \u0627\u0644\u0623\u0648\u0644.\n27 - \u0648\u064a\u0642\u0631\u0623 \u0641\u064a \u0647\u0630\u0627 \u0627\u0644\u062c\u0644\u0648\u0633 \u0627\u0644\u062a\u0634\u0647\u062f \u0643\u0644\u0647.\n28 - \u062b\u0645 \u064a\u0633\u0644\u0645 \u0639\u0646 \u064a\u0645\u064a\u0646\u0647 \u0642\u0627\u0626\u0644\u0627\u064b: \xab\u0627\u0644\u0633\u0644\u0627\u0645 \u0639\u0644\u064a\u0643\u0645 \u0648\u0631\u062d\u0645\u0629 \u0627\u0644\u0644\u0647\xbb \u0648\u0639\u0646 \u064a\u0633\u0627\u0631\u0647 \u0643\u0630\u0644\u0643.                    ","\n                    \u062c- \xab\u0623\u064e\u0633\u0652\u0640\u062a\u064e\u063a\u0652\u0641\u0650\u0631\u064f \u0627\u0644\u0644\u0647\xbb \u062b\u0644\u0627\u062b \u0645\u0631\u0627\u062a.\n- \xab\u0627\u0644\u0644\u0651\u0647\u064f\u0640\u0645\u0651\u064e \u0623\u064e\u0646\u0652\u0640\u062a\u064e \u0627\u0644\u0633\u0651\u064e\u0644\u0627\u0645\u064f\u060c \u0648\u064e\u0645\u0650\u0640\u0646\u0652\u0643\u064e \u0627\u0644\u0633\u0651\u064e\u0644\u0627\u0645\u060c \u062a\u064e\u0628\u0627\u0631\u064e\u0643\u0652\u062a\u064e \u064a\u0627 \u0630\u0627 \u0627\u0644\u062c\u064e\u0640\u0644\u0627\u0644\u0650 \u0648\u064e\u0627\u0644\u0625\u0650\u0643\u0652\u0640\u0631\u0627\u0645\xbb.\n- \xab\u0644\u0627 \u0625\u0644\u0647\u064e \u0625\u0644\u0627\u0651 \u0627\u0644\u0644\u0651\u0647\u064f \u0648\u062d\u062f\u064e\u0647\u064f \u0644\u0627 \u0634\u0631\u064a\u0643\u064e \u0644\u0647\u064f\u060c \u0644\u0647\u064f \u0627\u0644\u0645\u064f\u0640\u0644\u0652\u0643\u064f \u0648\u0644\u0647\u064f \u0627\u0644\u062d\u064e\u0645\u0652\u062f\u060c \u0648\u0647\u0648\u064e \u0639\u0644\u0649 \u0643\u0644\u0651 \u0634\u064e\u064a\u0621\u064d \u0642\u064e\u062f\u064a\u0631\u060c \u0627\u0644\u0644\u0651\u0647\u064f\u0640\u0645\u0651\u064e \u0644\u0627 \u0645\u0627\u0646\u0650\u0639\u064e \u0644\u0650\u0645\u0627 \u0623\u064e\u0639\u0652\u0637\u064e\u0640\u064a\u0652\u062a\u060c \u0648\u064e\u0644\u0627 \u0645\u064f\u0639\u0652\u0637\u0650\u0640\u064a\u064e \u0644\u0650\u0645\u0627 \u0645\u064e\u0646\u064e\u0640\u0639\u0652\u062a\u060c \u0648\u064e\u0644\u0627 \u064a\u064e\u0646\u0652\u0641\u064e\u0640\u0639\u064f \u0630\u0627 \u0627\u0644\u062c\u064e\u0640\u062f\u0650\u0651 \u0645\u0650\u0646\u0652\u0640\u0643\u064e \u0627\u0644\u062c\u064e\u0640\u062f\xbb.\n- \xab\u0644\u0627 \u0625\u0644\u0647\u064e \u0625\u0644\u0627\u0651 \u0627\u0644\u0644\u0647\u060c \u0648\u062d\u062f\u064e\u0647\u064f \u0644\u0627 \u0634\u0631\u064a\u0643\u064e \u0644\u0647\u064f\u060c \u0644\u0647\u064f \u0627\u0644\u0645\u0644\u0643\u064f \u0648\u0644\u0647\u064f \u0627\u0644\u062d\u064e\u0645\u062f\u060c \u0648\u0647\u0648\u064e \u0639\u0644\u0649 \u0643\u0644\u0651 \u0634\u064a\u0621\u064d \u0642\u062f\u064a\u0631\u060c \u0644\u0627 \u062d\u064e\u0640\u0648\u0652\u0644\u064e \u0648\u064e\u0644\u0627 \u0642\u0640\u0648\u0651\u064e\u0629\u064e \u0625\u0650\u0644\u0627\u0651 \u0628\u0650\u0627\u0644\u0644\u0647\u0650\u060c \u0644\u0627 \u0625\u0644\u0647\u064e \u0625\u0644\u0627\u0651 \u0627\u0644\u0644\u0647\u060c \u0648\u064e\u0644\u0627 \u0646\u064e\u0639\u0652\u0640\u0628\u064f\u0640\u062f\u064f \u0625\u0650\u0644\u0627\u0651 \u0625\u064a\u0651\u0640\u0627\u0647\u060c \u0644\u064e\u0647\u064f \u0627\u0644\u0646\u0650\u0651\u0639\u0652\u0640\u0645\u064e\u0629\u064f \u0648\u064e\u0644\u064e\u0647\u064f \u0627\u0644\u0641\u064e\u0636\u0652\u0644 \u0648\u064e\u0644\u064e\u0647\u064f \u0627\u0644\u062b\u0651\u064e\u0640\u0646\u0627\u0621\u064f \u0627\u0644\u062d\u064e\u0640\u0633\u064e\u0646\u060c \u0644\u0627 \u0625\u0644\u0647\u064e \u0625\u0644\u0627\u0651 \u0627\u0644\u0644\u0647 \u0645\u062e\u0652\u0644\u0650\u0635\u0640\u064a\u0646\u064e \u0644\u064e\u0640\u0647\u064f \u0627\u0644\u062f\u0650\u0651\u064a\u0646\u064e \u0648\u064e\u0644\u064e\u0648\u0652 \u0643\u064e\u0640\u0631\u0650\u0647\u064e \u0627\u0644\u0643\u0640\u0627\u0641\u0650\u0631\u0648\u0646\xbb.\n- \xab\u0633\u064f\u0640\u0628\u0652\u062d\u0627\u0646\u064e \u0627\u0644\u0644\u0647\u0650\xbb \u062b\u0644\u0627\u062b\u0627\u064b \u0648\u062b\u0644\u0627\u062b\u064a\u0646 \u0645\u0631\u0629.\n\xab\u0627\u0644\u062d\u064e\u0645\u0652\u0640\u062f\u064f \u0644\u0644\u0647\xbb \u062b\u0644\u0627\u062b\u0627\u064b \u0648\u062b\u0644\u0627\u062b\u064a\u0646 \u0645\u0631\u0629.\n\xab\u0627\u0644\u0644\u0647\u064f \u0623\u0643\u0652\u0640\u0628\u064e\u0631\xbb \u062b\u0644\u0627\u062b\u0627\u064b \u0648\u062b\u0644\u0627\u062b\u064a\u0646 \u0645\u0631\u0629.\n\u062b\u0645 \u064a\u0642\u0648\u0644 \u062a\u0645\u0627\u0645 \u0627\u0644\u0645\u0627\u0626\u0629: \xab\u0644\u0627 \u0625\u0644\u0647 \u0625\u0644\u0627 \u0627\u0644\u0644\u0647 \u0648\u062d\u062f\u0647 \u0644\u0627 \u0634\u0631\u064a\u0643 \u0644\u0647\u060c \u0644\u0647 \u0627\u0644\u0645\u0644\u0643 \u0648\u0644\u0647 \u0627\u0644\u062d\u0645\u062f\u060c \u0648\u0647\u0648 \u0639\u0644\u0649 \u0643\u0644 \u0634\u064a\u0621 \u0642\u062f\u064a\u0631\xbb.\n- \u0648\u064a\u0642\u0631\u0623 \u0633\u0648\u0631\u0629 \u0627\u0644\u0625\u062e\u0644\u0627\u0635 \u0648\u0627\u0644\u0645\u0639\u0648\u0630\u0627\u062a. \u062b\u0644\u0627\u062b \u0645\u0631\u0627\u062a \u0628\u0639\u062f \u0635\u0644\u0627\u062a\u064a \u0627\u0644\u0641\u062c\u0631 \u0648\u0627\u0644\u0645\u063a\u0631\u0628\u060c \u0648\u0645\u0631\u0629 \u0628\u0639\u062f \u0627\u0644\u0635\u0644\u0648\u0627\u062a \u0627\u0644\u0623\u062e\u0631\u0649.\n- \u0648\u064a\u0642\u0631\u0623 \u0622\u064a\u0629 \u0627\u0644\u0643\u0631\u0633\u064a\u060c \u0645\u0631\u0629 \u0648\u0627\u062d\u062f\u0629.                    ","\n                    \u062c- \u0631\u0643\u0639\u062a\u0627\u0646 \u0642\u0628\u0644 \u0627\u0644\u0641\u062c\u0631.\n\u0623\u0631\u0628\u0639 \u0631\u0643\u0639\u0627\u062a \u0642\u0628\u0644 \u0627\u0644\u0638\u0647\u0631.\n\u0631\u0643\u0639\u062a\u0627\u0646 \u0628\u0639\u062f \u0627\u0644\u0638\u0647\u0631.\n\u0631\u0643\u0639\u062a\u0627\u0646 \u0628\u0639\u062f \u0627\u0644\u0645\u063a\u0631\u0628.\n\u0631\u0643\u0639\u062a\u0627\u0646 \u0628\u0639\u062f \u0627\u0644\u0639\u0634\u0627\u0621.\n\u0641\u0636\u0644\u0647\u0627: \u0642\u0627\u0644 \u0627\u0644\u0646\u0628\u064a: \xab\u0645\u0646 \u0635\u0644\u0649 \u0641\u064a \u0627\u0644\u064a\u0648\u0645 \u0648\u0627\u0644\u0644\u064a\u0644\u0629 \u0627\u062b\u0646\u062a\u064a \u0639\u0634\u0631\u0629 \u0631\u0643\u0639\u0629 \u062a\u0637\u0648\u0639\u0627\u064b \u0628\u0646\u0649 \u0627\u0644\u0644\u0647 \u0644\u0647 \u0628\u064a\u062a\u0627\u064b \u0641\u064a \u0627\u0644\u062c\u0646\u0629\xbb \u0631\u0648\u0627\u0647 \u0645\u0633\u0644\u0645 \u0648\u0623\u062d\u0645\u062f \u0648\u063a\u064a\u0631\u0647\u0645\u0627.                    ","\n                    \u062c- \u064a\u0648\u0645 \u0627\u0644\u062c\u0645\u0639\u0629\u060c \u0642\u0627\u0644 \u0627\u0644\u0646\u0628\u064a \u0639\u064e\u0644\u064e\u064a\u0652\u0647\u0650 \u0627\u0644\u0635\u0651\u064e\u0644\u064e\u0627\u0629\u064f \u0648\u064e\u0627\u0644\u0633\u0651\u064e\u0644\u064e\u0627\u0645\u064f: \xab\u0625\u0646 \u0645\u0646 \u0623\u0641\u0636\u0644 \u0623\u064a\u0627\u0645\u0643\u0645 \u064a\u0648\u0645 \u0627\u0644\u062c\u0645\u0639\u0629 \u0641\u064a\u0647 \u062e\u0644\u0642 \u0622\u062f\u0645 \u0648\u0641\u064a\u0647 \u0642\u0628\u0636 \u0648\u0641\u064a\u0647 \u0627\u0644\u0646\u0641\u062e\u0629 \u0648\u0641\u064a\u0647 \u0627\u0644\u0635\u0639\u0642\u0629 \u0641\u0623\u0643\u062b\u0631\u0648\u0627 \u0639\u0644\u064a \u0645\u0646 \u0627\u0644\u0635\u0644\u0627\u0629 \u0641\u064a\u0647 \u0641\u0625\u0646 \u0635\u0644\u0627\u062a\u0643\u0645 \u0645\u0639\u0631\u0648\u0636\u0629 \u0639\u0644\u064a\xbb. \u0642\u0627\u0644: \u0642\u0627\u0644\u0648\u0627 \u064a\u0627 \u0631\u0633\u0648\u0644 \u0627\u0644\u0644\u0647 \u0648\u0643\u064a\u0641 \u062a\u0639\u0631\u0636 \u0635\u0644\u0627\u062a\u0646\u0627 \u0639\u0644\u064a\u0643 \u0648\u0642\u062f \u0623\u0631\u0645\u062a\u061f \u2013 \u064a\u0642\u0648\u0644\u0648\u0646 \u0628\u0644\u064a\u062a \u2013 \u0641\u0642\u0627\u0644: \xab\u0625\u0646 \u0627\u0644\u0644\u0647 \u0639\u064e\u0632\u0651\u064e \u0648\u064e\u062c\u064e\u0644\u0651\u064e \u062d\u0631\u0645 \u0639\u0644\u0649 \u0627\u0644\u0623\u0631\u0636 \u0623\u062c\u0633\u0627\u062f \u0627\u0644\u0623\u0646\u0628\u064a\u0627\u0621\xbb \u0631\u0648\u0627\u0647 \u0623\u0628\u0648 \u062f\u0627\u0648\u062f \u0648\u063a\u064a\u0631\u0647.                    ","\n                    \u062c- \u0641\u0631\u0636 \u0639\u064a\u0646 \u0639\u0644\u0649 \u0643\u0644 \u0645\u0633\u0644\u0645 \u0630\u0643\u0631 \u0628\u0627\u0644\u063a \u0639\u0627\u0642\u0644 \u0645\u0642\u064a\u0645.\n\u0642\u0627\u0644 \u062a\u064e\u0639\u064e\u0627\u0644\u064e\u0649: \ufd3f \u064a\u064e\u0653\u0623\u064e\u064a\u0651\u064f\u0647\u064e\u0627 \u0671\u0644\u0651\u064e\u0630\u0650\u064a\u0646\u064e \u0621\u064e\u0627\u0645\u064e\u0646\u064f\u0648\u0653\u0627\u0652 \u0625\u0650\u0630\u064e\u0627 \u0646\u064f\u0648\u062f\u0650\u064a\u064e \u0644\u0650\u0644\u0635\u0651\u064e\u0644\u064e\u0648\u0629\u0650 \u0645\u0650\u0646 \u064a\u064e\u0648\u06e1\u0645\u0650 \u0671\u0644\u06e1\u062c\u064f\u0645\u064f\u0639\u064e\u0629\u0650 \u0641\u064e\u0671\u0633\u06e1\u0639\u064e\u0648\u06e1\u0627\u0652 \u0625\u0650\u0644\u064e\u0649 \u0630\u0650\u0643\u06e1\u0631\u0650 \u0671\u0644\u0644\u0651\u064e\u0647\u0650 \u0648\u064e\u0630\u064e\u0631\u064f\u0648\u0627\u0652 \u0671\u0644\u06e1\u0628\u064e\u064a\u06e1\u0639\u064e\u06da \u0630\u064e\u0644\u0650\u0643\u064f\u0645\u06e1 \u062e\u064e\u064a\u06e1\u0631\u065e \u0644\u0651\u064e\u0643\u064f\u0645\u06e1 \u0625\u0650\u0646 \u0643\u064f\u0646\u062a\u064f\u0645\u06e1 \u062a\u064e\u0639\u06e1\u0644\u064e\u0645\u064f\u0648\u0646\u064e 9\ufd3e [\u0633\u0648\u0631\u0629 \u0627\u0644\u0645\u0646\u0627\u0641\u0642\u0648\u0646: \u0669].                    ","\n                    \u062c- \u0639\u062f\u062f \u0631\u0643\u0639\u0627\u062a \u0635\u0644\u0627\u0629 \u0627\u0644\u062c\u0645\u0639\u0629 \u0631\u0643\u0639\u062a\u064a\u0646 \u064a\u062c\u0647\u0631 \u0641\u064a\u0647\u0645\u0627 \u0627\u0644\u0625\u0645\u0627\u0645 \u0628\u0627\u0644\u0642\u0631\u0627\u0621\u0629\u060c \u062d\u064a\u062b\u064f \u062a\u062a\u0642\u062f\u0651\u0645\u0647\u0645\u0627 \u062e\u0637\u0628\u062a\u0627\u0646 \u0645\u0639\u0631\u0648\u0641\u062a\u0627\u0646.                    ","\n                    \u062c- \u0644\u0627 \u064a\u062c\u0648\u0632 \u0627\u0644\u062a\u062e\u0644\u0641 \u0639\u0646 \u0635\u0644\u0627\u0629 \u0627\u0644\u062c\u0645\u0639\u0629 \u0625\u0644\u0627 \u0645\u0646 \u0639\u0630\u0631 \u0634\u0631\u0639\u064a\u060c \u0648\u062c\u0627\u0621 \u0639\u0646 \u0627\u0644\u0646\u0628\u064a \ufdfa \u060c \u0642\u0648\u0644\u0647: \xab\u0645\u0646 \u062a\u0631\u0643 \u062b\u0644\u0627\u062b \u062c\u0645\u0639 \u062a\u0647\u0627\u0648\u0646\u0627 \u0628\u0647\u0627\u061b \u0637\u0628\u0639 \u0627\u0644\u0644\u0647 \u0639\u0644\u0649 \u0642\u0644\u0628\u0647\xbb \u0631\u0648\u0627\u0647 \u0623\u0628\u0648 \u062f\u0627\u0648\u062f \u0648\u063a\u064a\u0631\u0647.                    ","\n                    \u062c-\n\u0661- \u0627\u0644\u0627\u063a\u062a\u0633\u0627\u0644.\n\u0662- \u0627\u0644\u062a\u0637\u064a\u0628.\n\u0663- \u0644\u0628\u0633 \u0623\u062d\u0633\u0646 \u0627\u0644\u062b\u064a\u0627\u0628.\n\u0664- \u0627\u0644\u062a\u0628\u0643\u064a\u0631 \u0625\u0644\u0649 \u0627\u0644\u0645\u0633\u062c\u062f.\n\u0665- \u0627\u0644\u0625\u0643\u062b\u0627\u0631 \u0645\u0646 \u0627\u0644\u0635\u0644\u0627\u0629 \u0639\u0644\u0649 \u0627\u0644\u0646\u0628\u064a \ufdfa .\n\u0666- \u0642\u0631\u0627\u0621\u0629 \u0633\u0648\u0631\u0629 \u0627\u0644\u0643\u0647\u0641.\n\u0667- \u0627\u0644\u0630\u0647\u0627\u0628 \u0625\u0644\u0649 \u0627\u0644\u0645\u0633\u062c\u062f \u0645\u0627\u0634\u064a\u0627\u064b.\n\u0668- \u062a\u062d\u0631\u064a \u0633\u0627\u0639\u0629 \u0625\u062c\u0627\u0628\u0629 \u0627\u0644\u062f\u0639\u0627\u0621.                    ","\n                    \u062c- \u0639\u0646 \u0639\u0628\u062f \u0627\u0644\u0644\u0647 \u0628\u0646 \u0639\u0645\u0631 \u0631\u064e\u0636\u0650\u064a\u064e \u0627\u0644\u0644\u0651\u064e\u0647\u064f \u0639\u064e\u0646\u0652\u0647\u064f\u0645\u064e\u0627\u060c \u0623\u0646 \u0631\u0633\u0648\u0644 \u0627\u0644\u0644\u0647 \ufdfa \u0642\u0627\u0644: \xab\u0635\u0644\u0627\u0629 \u0627\u0644\u062c\u0645\u0627\u0639\u0629 \u0623\u0641\u0636\u0644 \u0645\u0646 \u0635\u0644\u0627\u0629 \u0627\u0644\u0641\u0630 \u0628\u0633\u0628\u0639 \u0648\u0639\u0634\u0631\u064a\u0646 \u062f\u0631\u062c\u0629\xbb \u0631\u0648\u0627\u0647 \u0645\u0633\u0644\u0645.                    ","\n                    \u062c- \u0647\u0648 \u062d\u0636\u0648\u0631 \u0627\u0644\u0642\u0644\u0628 \u0648\u0633\u0643\u0648\u0646 \u0627\u0644\u062c\u0648\u0627\u0631\u062d \u0641\u064a\u0647\u0627.\n\u0642\u0627\u0644 \u062a\u064e\u0639\u064e\u0627\u0644\u064e\u0649: \ufd3f\u0642\u064e\u062f\u0652 \u0623\u064e\u0641\u0652\u0644\u064e\u062d\u064e \u0627\u0644\u0652\u0645\u064f\u0624\u0652\u0645\u0650\u0646\u064f\u0648\u0646\u064e 1 \u0627\u0644\u0651\u064e\u0630\u0650\u064a\u0646\u064e \u0647\u064f\u0645\u0652 \u0641\u0650\u064a \u0635\u064e\u0644\u064e\u0627\u062a\u0650\u0647\u0650\u0645\u0652 \u062e\u064e\u0627\u0634\u0650\u0639\u064f\u0648\u0646\u064e 2\ufd3e [\u0633\u0648\u0631\u0629 \u0627\u0644\u0645\u0624\u0645\u0646\u0648\u0646: 1\u060c 2].                    ","\n                    \u062c- \u0647\u064a \u062d\u0642 \u0648\u0627\u062c\u0628 \u0641\u064a \u0645\u0627\u0644 \u062e\u0627\u0635 \u0644\u0637\u0627\u0626\u0641\u0629 \u0645\u062e\u0635\u0648\u0635\u0629 \u0641\u064a \u0648\u0642\u062a \u0645\u062e\u0635\u0648\u0635.\n- \u0648\u0647\u064a \u0631\u0643\u0646 \u0645\u0646 \u0623\u0631\u0643\u0627\u0646 \u0627\u0644\u0625\u0633\u0644\u0627\u0645\u060c \u0648\u0635\u062f\u0642\u0629 \u0648\u0627\u062c\u0628\u0629 \u062a\u0624\u062e\u0630 \u0645\u0646 \u0627\u0644\u063a\u0646\u064a \u0648\u062a\u0639\u0637\u0649 \u0627\u0644\u0641\u0642\u064a\u0631.\n\u0642\u0627\u0644 \u062a\u064e\u0639\u064e\u0627\u0644\u064e\u0649: \ufd3f\u0648\u064e\u0622\u062a\u064f\u0648\u0627 \u0627\u0644\u0632\u0651\u064e\u0643\u064e\u0627\u0629\u064e\ufd3e [\u0633\u0648\u0631\u0629 \u0627\u0644\u0628\u0642\u0631\u0629: 43].                    ","\n                    \u062c- \u0647\u064a \u063a\u064a\u0631 \u0627\u0644\u0632\u0643\u0627\u0629\u060c \u0645\u062b\u0644: \u0627\u0644\u062a\u0635\u062f\u0642 \u0628\u0623\u064a \u0634\u064a\u0621 \u0641\u064a \u0648\u062c\u0648\u0647 \u0627\u0644\u062e\u064a\u0631 \u0641\u064a \u0623\u064a \u0648\u0642\u062a.\n\u0642\u0627\u0644 \u062a\u064e\u0639\u064e\u0627\u0644\u064e\u0649: \ufd3f\u0648\u064e\u0623\u064e\u0646\u0652\u0641\u0650\u0642\u064f\u0648\u0627 \u0641\u0650\u064a \u0633\u064e\u0628\u0650\u064a\u0644\u0650 \u0627\u0644\u0644\u0651\u064e\u0647\u0650\ufd3e [\u0633\u0648\u0631\u0629 \u0627\u0644\u0628\u0642\u0631\u0629: 195].                    ","\n                    \u062c- \u0647\u0648 \u0627\u0644\u062a\u0639\u0628\u062f \u0644\u0644\u0647 \u0628\u0627\u0644\u0625\u0645\u0633\u0627\u0643 \u0639\u0646 \u0627\u0644\u0645\u0641\u0637\u0631\u0627\u062a \u0645\u0646 \u0637\u0644\u0648\u0639 \u0627\u0644\u0641\u062c\u0631 \u0625\u0644\u0649 \u063a\u0631\u0648\u0628 \u0627\u0644\u0634\u0645\u0633\u060c \u0645\u0639 \u0627\u0644\u0646\u064a\u0629\u060c \u0648\u0647\u0648 \u0646\u0648\u0639\u0627\u0646:\n\u0635\u064a\u0627\u0645 \u0648\u0627\u062c\u0628: \u0645\u062b\u0644 \u0635\u064a\u0627\u0645 \u0634\u0647\u0631 \u0631\u0645\u0636\u0627\u0646\u060c \u0648\u0647\u0648 \u0631\u0643\u0646 \u0645\u0646 \u0623\u0631\u0643\u0627\u0646 \u0627\u0644\u0625\u0633\u0644\u0627\u0645.\n\u0642\u0627\u0644 \u062a\u064e\u0639\u064e\u0627\u0644\u064e\u0649: \ufd3f\u064a\u064e\u0627 \u0623\u064e\u064a\u0651\u064f\u0647\u064e\u0627 \u0627\u0644\u0651\u064e\u0630\u0650\u064a\u0646\u064e \u0622\u0645\u064e\u0646\u064f\u0648\u0627 \u0643\u064f\u062a\u0650\u0628\u064e \u0639\u064e\u0644\u064e\u064a\u0652\u0643\u064f\u0645\u064f \u0627\u0644\u0635\u0651\u0650\u064a\u064e\u0627\u0645\u064f \u0643\u064e\u0645\u064e\u0627 \u0643\u064f\u062a\u0650\u0628\u064e \u0639\u064e\u0644\u064e\u0649 \u0627\u0644\u0651\u064e\u0630\u0650\u064a\u0646\u064e \u0645\u0650\u0646\u0652 \u0642\u064e\u0628\u0652\u0644\u0650\u0643\u064f\u0645\u0652 \u0644\u064e\u0639\u064e\u0644\u0651\u064e\u0643\u064f\u0645\u0652 \u062a\u064e\u062a\u0651\u064e\u0642\u064f\u0648\u0646\u064e 183\ufd3e [\u0633\u0648\u0631\u0629 \u0627\u0644\u0628\u0642\u0631\u0629: 183].\n\u0648\u0635\u064a\u0627\u0645 \u063a\u064a\u0631 \u0648\u0627\u062c\u0628: \u0645\u062b\u0644 \u0635\u0648\u0645 \u0627\u0644\u0625\u062b\u0646\u064a\u0646 \u0648\u0627\u0644\u062e\u0645\u064a\u0633 \u0645\u0646 \u0643\u0644 \u0623\u0633\u0628\u0648\u0639\u060c \u0648\u0635\u064a\u0627\u0645 \u062b\u0644\u0627\u062b\u0629 \u0623\u064a\u0627\u0645 \u0645\u0646 \u0643\u0644 \u0634\u0647\u0631\u060c \u0648\u0623\u0641\u0636\u0644\u0647\u0627 \u0623\u064a\u0627\u0645 \u0627\u0644\u0628\u064a\u0636 (13\u060c 14\u060c 15) \u0645\u0646 \u0643\u0644 \u0634\u0647\u0631 \u0642\u0645\u0631\u064a.                    ","\n                    \u062c- \u0639\u0646\xa0\u0623\u0628\u064a \u0647\u0631\u064a\u0631\u0629 \u0631\u064e\u0636\u0650\u064a\u064e \u0627\u0644\u0644\u0651\u064e\u0647\u064f \u0639\u064e\u0646\u0652\u0647\u064f\u060c \u0623\u0646 \u0631\u0633\u0648\u0644 \u0627\u0644\u0644\u0647 \ufdfa \u0642\u0627\u0644: \xab\u0645\u0646 \u0635\u0627\u0645 \u0631\u0645\u0636\u0627\u0646 \u0625\u064a\u0645\u0627\u0646\u0627 \u064b \u0648\u0627\u062d\u062a\u0633\u0627\u0628\u0627\u064b\u061b \u063a\u064f\u0641\u0650\u0631 \u0644\u0647 \u0645\u0627 \u062a\u0642\u062f\u0645 \u0645\u0646 \u0630\u0646\u0628\u0647\xbb \u0645\u062a\u0641\u0642 \u0639\u0644\u064a\u0647.                    ","\n                    \u062c- \u0639\u0646 \u0623\u0628\u064a \u0633\u0639\u064a\u062f \u0627\u0644\u062e\u062f\u0631\u064a \u0631\u064e\u0636\u0650\u064a\u064e \u0627\u0644\u0644\u0651\u064e\u0647\u064f \u0639\u064e\u0646\u0652\u0647\u064f \u0642\u0627\u0644: \u0642\u0627\u0644 \u0631\u0633\u0648\u0644 \u0627\u0644\u0644\u0647 \ufdfa : \xab\u0645\u0627 \u0645\u0646 \u0639\u0628\u062f \u064a\u0635\u0648\u0645 \u064a\u0648\u0645\u064b\u0627 \u0641\u064a \u0633\u0628\u064a\u0644 \u0627\u0644\u0644\u0647\u060c \u0625\u0644\u0627 \u0628\u0627\u0639\u062f \u0627\u0644\u0644\u0647 \u0628\u0630\u0644\u0643 \u0627\u0644\u064a\u0648\u0645 \u0648\u062c\u0647\u0647 \u0639\u0646 \u0627\u0644\u0646\u0627\u0631 \u0633\u0628\u0639\u064a\u0646 \u062e\u0631\u064a\u0641\u064b\u0627\xbb \u0645\u062a\u0641\u0642 \u0639\u0644\u064a\u0647.\n- \u0645\u0639\u0646\u0649 \xab\u0633\u0628\u0639\u064a\u0646 \u062e\u0631\u064a\u0641\u064b\u0627\xbb\u061b \u0623\u064a: \u0633\u0628\u0639\u064a\u0646 \u0633\u0646\u0629.                    ","\n                    \u062c- \u0661- \u0627\u0644\u0623\u0643\u0644 \u0648\u0627\u0644\u0634\u0631\u0628 \u0639\u0645\u062f\u0627\u064b.\n\u0662- \u0627\u0644\u0642\u064a\u0621 \u0639\u0645\u062f\u0627\u064b.\n\u0663- \u0627\u0644\u0631\u062f\u0629 \u0639\u0646 \u0627\u0644\u0625\u0633\u0644\u0627\u0645.                    ","\n                    \u062c- \u0661- \u062a\u0639\u062c\u064a\u0644 \u0627\u0644\u0641\u0637\u0631.\n\u0662-\xa0\u0627\u0644\u0633\u062d\u0648\u0631 \u0648\u062a\u0623\u062e\u064a\u0631\u0647.\n\u0663-\xa0\u0627\u0644\u0632\u064a\u0627\u062f\u0629 \u0641\u064a \u0623\u0639\u0645\u0627\u0644 \u0627\u0644\u062e\u064a\u0631 \u0648\u0627\u0644\u0639\u0628\u0627\u062f\u0629.\n\u0664-\xa0\u0642\u0648\u0644 \u0627\u0644\u0635\u0627\u0626\u0645 \u0625\u0630\u0627 \u0634\u062a\u0645: \u0625\u0646\u064a \u0635\u0627\u0626\u0645.\n\u0665-\xa0\u0627\u0644\u062f\u0639\u0627\u0621 \u0639\u0646\u062f \u0627\u0644\u0641\u0637\u0631.\n\u0666-\xa0\u0627\u0644\u0641\u0637\u0631 \u0639\u0644\u0649 \u0631\u0637\u0628 \u0623\u0648 \u062a\u0645\u0631\u060c \u0641\u0625\u0646 \u0644\u0645 \u064a\u062c\u062f\u061b \u0641\u0639\u0644\u0649 \u0645\u0627\u0621.                    ","\n                    \u062c- \u0627\u0644\u062d\u062c: \u0647\u0648 \u0627\u0644\u062a\u0639\u0628\u062f \u0644\u0644\u0647 \u062a\u064e\u0639\u064e\u0627\u0644\u064e\u0649\u060c \u0628\u0642\u0635\u062f \u0628\u064a\u062a\u0647 \u0627\u0644\u062d\u0631\u0627\u0645 \u0644\u0623\u0639\u0645\u0627\u0644 \u0645\u062e\u0635\u0648\u0635\u0629 \u0641\u064a \u0648\u0642\u062a \u0645\u062e\u0635\u0648\u0635.\n\u0642\u0627\u0644 \u062a\u064e\u0639\u064e\u0627\u0644\u064e\u0649: \ufd3f\u0648\u064e\u0644\u0650\u0644\u0651\u064e\u0647\u0650 \u0639\u064e\u0644\u064e\u0649 \u0627\u0644\u0646\u0651\u064e\u0627\u0633\u0650 \u062d\u0650\u062c\u0651\u064f \u0627\u0644\u0652\u0628\u064e\u064a\u0652\u062a\u0650 \u0645\u064e\u0646\u0650 \u0627\u0633\u0652\u062a\u064e\u0637\u064e\u0627\u0639\u064e \u0625\u0650\u0644\u064e\u064a\u0652\u0647\u0650 \u0633\u064e\u0628\u0650\u064a\u0644\u064b\u0627 \u0648\u064e\u0645\u064e\u0646\u0652 \u0643\u064e\u0641\u064e\u0631\u064e \u0641\u064e\u0625\u0650\u0646\u0651\u064e \u0627\u0644\u0644\u0651\u064e\u0647\u064e \u063a\u064e\u0646\u0650\u064a\u0651\u064c \u0639\u064e\u0646\u0650 \u0627\u0644\u0652\u0639\u064e\u0627\u0644\u064e\u0645\u0650\u064a\u0646\u064e 97\ufd3e [\u0633\u0648\u0631\u0629 \u0622\u0644 \u0639\u0645\u0631\u0627\u0646: 97].                    ","\n                    \u062c- \u0661- \u0627\u0644\u0625\u062d\u0631\u0627\u0645.\n\u0662- \u0627\u0644\u0648\u0642\u0648\u0641 \u0628\u0639\u0631\u0641\u0629.\n\u0663- \u0637\u0648\u0627\u0641 \u0627\u0644\u0625\u0641\u0627\u0636\u0629.\n\u0664- \u0627\u0644\u0633\u0639\u064a \u0628\u064a\u0646 \u0627\u0644\u0635\u0641\u0627 \u0648\u0627\u0644\u0645\u0631\u0648\u0629.                    ","\n                    \u062c- \u0639\u0646 \u0623\u0628\u064a \u0647\u0631\u064a\u0631\u0629 \u0631\u064e\u0636\u0650\u064a\u064e \u0627\u0644\u0644\u0651\u064e\u0647\u064f \u0639\u064e\u0646\u0652\u0647\u064f\u060c \u0642\u0627\u0644: \u0633\u0645\u0639\u062a \u0631\u0633\u0648\u0644 \u0627\u0644\u0644\u0647 \ufdfa \u064a\u0642\u0648\u0644: \xab\u0645\u0646 \u062d\u062c \u0644\u0644\u0647 \u0641\u0644\u0645 \u064a\u0631\u0641\u062b \u0648\u0644\u0645 \u064a\u0641\u0633\u0642\u061b \u0631\u062c\u0639 \u0643\u064a\u0648\u0645 \u0648\u0644\u062f\u062a\u0647 \u0623\u0645\u0647\xbb \u0631\u0648\u0627\u0647 \u0627\u0644\u0628\u062e\u0627\u0631\u064a \u0648\u063a\u064a\u0631\u0647.\n- \xab\u0643\u064a\u0648\u0645 \u0648\u0644\u062f\u062a\u0647 \u0623\u0645\u0647\xbb: \u0623\u064a \u0628\u063a\u064a\u0631 \u0630\u0646\u0628.                    ","\n                    \u062c- \u0627\u0644\u0639\u0645\u0631\u0629: \u0647\u064a \u0627\u0644\u062a\u0639\u0628\u062f \u0644\u0644\u0647 \u062a\u064e\u0639\u064e\u0627\u0644\u064e\u0649 \u0628\u0642\u0635\u062f \u0628\u064a\u062a\u0647 \u0627\u0644\u062d\u0631\u0627\u0645 \u0644\u0623\u0639\u0645\u0627\u0644 \u0645\u062e\u0635\u0648\u0635\u0629 \u0641\u064a \u0623\u064a \u0648\u0642\u062a.                    ","\n                    \u062c- \u0661- \u0627\u0644\u0625\u062d\u0631\u0627\u0645.\n\u0662- \u0627\u0644\u0637\u0648\u0627\u0641 \u0628\u0627\u0644\u0628\u064a\u062a.\n\u0663- \u0627\u0644\u0633\u0639\u064a \u0628\u064a\u0646 \u0627\u0644\u0635\u0641\u0627 \u0648\u0627\u0644\u0645\u0631\u0648\u0629.                    ","\n                    \u062c- \u0647\u0648 \u0628\u0630\u0644 \u0627\u0644\u062c\u0647\u062f \u0648\u0627\u0644\u0648\u0633\u0639 \u0641\u064a \u0646\u0634\u0631 \u0627\u0644\u0625\u0633\u0644\u0627\u0645 \u0648\u0627\u0644\u062f\u0641\u0627\u0639 \u0639\u0646\u0647 \u0648\u0639\u0646 \u0623\u0647\u0644\u0647\u060c \u0623\u0648 \u0642\u062a\u0627\u0644 \u0639\u062f\u0648 \u0644\u0644\u0625\u0633\u0644\u0627\u0645 \u0648\u0623\u0647\u0644\u0647.\n\u0642\u0627\u0644 \u062a\u064e\u0639\u064e\u0627\u0644\u064e\u0649: \ufd3f\u0648\u064e\u062c\u064e\u0627\u0647\u0650\u062f\u064f\u0648\u0627 \u0628\u0650\u0623\u064e\u0645\u0652\u0648\u064e\u0627\u0644\u0650\u0643\u064f\u0645\u0652 \u0648\u064e\u0623\u064e\u0646\u0652\u0641\u064f\u0633\u0650\u0643\u064f\u0645\u0652 \u0641\u0650\u064a \u0633\u064e\u0628\u0650\u064a\u0644\u0650 \u0627\u0644\u0644\u0651\u064e\u0647\u0650 \u0630\u064e\u0644\u0650\u0643\u064f\u0645\u0652 \u062e\u064e\u064a\u0652\u0631\u064c \u0644\u064e\u0643\u064f\u0645\u0652 \u0625\u0650\u0646\u0652 \u0643\u064f\u0646\u0652\u062a\u064f\u0645\u0652 \u062a\u064e\u0639\u0652\u0644\u064e\u0645\u064f\u0648\u0646\u064e 41\ufd3e [\u0633\u0648\u0631\u0629 \u0627\u0644\u062a\u0648\u0628\u0629: 41].                    "]),t.s)
B.jK=A.a(s([B.fl,B.dy,B.ct,B.dB,B.dF,B.bK,B.jH,B.fw,B.ak,B.dG,B.bm,B.cq,B.cr,B.dz,B.cs,B.fm,B.b4,B.fn,B.fo,B.jF,B.aj,B.dA,B.cu,B.cv,B.fp,B.fq,B.fr,B.fs,B.jG,B.ft,B.fu,B.dC,B.cw,B.cx,B.fv,B.dD,B.dE]),A.ab("w<b9>"))
