B.BG=A.a(s(["\n                    \u062c- \u0631\u0628\u064a \u0627\u0644\u0644\u0647 \u0627\u0644\u0630\u064a \u0631\u0628\u0627\u0646\u064a \u0648\u0631\u0628\u0649 \u062c\u0645\u064a\u0639 \u0627\u0644\u0639\u0627\u0644\u0645\u064a\u0646 \u0628\u0646\u0639\u0645\u062a\u0647.\n\u0648\u0627\u0644\u062f\u0644\u064a\u0644: \u0642\u0648\u0644\u0647 \u062a\u064e\u0639\u064e\u0627\u0644\u064e\u0649: \ufd3f\u0627\u0644\u0652\u062d\u064e\u0645\u0652\u062f\u064f \u0644\u0650\u0644\u0651\u064e\u0647\u0650 \u0631\u064e\u0628\u0651\u0650 \u0627\u0644\u0652\u0639\u064e\u0627\u0644\u064e\u0645\u0650\u064a\u0646\u064e 2\ufd3e [\u0633\u0648\u0631\u0629 \u0627\u0644\u0641\u0627\u062a\u062d\u0629: 2].                    ","\n                    \u062c- \u062f\u064a\u0646\u064a \u0627\u0644\u0625\u0633\u0644\u0627\u0645\u060c \u0648\u0647\u0648: \u0627\u0644\u0627\u0633\u062a\u0633\u0644\u0627\u0645 \u0644\u0644\u0647 \u0628\u0627\u0644\u062a\u0648\u062d\u064a\u062f\u060c \u0648\u0627\u0644\u0627\u0646\u0642\u064a\u0627\u062f \u0644\u0647 \u0628\u0627\u0644\u0637\u0627\u0639\u0629\u060c \u0648\u0627\u0644\u0628\u0631\u0627\u0621\u0629 \u0645\u0646 \u0627\u0644\u0634\u0631\u0643 \u0648\u0623\u0647\u0644\u0647.\n\u0642\u0627\u0644 \u062a\u064e\u0639\u064e\u0627\u0644\u064e\u0649: \ufd3f\u0625\u0650\u0646\u0651\u064e \u0627\u0644\u062f\u0651\u0650\u064a\u0646\u064e \u0639\u0650\u0646\u0652\u062f\u064e \u0627\u0644\u0644\u0651\u064e\u0647\u0650 \u0627\u0644\u0652\u0625\u0650\u0633\u0652\u0644\u064e\u0627\u0645\u064f ...\ufd3e [\u0633\u0648\u0631\u0629 \u0622\u0644 \u0639\u0645\u0631\u0627\u0646: 19].                    ","\n                    \u062c- \u0645\u062d\u0645\u062f \ufdfa .\n\u0642\u0627\u0644 \u062a\u064e\u0639\u064e\u0627\u0644\u064e\u0649: \ufd3f\u0645\u0651\u064f\u062d\u064e\u0645\u0651\u064e\u062f\u064c \u0631\u0651\u064e\u0633\u064f\u0648\u0644\u064f \u0671\u0644\u0644\u0651\u064e\u0647\u0650\u06da ...\ufd3e [\u0633\u0648\u0631\u0629 \u0627\u0644\u0641\u062a\u062d: 29].                    ",'\n                    \u062c- \u0643\u0644\u0645\u0629 \u0627\u0644\u062a\u0648\u062d\u064a\u062f " \u0644\u0627 \u0625\u0644\u0647 \u0625\u0644\u0627 \u0627\u0644\u0644\u0647 " \u0648\u0645\u0639\u0646\u0627\u0647\u0627: \u0644\u0627 \u0645\u0639\u0628\u0648\u062f \u062d\u0642\u0651\u064c \u0625\u0644\u0651\u064e\u0627 \u0627\u0644\u0644\u0647.\n\u0642\u0627\u0644 \u062a\u064e\u0639\u064e\u0627\u0644\u064e\u0649: \ufd3f\u0641\u064e\u0627\u0639\u0652\u0644\u064e\u0645\u0652 \u0623\u064e\u0646\u0651\u064e\u0647\u064f \u0644\u064e\u0627 \u0625\u0650\u0644\u064e\u0647\u064e \u0625\u0650\u0644\u0651\u064e\u0627 \u0627\u0644\u0644\u0651\u064e\u0647\u064f ...\ufd3e [\u0633\u0648\u0631\u0629 \u0645\u062d\u0645\u062f: 19].                    ',"\n                    \u062c- \u0627\u0644\u0644\u0647 \u0641\u064a \u0627\u0644\u0633\u0645\u0627\u0621 \u0641\u0648\u0642 \u0627\u0644\u0639\u0631\u0634\u060c \u0641\u0648\u0642 \u062c\u0645\u064a\u0639 \u0627\u0644\u0645\u062e\u0644\u0648\u0642\u0627\u062a\u060c \u0642\u0627\u0644 \u062a\u064e\u0639\u064e\u0627\u0644\u064e\u0649: \ufd3f\u0627\u0644\u0631\u0651\u064e\u062d\u0652\u0645\u064e\u0646\u064f \u0639\u064e\u0644\u064e\u0649 \u0627\u0644\u0652\u0639\u064e\u0631\u0652\u0634\u0650 \u0627\u0633\u0652\u062a\u064e\u0648\u064e\u0649 5\ufd3e [\u0633\u0648\u0631\u0629 \u0637\u0647: 5]. \u0648\u0642\u0627\u0644: \ufd3f\u0648\u064e\u0647\u064f\u0648\u064e \u0671\u0644\u06e1\u0642\u064e\u0627\u0647\u0650\u0631\u064f \u0641\u064e\u0648\u06e1\u0642\u064e \u0639\u0650\u0628\u064e\u0627\u062f\u0650\u0647\u0650\u06e6\u06da \u0648\u064e\u0647\u064f\u0648\u064e \u0671\u0644\u06e1\u062d\u064e\u0643\u0650\u064a\u0645\u064f \u0671\u0644\u06e1\u062e\u064e\u0628\u0650\u064a\u0631\u064f 18\ufd3e [\u0633\u0648\u0631\u0629 \u0627\u0644\u0623\u0646\u0639\u0627\u0645: 18].                    ","\n                    \u062c- \u0645\u0639\u0646\u0627\u0647\u0627: \u0623\u0646 \u0627\u0644\u0644\u0647 \u0623\u0631\u0633\u0644\u0647 \u0644\u0644\u0639\u0627\u0644\u0645\u064a\u0646 \u0628\u0634\u064a\u0631\u0627\u064b \u0648\u0646\u0630\u064a\u0631\u064b\u0627.\n\u0648\u064a\u062c\u0628:\n1- \u0637\u0627\u0639\u062a\u0647 \u0641\u064a\u0645\u0627 \u0623\u0645\u0631.\n2- \u062a\u0635\u062f\u064a\u0642\u0647 \u0641\u064a\u0645\u0627 \u0623\u062e\u0628\u0631.\n3- \u0639\u062f\u0645 \u0645\u0639\u0635\u064a\u062a\u0647.\n4- \u0644\u0627 \u064a\u0639\u0628\u062f \u0627\u0644\u0644\u0647 \u0625\u0644\u0627 \u0628\u0645\u0627 \u0634\u0631\u0639\u060c \u0648\u0647\u0648 \u0627\u0644\u0627\u0642\u062a\u062f\u0627\u0621 \u0628\u0627\u0644\u0633\u0646\u0629 \u0648\u062a\u0631\u0643 \u0627\u0644\u0628\u062f\u0639\u0629.\n\u0642\u0627\u0644 \u062a\u064e\u0639\u064e\u0627\u0644\u064e\u0649: \ufd3f\u0645\u064e\u0646\u0652 \u064a\u064f\u0637\u0650\u0639\u0650 \u0627\u0644\u0631\u0651\u064e\u0633\u064f\u0648\u0644\u064e \u0641\u064e\u0642\u064e\u062f\u0652 \u0623\u064e\u0637\u064e\u0627\u0639\u064e \u0627\u0644\u0644\u0651\u064e\u0647\u064e ...\ufd3e [\u0633\u0648\u0631\u0629 \u0627\u0644\u0646\u0633\u0627\u0621: 80]\u060c \u0648\u0642\u0627\u0644 \u0633\u064f\u0628\u0652\u062d\u064e\u0627\u0646\u064e\u0647\u064f: \ufd3f\u0648\u064e\u0645\u064e\u0627 \u064a\u064e\u0646\u0652\u0637\u0650\u0642\u064f \u0639\u064e\u0646\u0650 \u0627\u0644\u0652\u0647\u064e\u0648\u064e\u0649 3 \u0625\u0650\u0646\u0652 \u0647\u064f\u0648\u064e \u0625\u0650\u0644\u0651\u064e\u0627 \u0648\u064e\u062d\u0652\u064a\u064c \u064a\u064f\u0648\u062d\u064e\u0649 4\ufd3e [\u0633\u0648\u0631\u0629 \u0627\u0644\u0646\u062c\u0645: 3\u060c 4]. \u0648\u0642\u0627\u0644 \u062c\u064e\u0644\u0651\u064e \u0648\u064e\u0639\u064e\u0644\u064e\u0627: \ufd3f\u0644\u064e\u0642\u064e\u062f\u0652 \u0643\u064e\u0627\u0646\u064e \u0644\u064e\u0643\u064f\u0645\u0652 \u0641\u0650\u064a \u0631\u064e\u0633\u064f\u0648\u0644\u0650 \u0627\u0644\u0644\u0651\u064e\u0647\u0650 \u0623\u064f\u0633\u0652\u0648\u064e\u0629\u064c \u062d\u064e\u0633\u064e\u0646\u064e\u0629\u064c \u0644\u0650\u0645\u064e\u0646\u0652 \u0643\u064e\u0627\u0646\u064e \u064a\u064e\u0631\u0652\u062c\u064f\u0648 \u0627\u0644\u0644\u0651\u064e\u0647\u064e \u0648\u064e\u0627\u0644\u0652\u064a\u064e\u0648\u0652\u0645\u064e \u0627\u0644\u0652\u0622\u062e\u0650\u0631\u064e \u0648\u064e\u0630\u064e\u0643\u064e\u0631\u064e \u0627\u0644\u0644\u0651\u064e\u0647\u064e \u0643\u064e\u062b\u0650\u064a\u0631\u064b\u0627 21\ufd3e [\u0633\u0648\u0631\u0629 \u0627\u0644\u0623\u062d\u0632\u0627\u0628: 21].                    ","\n                    \u062c- \u062e\u0644\u0642\u0646\u0627 \u0644\u0639\u0628\u0627\u062f\u062a\u0647 \u0648\u062d\u062f\u0647 \u0644\u0627 \u0634\u0631\u064a\u0643 \u0644\u0647.\n\u0644\u0627 \u0644\u0644\u0647\u0648 \u0648\u0627\u0644\u0644\u0639\u0628.\n\u0642\u0627\u0644 \u062a\u064e\u0639\u064e\u0627\u0644\u064e\u0649: \ufd3f\u0648\u064e\u0645\u064e\u0627 \u062e\u064e\u0644\u064e\u0642\u0652\u062a\u064f \u0627\u0644\u0652\u062c\u0650\u0646\u0651\u064e \u0648\u064e\u0627\u0644\u0652\u0625\u0650\u0646\u0652\u0633\u064e \u0625\u0650\u0644\u0651\u064e\u0627 \u0644\u0650\u064a\u064e\u0639\u0652\u0628\u064f\u062f\u064f\u0648\u0646\u0650 56\ufd3e [\u0633\u0648\u0631\u0629 \u0627\u0644\u0630\u0627\u0631\u064a\u0627\u062a: 56].                    ","\n                    \u062c- \u0647\u064a \u0627\u0633\u0645\u064c \u062c\u0627\u0645\u0639\u064c \u0644\u0643\u0644\u0650\u0651 \u0645\u0627 \u064a\u062d\u0628\u064f\u0651\u0647 \u0627\u0644\u0644\u0647 \u0648\u064a\u0631\u0636\u0627\u0647 \u0645\u0646 \u0627\u0644\u0623\u0642\u0648\u0627\u0644 \u0648\u0627\u0644\u0623\u0639\u0645\u0627\u0644\u0650 \u0627\u0644\u0628\u0627\u0637\u0646\u0629\u0650 \u0648\u0627\u0644\u0638\u0627\u0647\u0631\u0629\u0650.\n\xb7\xa0\xa0\xa0\xa0\xa0\xa0\xa0 \u0627\u0644\u0638\u0627\u0647\u0631\u0629: \u0645\u062b\u0644 \u0630\u0643\u0631 \u0627\u0644\u0644\u0647 \u0628\u0627\u0644\u0644\u0633\u0627\u0646 \u0645\u0646 \u0627\u0644\u062a\u0633\u0628\u064a\u062d \u0648\u0627\u0644\u062a\u062d\u0645\u064a\u062f \u0648\u0627\u0644\u062a\u0643\u0628\u064a\u0631\u060c \u0648\u0627\u0644\u0635\u0644\u0627\u0629 \u0648\u0627\u0644\u062d\u062c.\n\xb7\xa0\xa0\xa0\xa0\xa0\xa0\xa0 \u0627\u0644\u0628\u0627\u0637\u0646\u0629: \u0645\u062b\u0644 \u0627\u0644\u062a\u0648\u0643\u0644 \u0648\u0627\u0644\u062e\u0648\u0641 \u0648\u0627\u0644\u0631\u062c\u0627\u0621.                    ","\n                    \u062c- \u0623\u0639\u0638\u0645 \u0648\u0627\u062c\u0628 \u0639\u0644\u064a\u0646\u0627: \u062a\u0648\u062d\u064a\u062f \u0627\u0644\u0644\u0647 \u062a\u064e\u0639\u064e\u0627\u0644\u064e\u0649.                    ","\n                    \u062c-1- \u062a\u0648\u062d\u064a\u062f \u0627\u0644\u0631\u0628\u0648\u0628\u064a\u0629: \u0648\u0647\u0648 \u0627\u0644\u0625\u064a\u0645\u0627\u0646 \u0628\u0623\u0646 \u0627\u0644\u0644\u0647 \u0647\u0648 \u0627\u0644\u062e\u0627\u0644\u0642 \u0627\u0644\u0631\u0627\u0632\u0642 \u0627\u0644\u0645\u0627\u0644\u0643 \u0627\u0644\u0645\u062f\u0628\u0631\u060c \u0648\u062d\u062f\u0647 \u0644\u0627 \u0634\u0631\u064a\u0643 \u0644\u0647.\n2- \u062a\u0648\u062d\u064a\u062f \u0627\u0644\u0623\u0644\u0648\u0647\u064a\u0629: \u0648\u0647\u0648 \u0625\u0641\u0631\u0627\u062f \u0627\u0644\u0644\u0647 \u0628\u0627\u0644\u0639\u0628\u0627\u062f\u0629\u060c \u0641\u0644\u0627 \u064a\u0639\u0628\u062f \u0623\u062d\u062f \u0625\u0644\u0627 \u0627\u0644\u0644\u0647 \u062a\u064e\u0639\u064e\u0627\u0644\u064e\u0649.\n3- \u062a\u0648\u062d\u064a\u062f \u0627\u0644\u0623\u0633\u0645\u0627\u0621 \u0648\u0627\u0644\u0635\u0641\u0627\u062a: \u0648\u0647\u0648 \u0627\u0644\u0625\u064a\u0645\u0627\u0646 \u0628\u0627\u0644\u0623\u0633\u0645\u0627\u0621 \u0648\u0627\u0644\u0635\u0641\u0627\u062a \u0644\u0644\u0647 \u062a\u064e\u0639\u064e\u0627\u0644\u064e\u0649 \u0627\u0644\u0648\u0627\u0631\u062f\u0629 \u0641\u064a \u0627\u0644\u0643\u062a\u0627\u0628 \u0648\u0627\u0644\u0633\u0646\u0629\u060c \u0645\u0646 \u062f\u0648\u0646 \u062a\u0645\u062b\u064a\u0644 \u0648\u0644\u0627 \u062a\u0634\u0628\u064a\u0647 \u0648\u0644\u0627 \u062a\u0639\u0637\u064a\u0644.\n\u0648\u062f\u0644\u064a\u0644 \u0623\u0646\u0648\u0627\u0639 \u0627\u0644\u062a\u0648\u062d\u064a\u062f \u0627\u0644\u062b\u0644\u0627\u062b\u0629: \u0642\u0648\u0644\u0647 \u062a\u064e\u0639\u064e\u0627\u0644\u064e\u0649: \ufd3f\u0631\u0651\u064e\u0628\u0651\u064f \u0671\u0644\u0633\u0651\u064e\u0645\u064e\u0640\u0648\u064e\u200a\u2060\u062a\u0650 \u0648\u064e\u0671\u0644\u06e1\u0623\u064e\u0631\u06e1\u0636\u0650 \u0648\u064e\u0645\u064e\u0627 \u0628\u064e\u064a\u06e1\u0646\u064e\u0647\u064f\u0645\u064e\u0627 \u0641\u064e\u0671\u0639\u06e1\u0628\u064f\u062f\u06e1\u0647\u064f \u0648\u064e\u0671\u0635\u06e1\u0637\u064e\u0628\u0650\u0631\u06e1 \u0644\u0650\u0639\u0650\u0628\u064e\u0640\u062f\u064e\u062a\u0650\u0647\u0650\u06e6\u06da \u0647\u064e\u0644\u06e1 \u062a\u064e\u0639\u06e1\u0644\u064e\u0645\u064f \u0644\u064e\u0647\u064f\u06e5 \u0633\u064e\u0645\u0650\u064a\u0651\u064b\u0627 65\ufd3e [\u0633\u0648\u0631\u0629 \u0645\u0631\u064a\u0645: 65].                    ","\n                    \u062c- \u0627\u0644\u0634\u0631\u0643 \u0628\u0627\u0644\u0644\u0647 \u062a\u064e\u0639\u064e\u0627\u0644\u064e\u0649.\n\u0642\u0627\u0644 \u062a\u064e\u0639\u064e\u0627\u0644\u064e\u0649: \ufd3f\u0625\u0650\u0646\u0651\u064e \u0627\u0644\u0644\u0651\u064e\u0647\u064e \u0644\u064e\u0627 \u064a\u064e\u063a\u0652\u0641\u0650\u0631\u064f \u0623\u064e\u0646\u0652 \u064a\u064f\u0634\u0652\u0631\u064e\u0643\u064e \u0628\u0650\u0647\u0650 \u0648\u064e\u064a\u064e\u063a\u0652\u0641\u0650\u0631\u064f \u0645\u064e\u0627 \u062f\u064f\u0648\u0646\u064e \u0630\u064e\u0644\u0650\u0643\u064e \u0644\u0650\u0645\u064e\u0646\u0652 \u064a\u064e\u0634\u064e\u0627\u0621\u064f \u0648\u064e\u0645\u064e\u0646\u0652 \u064a\u064f\u0634\u0652\u0631\u0650\u0643\u0652 \u0628\u0650\u0627\u0644\u0644\u0651\u064e\u0647\u0650 \u0641\u064e\u0642\u064e\u062f\u0650 \u0627\u0641\u0652\u062a\u064e\u0631\u064e\u0649 \u0625\u0650\u062b\u0652\u0645\u064b\u0627 \u0639\u064e\u0638\u0650\u064a\u0645\u064b\u0627 48\ufd3e [\u0633\u0648\u0631\u0629 \u0627\u0644\u0646\u0633\u0627\u0621: 48]                    ","\n                    \u062c- \u0627\u0644\u0634\u0631\u0643: \u0647\u0648 \u0635\u0631\u0641 \u0623\u064a \u0646\u0648\u0639 \u0645\u0646 \u0623\u0646\u0648\u0627\u0639 \u0627\u0644\u0639\u0628\u0627\u062f\u0629 \u0644\u063a\u064a\u0631 \u0627\u0644\u0644\u0647 \u062a\u064e\u0639\u064e\u0627\u0644\u064e\u0649.\n\u0623\u0646\u0648\u0627\u0639\u0647:\n\u0634\u0631\u0643 \u0623\u0643\u0628\u0631\u061b \u0645\u062b\u0644: \u062f\u0639\u0648\u0629 \u063a\u064a\u0631 \u0627\u0644\u0644\u0647 \u062a\u064e\u0639\u064e\u0627\u0644\u064e\u0649\u060c \u0623\u0648 \u0627\u0644\u0633\u062c\u0648\u062f \u0644\u063a\u064a\u0631\u0647 \u0633\u064f\u0628\u0652\u062d\u064e\u0627\u0646\u064e\u0647\u064f\u060c \u0623\u0648 \u0627\u0644\u0630\u0628\u062d \u0644\u063a\u064a\u0631 \u0627\u0644\u0644\u0647 \u0639\u064e\u0632\u0651\u064e \u0648\u064e\u062c\u064e\u0644\u0651\u064e.\n\u0634\u0631\u0643 \u0623\u0635\u063a\u0631\u061b \u0645\u062b\u0644: \u0627\u0644\u062d\u0644\u0641 \u0628\u063a\u064a\u0631 \u0627\u0644\u0644\u0647 \u062a\u064e\u0639\u064e\u0627\u0644\u064e\u0649\u060c \u0623\u0648 \u0627\u0644\u062a\u0645\u0627\u0626\u0645\u060c \u0648\u0647\u0648 \u0645\u0627 \u064a\u064f\u0639\u0644\u0642 \u0645\u0646 \u0627\u0644\u0623\u0634\u064a\u0627\u0621 \u0644\u062c\u0644\u0628 \u0646\u0641\u0639\u064d \u0623\u0648 \u062f\u0641\u0639 \u0636\u0631\u0651\u064d\u060c \u0648\u064a\u0633\u064a\u0631 \u0627\u0644\u0631\u064a\u0627\u0621\u060c \u0643\u0623\u0646 \u064a\u062d\u0633\u0646 \u0635\u0644\u0627\u062a\u0647 \u0644\u0645\u0627 \u064a\u0631\u0649 \u0645\u0646 \u0646\u0638\u0631 \u0627\u0644\u0646\u0627\u0633 \u0625\u0644\u064a\u0647.                    ","\n                    \u062c- \u0644\u0627 \u064a\u0639\u0644\u0645 \u0627\u0644\u063a\u064a\u0628 \u0625\u0644\u0627 \u0627\u0644\u0644\u0647 \u0648\u062d\u062f\u0647.\n\u0642\u0627\u0644 \u062a\u064e\u0639\u064e\u0627\u0644\u064e\u0649: \ufd3f\u0642\u064f\u0644 \u0644\u0651\u064e\u0627 \u064a\u064e\u0639\u06e1\u0644\u064e\u0645\u064f \u0645\u064e\u0646 \u0641\u0650\u064a \u0671\u0644\u0633\u0651\u064e\u0645\u064e\u0640\u0648\u064e\u200a\u2060\u062a\u0650 \u0648\u064e\u0671\u0644\u06e1\u0623\u064e\u0631\u06e1\u0636\u0650 \u0671\u0644\u06e1\u063a\u064e\u064a\u06e1\u0628\u064e \u0625\u0650\u0644\u0651\u064e\u0627 \u0671\u0644\u0644\u0651\u064e\u0647\u064f\u06da \u0648\u064e\u0645\u064e\u0627 \u064a\u064e\u0634\u06e1\u0639\u064f\u0631\u064f\u0648\u0646\u064e \u0623\u064e\u064a\u0651\u064e\u0627\u0646\u064e \u064a\u064f\u0628\u06e1\u0639\u064e\u062b\u064f\u0648\u0646\u064e 65\ufd3e [\u0633\u0648\u0631\u0629 \u0627\u0644\u0646\u0645\u0644: 65].                    ","\n                    \u062c- 1- \u0627\u0644\u0625\u064a\u0645\u0627\u0646 \u0628\u0627\u0644\u0644\u0647 \u062a\u064e\u0639\u064e\u0627\u0644\u064e\u0649.\n2- \u0648\u0645\u0644\u0627\u0626\u0643\u062a\u0647.\n3- \u0648\u0643\u062a\u0628\u0647.\n4- \u0648\u0631\u0633\u0644\u0647.\n5- \u0648\u0627\u0644\u064a\u0648\u0645 \u0627\u0644\u0622\u062e\u0631.\n6- \u0648\u0627\u0644\u0642\u062f\u0631 \u062e\u064a\u0631\u0647 \u0648\u0634\u0631\u0647.\n\u0648\u0627\u0644\u062f\u0644\u064a\u0644: \u062d\u062f\u064a\u062b \u062c\u0628\u0631\u064a\u0644 \u0627\u0644\u0645\u0634\u0647\u0648\u0631 \u0639\u0646\u062f \u0645\u0633\u0644\u0645\u060c \u0642\u064e\u0627\u0644\u064e \u062c\u0628\u0631\u064a\u0644 \u0644\u0644\u0646\u0628\u064a \u0635\u064e\u0644\u0651\u064e\u0649\u0670 \u0627\u0644\u0644\u0647\u064f \u0639\u064e\u0644\u064e\u064a\u0652\u0647\u0650 \u0648\u064e\u0633\u064e\u0644\u0651\u064e\u0645\u064e: \xab\u0641\u064e\u0623\u064e\u062e\u0652\u0628\u0650\u0631\u0652\u0646\u0650\u064a \u0639\u064e\u0646\u0650 \u0627\u0644\u0652\u0625\u0650\u064a\u0645\u064e\u0627\u0646\u0650\u060c \u0642\u064e\u0627\u0644\u064e: \u0623\u064e\u0646\u0652 \u062a\u064f\u0624\u0652\u0645\u0650\u0646\u064e \u0628\u0650\u0627\u0644\u0644\u0647\u0650\u060c \u0648\u064e\u0645\u064e\u0644\u064e\u0627\u0626\u0650\u0643\u064e\u062a\u0650\u0647\u0650\u060c \u0648\u064e\u0643\u064f\u062a\u064f\u0628\u0650\u0647\u0650\u060c \u0648\u064e\u0631\u064f\u0633\u064f\u0644\u0650\u0647\u0650\u060c \u0648\u064e\u0627\u0644\u0652\u064a\u064e\u0648\u0652\u0645\u0650 \u0627\u0644\u0652\u0622\u062e\u0650\u0631\u0650\u060c \u0648\u064e\u062a\u064f\u0624\u0652\u0645\u0650\u0646\u064e \u0628\u0650\u0627\u0644\u0652\u0642\u064e\u062f\u064e\u0631\u0650 \u062e\u064e\u064a\u0652\u0631\u0650\u0647\u0650 \u0648\u064e\u0634\u064e\u0631\u0650\u0651\u0647\u0650\xbb.                    ","\n                    \u062c- \u0627\u0644\u0625\u064a\u0645\u0627\u0646 \u0628\u0627\u0644\u0644\u0647 \u062a\u064e\u0639\u064e\u0627\u0644\u064e\u0649:\n\xa7\xa0\xa0\xa0\xa0 \u0623\u0646 \u062a\u0624\u0645\u0646 \u0628\u0623\u0646 \u0627\u0644\u0644\u0647 \u0647\u0648 \u0627\u0644\u0630\u064a \u062e\u0644\u0642\u0643 \u0648\u0631\u0632\u0642\u0643\u060c \u0648\u0647\u0648 \u0627\u0644\u0645\u0627\u0644\u0643 \u0648\u0627\u0644\u0645\u062f\u0628\u0631 \u0648\u062d\u062f\u0647 \u0644\u0644\u0645\u062e\u0644\u0648\u0642\u0627\u062a.\n\xa7\xa0\xa0\xa0\xa0 \u0648\u0647\u0648 \u0627\u0644\u0645\u0639\u0628\u0648\u062f\u060c \u0644\u0627 \u0645\u0639\u0628\u0648\u062f \u0628\u062d\u0642\u0651\u064d \u0633\u0648\u0627\u0647.\n\xa7\xa0\xa0\xa0\xa0 \u0648\u0623\u0646\u0647 \u0627\u0644\u0639\u0638\u064a\u0645 \u0627\u0644\u0643\u0628\u064a\u0631 \u0627\u0644\u0643\u0627\u0645\u0644 \u0627\u0644\u0630\u064a \u0644\u0647 \u0627\u0644\u062d\u0645\u062f \u0643\u0644\u0647\u060c \u0648\u0644\u0647 \u0627\u0644\u0623\u0633\u0645\u0627\u0621 \u0627\u0644\u062d\u0633\u0646\u0649 \u0648\u0627\u0644\u0635\u0641\u0627\u062a \u0627\u0644\u0639\u064f\u0644\u0649\u060c \u0644\u064a\u0633 \u0644\u0647 \u0646\u062f\u060c \u0648\u0644\u0627 \u064a\u0634\u0628\u0647\u0647 \u0634\u064a\u0621 \u0633\u064f\u0628\u0652\u062d\u064e\u0627\u0646\u064e\u0647\u064f.\n\u0627\u0644\u0625\u064a\u0645\u0627\u0646 \u0628\u0627\u0644\u0645\u0644\u0627\u0626\u0643\u0629:\n\u0648\u0647\u064a \u0645\u062e\u0644\u0648\u0642\u0627\u062a \u062e\u0644\u0642\u0647\u0627 \u0627\u0644\u0644\u0647 \u0645\u0646 \u0646\u0648\u0631\u060c \u0648\u0644\u0639\u0628\u0627\u062f\u062a\u0647 \u0648\u0644\u0644\u0627\u0646\u0642\u064a\u0627\u062f \u0627\u0644\u062a\u0627\u0645 \u0644\u0623\u0645\u0631\u0647.\n- \u0648\u0645\u0646\u0647\u0645 \u062c\u0628\u0631\u064a\u0644 \u0639\u064e\u0644\u064e\u064a\u0652\u0647\u0650 \u0627\u0644\u0633\u0651\u064e\u0644\u064e\u0627\u0645\u064f \u0627\u0644\u0630\u064a \u064a\u0646\u0632\u0644 \u0628\u0627\u0644\u0648\u062d\u064a \u0639\u0644\u0649 \u0627\u0644\u0623\u0646\u0628\u064a\u0627\u0621.\n\u0627\u0644\u0625\u064a\u0645\u0627\u0646 \u0628\u0627\u0644\u0643\u062a\u0628:\n\u0648\u0647\u064a \u0627\u0644\u0643\u062a\u0628 \u0627\u0644\u062a\u064a \u0623\u0646\u0632\u0644\u0647\u0627 \u0627\u0644\u0644\u0647 \u0639\u0644\u0649 \u0631\u0633\u0644\u0647.\n- \u0643\u0627\u0644\u0642\u0631\u0622\u0646: \u0639\u0644\u0649 \u0645\u062d\u0645\u062f \ufdfa .\n- \u0627\u0644\u0625\u0646\u062c\u064a\u0644: \u0639\u0644\u0649 \u0639\u064a\u0633\u0649 \u0639\u064e\u0644\u064e\u064a\u0652\u0647\u0650 \u0627\u0644\u0633\u0651\u064e\u0644\u064e\u0627\u0645\u064f.\n- \u0627\u0644\u062a\u0648\u0631\u0627\u0629: \u0639\u0644\u0649 \u0645\u0648\u0633\u0649 \u0639\u064e\u0644\u064e\u064a\u0652\u0647\u0650 \u0627\u0644\u0633\u0651\u064e\u0644\u064e\u0627\u0645\u064f.\n- \u0627\u0644\u0632\u0628\u0648\u0631: \u0639\u0644\u0649 \u062f\u0627\u0648\u062f \u0639\u064e\u0644\u064e\u064a\u0652\u0647\u0650 \u0627\u0644\u0633\u0651\u064e\u0644\u064e\u0627\u0645\u064f.\n- \u0635\u062d\u0641 \u0625\u0628\u0631\u0627\u0647\u064a\u0645 \u0648\u0645\u0648\u0633\u0649: \u0639\u0644\u0649 \u0625\u0628\u0631\u0627\u0647\u064a\u0645 \u0648\u0645\u0648\u0633\u0649.\n\u0627\u0644\u0625\u064a\u0645\u0627\u0646 \u0628\u0627\u0644\u0631\u0633\u0644:\n\u0648\u0647\u0645 \u0645\u0646 \u0623\u0631\u0633\u0644\u0647\u0645 \u0627\u0644\u0644\u0647 \u0625\u0644\u0649 \u0639\u0628\u0627\u062f\u0647 \u0644\u064a\u0639\u0644\u0645\u0648\u0647\u0645\u060c \u0648\u064a\u0628\u0634\u0631\u0648\u0647\u0645 \u0628\u0627\u0644\u062e\u064a\u0631 \u0648\u0627\u0644\u062c\u0646\u0629\u060c \u0648\u064a\u0646\u0630\u0631\u0648\u0647\u0645 \u0639\u0646 \u0627\u0644\u0634\u0631 \u0648\u0627\u0644\u0646\u0627\u0631.\n- \u0648\u0623\u0641\u0636\u0644\u0647\u0645: \u0623\u0648\u0644\u0648 \u0627\u0644\u0639\u0632\u0645\u060c \u0648\u0647\u0645:\n\u0646\u0648\u062d \u0639\u064e\u0644\u064e\u064a\u0652\u0647\u0650 \u0627\u0644\u0633\u0651\u064e\u0644\u064e\u0627\u0645\u064f.\n\u0625\u0628\u0631\u0627\u0647\u064a\u0645 \u0639\u064e\u0644\u064e\u064a\u0652\u0647\u0650 \u0627\u0644\u0633\u0651\u064e\u0644\u064e\u0627\u0645\u064f.\n\u0645\u0648\u0633\u0649 \u0639\u064e\u0644\u064e\u064a\u0652\u0647\u0650 \u0627\u0644\u0633\u0651\u064e\u0644\u064e\u0627\u0645\u064f.\n\u0639\u064a\u0633\u0649 \u0639\u064e\u0644\u064e\u064a\u0652\u0647\u0650 \u0627\u0644\u0633\u0651\u064e\u0644\u064e\u0627\u0645\u064f.\n\u0645\u062d\u0645\u062f \ufdfa .\n\u0627\u0644\u0625\u064a\u0645\u0627\u0646 \u0628\u0627\u0644\u064a\u0648\u0645 \u0627\u0644\u0622\u062e\u0631:\n\u0648\u0647\u0648 \u0645\u0627 \u0628\u0639\u062f \u0627\u0644\u0645\u0648\u062a \u0641\u064a \u0627\u0644\u0642\u0628\u0631\u060c \u0648\u064a\u0648\u0645 \u0627\u0644\u0642\u064a\u0627\u0645\u0629\u060c \u0648\u064a\u0648\u0645 \u0627\u0644\u0628\u0639\u062b \u0648\u0627\u0644\u062d\u0633\u0627\u0628\u060c \u062d\u064a\u062b \u064a\u0633\u062a\u0642\u0631 \u0623\u0647\u0644 \u0627\u0644\u062c\u0646\u0629 \u0641\u064a \u0645\u0646\u0627\u0632\u0644\u0647\u0645 \u0648\u0623\u0647\u0644 \u0627\u0644\u0646\u0627\u0631 \u0641\u064a \u0645\u0646\u0627\u0632\u0644\u0647\u0645.\n\u0627\u0644\u0625\u064a\u0645\u0627\u0646 \u0628\u0627\u0644\u0642\u062f\u0631 \u062e\u064a\u0631\u0647 \u0648\u0634\u0631\u0647:\n\u0627\u0644\u0642\u062f\u0631: \u0647\u0648 \u0627\u0644\u0627\u0639\u062a\u0642\u0627\u062f \u0628\u0623\u0646 \u0627\u0644\u0644\u0647 \u064a\u0639\u0644\u0645 \u0643\u0644 \u0634\u064a\u0621 \u064a\u0642\u0639 \u0641\u064a \u0627\u0644\u0643\u0648\u0646\u060c \u0648\u0623\u0646\u0647 \u0643\u062a\u0628 \u0630\u0644\u0643 \u0641\u064a \u0627\u0644\u0644\u0648\u062d \u0627\u0644\u0645\u062d\u0641\u0648\u0638\u060c \u0648\u0634\u0627\u0621 \u0648\u062c\u0648\u062f\u0647 \u0648\u062e\u0644\u0642\u0647.\n\u0642\u0627\u0644 \u062a\u064e\u0639\u064e\u0627\u0644\u064e\u0649: \ufd3f\u0625\u0650\u0646\u0651\u064e\u0627 \u0643\u064f\u0644\u0651\u064e \u0634\u064e\u064a\u0652\u0621\u064d \u062e\u064e\u0644\u064e\u0642\u06e1\u0646\u064e\u0640\u0670\u0647\u064f \u0628\u0650\u0642\u064e\u062f\u064e\u0631 49\ufd3e [\u0633\u0648\u0631\u0629 \u0627\u0644\u0642\u0645\u0631 \u0664\u0669].\n- \u0648\u0647\u0648 \u0639\u0644\u0649 \u0623\u0631\u0628\u0639 \u0645\u0631\u0627\u062a\u0628:\n\u0627\u0644\u0623\u0648\u0644\u0649: \u0639\u0644\u0645 \u0627\u0644\u0644\u0647 \u062a\u064e\u0639\u064e\u0627\u0644\u064e\u0649\u060c \u0648\u0645\u0646 \u0630\u0644\u0643 \u0639\u0644\u0645\u0647 \u0627\u0644\u0645\u0633\u0628\u0642 \u0644\u0643\u0644 \u0634\u064a\u0621\u060c \u0642\u0628\u0644 \u0648\u0642\u0648\u0639 \u0627\u0644\u0623\u0634\u064a\u0627\u0621 \u0648\u0628\u0639\u062f \u0648\u0642\u0648\u0639\u0647\u0627.\n\u062f\u0644\u064a\u0644\u0647\u0627: \u0642\u0648\u0644\u0647 \u062a\u064e\u0639\u064e\u0627\u0644\u064e\u0649: \ufd3f\u0625\u0650\u0646\u0651\u064e \u0627\u0644\u0644\u0651\u064e\u0647\u064e \u0639\u0650\u0646\u0652\u062f\u064e\u0647\u064f \u0639\u0650\u0644\u0652\u0645\u064f \u0627\u0644\u0633\u0651\u064e\u0627\u0639\u064e\u0629\u0650 \u0648\u064e\u064a\u064f\u0646\u064e\u0632\u0651\u0650\u0644\u064f \u0627\u0644\u0652\u063a\u064e\u064a\u0652\u062b\u064e \u0648\u064e\u064a\u064e\u0639\u0652\u0644\u064e\u0645\u064f \u0645\u064e\u0627 \u0641\u0650\u064a \u0627\u0644\u0652\u0623\u064e\u0631\u0652\u062d\u064e\u0627\u0645\u0650 \u0648\u064e\u0645\u064e\u0627 \u062a\u064e\u062f\u0652\u0631\u0650\u064a \u0646\u064e\u0641\u0652\u0633\u064c \u0645\u064e\u0627\u0630\u064e\u0627 \u062a\u064e\u0643\u0652\u0633\u0650\u0628\u064f \u063a\u064e\u062f\u064b\u0627 \u0648\u064e\u0645\u064e\u0627 \u062a\u064e\u062f\u0652\u0631\u0650\u064a \u0646\u064e\u0641\u0652\u0633\u064c \u0628\u0650\u0623\u064e\u064a\u0651\u0650 \u0623\u064e\u0631\u0652\u0636\u064d \u062a\u064e\u0645\u064f\u0648\u062a\u064f \u0625\u0650\u0646\u0651\u064e \u0627\u0644\u0644\u0651\u064e\u0647\u064e \u0639\u064e\u0644\u0650\u064a\u0645\u064c \u062e\u064e\u0628\u0650\u064a\u0631\u064c 34\ufd3e [\u0633\u0648\u0631\u0629 \u0644\u0642\u0645\u0627\u0646: 34].\n\u0627\u0644\u062b\u0627\u0646\u064a\u0629: \u0623\u0646 \u0627\u0644\u0644\u0647 \u0643\u062a\u0628 \u0630\u0644\u0643 \u0641\u064a \u0627\u0644\u0644\u0648\u062d \u0627\u0644\u0645\u062d\u0641\u0648\u0638\u060c \u0641\u0643\u0644 \u0634\u064a\u0621 \u0648\u0642\u0639 \u0648\u0633\u064a\u0642\u0639 \u0641\u0647\u0648 \u0645\u0643\u062a\u0648\u0628 \u0639\u0646\u062f\u0647 \u0641\u064a \u0643\u062a\u0627\u0628.\n\u062f\u0644\u064a\u0644\u0647\u0627: \u0642\u0648\u0644\u0647 \u062a\u064e\u0639\u064e\u0627\u0644\u064e\u0649: \ufd3f\u0648\u064e\u0639\u0650\u0646\u0652\u062f\u064e\u0647\u064f \u0645\u064e\u0641\u064e\u0627\u062a\u0650\u062d\u064f \u0627\u0644\u0652\u063a\u064e\u064a\u0652\u0628\u0650 \u0644\u064e\u0627 \u064a\u064e\u0639\u0652\u0644\u064e\u0645\u064f\u0647\u064e\u0627 \u0625\u0650\u0644\u0651\u064e\u0627 \u0647\u064f\u0648\u064e \u0648\u064e\u064a\u064e\u0639\u0652\u0644\u064e\u0645\u064f \u0645\u064e\u0627 \u0641\u0650\u064a \u0627\u0644\u0652\u0628\u064e\u0631\u0651\u0650 \u0648\u064e\u0627\u0644\u0652\u0628\u064e\u062d\u0652\u0631\u0650 \u0648\u064e\u0645\u064e\u0627 \u062a\u064e\u0633\u0652\u0642\u064f\u0637\u064f \u0645\u0650\u0646\u0652 \u0648\u064e\u0631\u064e\u0642\u064e\u0629\u064d \u0625\u0650\u0644\u0651\u064e\u0627 \u064a\u064e\u0639\u0652\u0644\u064e\u0645\u064f\u0647\u064e\u0627 \u0648\u064e\u0644\u064e\u0627 \u062d\u064e\u0628\u0651\u064e\u0629\u064d \u0641\u0650\u064a \u0638\u064f\u0644\u064f\u0645\u064e\u0627\u062a\u0650 \u0627\u0644\u0652\u0623\u064e\u0631\u0652\u0636\u0650 \u0648\u064e\u0644\u064e\u0627 \u0631\u064e\u0637\u0652\u0628\u064d \u0648\u064e\u0644\u064e\u0627 \u064a\u064e\u0627\u0628\u0650\u0633\u064d \u0625\u0650\u0644\u0651\u064e\u0627 \u0641\u0650\u064a \u0643\u0650\u062a\u064e\u0627\u0628\u064d \u0645\u064f\u0628\u0650\u064a\u0646\u064d 59\ufd3e [\u0633\u0648\u0631\u0629 \u0627\u0644\u0623\u0646\u0639\u0627\u0645: 59].\n\u0627\u0644\u062b\u0627\u0644\u062b\u0629: \u0648\u0647\u0648 \u0623\u0646 \u0643\u0644 \u0634\u064a\u0621 \u064a\u0642\u0639 \u0628\u0645\u0634\u064a\u0626\u0629 \u0627\u0644\u0644\u0647 \u0648\u0644\u0627 \u064a\u0642\u0639 \u0634\u064a\u0621 \u0645\u0646\u0647 \u0623\u0648 \u0645\u0646 \u062e\u0644\u0642\u0647 \u0625\u0644\u0627 \u0628\u0645\u0634\u064a\u0626\u062a\u0647 \u062a\u064e\u0639\u064e\u0627\u0644\u064e\u0649.\n\u062f\u0644\u064a\u0644\u0647\u0627: \u0642\u0648\u0644\u0647 \u062a\u064e\u0639\u064e\u0627\u0644\u064e\u0649: \ufd3f\u0644\u0650\u0645\u064e\u0646\u0652 \u0634\u064e\u0627\u0621\u064e \u0645\u0650\u0646\u0652\u0643\u064f\u0645\u0652 \u0623\u064e\u0646\u0652 \u064a\u064e\u0633\u0652\u062a\u064e\u0642\u0650\u064a\u0645\u064e 28 \u0648\u064e\u0645\u064e\u0627 \u062a\u064e\u0634\u064e\u0627\u0621\u064f\u0648\u0646\u064e \u0625\u0650\u0644\u0651\u064e\u0627 \u0623\u064e\u0646\u0652 \u064a\u064e\u0634\u064e\u0627\u0621\u064e \u0627\u0644\u0644\u0651\u064e\u0647\u064f \u0631\u064e\u0628\u0651\u064f \u0627\u0644\u0652\u0639\u064e\u0627\u0644\u064e\u0645\u0650\u064a\u0646\u064e 29\ufd3e [\u0633\u0648\u0631\u0629 \u0627\u0644\u062a\u0643\u0648\u064a\u0631: 28\u060c 29].\n\u0627\u0644\u0631\u0627\u0628\u0639\u0629: \u0627\u0644\u0625\u064a\u0645\u0627\u0646 \u0623\u0646 \u062c\u0645\u064a\u0639 \u0627\u0644\u0643\u0627\u0626\u0646\u0627\u062a \u0645\u062e\u0644\u0648\u0642\u0629 \u062e\u0644\u0642\u0647\u0627 \u0627\u0644\u0644\u0647\u060c \u0648\u062e\u0644\u0642 \u0630\u0648\u0627\u062a\u0647\u0627 \u0648\u0635\u0641\u0627\u062a\u0647\u0627 \u0648\u062d\u0631\u0643\u0627\u062a\u0647\u0627\u060c \u0648\u0643\u0644 \u0634\u064a\u0621 \u0641\u064a\u0647\u0627.\n\u062f\u0644\u064a\u0644\u0647\u0627: \u0642\u0648\u0644\u0647 \u062a\u064e\u0639\u064e\u0627\u0644\u064e\u0649: \ufd3f\u0648\u064e\u0627\u0644\u0644\u0651\u064e\u0647\u064f \u062e\u064e\u0644\u064e\u0642\u064e\u0643\u064f\u0645\u0652 \u0648\u064e\u0645\u064e\u0627 \u062a\u064e\u0639\u0652\u0645\u064e\u0644\u064f\u0648\u0646\u064e 96\ufd3e [\u0633\u0648\u0631\u0629 \u0627\u0644\u0635\u0627\u0641\u0627\u062a: 96].                    ","\n                    \u062c- \u0647\u0648 \u0643\u0644\u0627\u0645 \u0627\u0644\u0644\u0647 \u062a\u064e\u0639\u064e\u0627\u0644\u064e\u0649\u060c \u0644\u064a\u0633 \u0628\u0645\u062e\u0644\u0648\u0642.\n\u0642\u0627\u0644 \u062a\u064e\u0639\u064e\u0627\u0644\u064e\u0649: \ufd3f\u0648\u064e\u0625\u0650\u0646\u0652 \u0623\u064e\u062d\u064e\u062f\u064c \u0645\u0650\u0646\u064e \u0627\u0644\u0652\u0645\u064f\u0634\u0652\u0631\u0650\u0643\u0650\u064a\u0646\u064e \u0627\u0633\u0652\u062a\u064e\u062c\u064e\u0627\u0631\u064e\u0643\u064e \u0641\u064e\u0623\u064e\u062c\u0650\u0631\u0652\u0647\u064f \u062d\u064e\u062a\u0651\u064e\u0649 \u064a\u064e\u0633\u0652\u0645\u064e\u0639\u064e \u0643\u064e\u0644\u064e\u0627\u0645\u064e \u0627\u0644\u0644\u0651\u064e\u0647\u0650 ...\ufd3e [\u0633\u0648\u0631\u0629 \u0627\u0644\u062a\u0648\u0628\u0629: 6].                    ","\n                    \u062c- \u0647\u064a \u0643\u0644 \u0642\u0648\u0644 \u0623\u0648 \u0641\u0639\u0644 \u0623\u0648 \u062a\u0642\u0631\u064a\u0631 \u0623\u0648 \u0635\u0641\u0629 \u062e\u064e\u0644\u0642\u064a\u0629\u060c \u0623\u0648 \u062e\u064f\u0644\u0642\u064a\u0629 \u0644\u0644\u0646\u0628\u064a \ufdfa .                    ","\n                    \u062c- \u0643\u0644 \u0645\u0627 \u0623\u062d\u062f\u062b\u0647 \u0627\u0644\u0646\u0627\u0633 \u0641\u064a \u0627\u0644\u062f\u064a\u0646\u060c \u0648\u0644\u0645 \u064a\u0643\u0646 \u0639\u0644\u0649 \u0639\u0647\u062f \u0627\u0644\u0646\u0628\u064a \ufdfa \u0648\u0623\u0635\u062d\u0627\u0628\u0647.\n* \u0644\u0627 \u0646\u0642\u0628\u0644\u0647\u0627 \u0648\u0646\u0631\u062f\u0647\u0627.\n\u0644\u0642\u0648\u0644 \u0627\u0644\u0646\u0628\u064a \u0639\u064e\u0644\u064e\u064a\u0652\u0647\u0650 \u0627\u0644\u0635\u0651\u064e\u0644\u064e\u0627\u0629\u064f \u0648\u064e\u0627\u0644\u0633\u0651\u064e\u0644\u064e\u0627\u0645\u064f: \xab\u0643\u0644 \u0628\u062f\u0639\u0629 \u0636\u0644\u0627\u0644\u0629\xbb \u0631\u0648\u0627\u0647 \u0623\u0628\u0648 \u062f\u0627\u0648\u062f.\n\u0645\u062b\u0627\u0644\u0647\u0627: \u0627\u0644\u0632\u064a\u0627\u062f\u0629 \u0641\u064a \u0627\u0644\u0639\u0628\u0627\u062f\u0629\u060c \u0643\u0627\u0644\u0632\u064a\u0627\u062f\u0629 \u0639\u0644\u0649 \u0627\u0644\u0648\u0636\u0648\u0621 \u063a\u0633\u0644\u0629 \u0631\u0627\u0628\u0639\u0629\u060c \u0648\u0643\u0627\u0644\u0627\u062d\u062a\u0641\u0627\u0644 \u0628\u0627\u0644\u0645\u0648\u0644\u062f \u0627\u0644\u0646\u0628\u0648\u064a\u060c \u0641\u0644\u0645 \u064a\u0631\u062f \u0639\u0646 \u0627\u0644\u0646\u0628\u064a \ufdfa \u0648\u0623\u0635\u062d\u0627\u0628\u0647.                    ","\n                    \u062c- \u0627\u0644\u0648\u0644\u0627\u0621: \u0647\u0648 \u0645\u062d\u0628\u0629 \u0627\u0644\u0645\u0624\u0645\u0646\u064a\u0646 \u0648\u0646\u0635\u0631\u062a\u0647\u0645.\n\u0642\u0627\u0644 \u062a\u064e\u0639\u064e\u0627\u0644\u064e\u0649: \ufd3f\u0648\u064e\u0627\u0644\u0652\u0645\u064f\u0624\u0652\u0645\u0650\u0646\u064f\u0648\u0646\u064e \u0648\u064e\u0627\u0644\u0652\u0645\u064f\u0624\u0652\u0645\u0650\u0646\u064e\u0627\u062a\u064f \u0628\u064e\u0639\u0652\u0636\u064f\u0647\u064f\u0645\u0652 \u0623\u064e\u0648\u0652\u0644\u0650\u064a\u064e\u0627\u0621\u064f \u0628\u064e\u0639\u0652\u0636\u064d ...\ufd3e [\u0633\u0648\u0631\u0629 \u0627\u0644\u062a\u0648\u0628\u0629: 71].\n\u0627\u0644\u0628\u0631\u0627\u0621: \u0647\u0648 \u0628\u063a\u0636 \u0627\u0644\u0643\u0627\u0641\u0631\u064a\u0646 \u0648\u0645\u0639\u0627\u062f\u0627\u062a\u0647\u0645.\n\u0642\u0627\u0644 \u062a\u064e\u0639\u064e\u0627\u0644\u064e\u0649: \ufd3f\u0642\u064e\u062f\u0652 \u0643\u064e\u0627\u0646\u064e\u062a\u0652 \u0644\u064e\u0643\u064f\u0645\u0652 \u0623\u064f\u0633\u0652\u0648\u064e\u0629\u064c \u062d\u064e\u0633\u064e\u0646\u064e\u0629\u064c \u0641\u0650\u064a \u0625\u0650\u0628\u0652\u0631\u064e\u0627\u0647\u0650\u064a\u0645\u064e \u0648\u064e\u0627\u0644\u0651\u064e\u0630\u0650\u064a\u0646\u064e \u0645\u064e\u0639\u064e\u0647\u064f \u0625\u0650\u0630\u0652 \u0642\u064e\u0627\u0644\u064f\u0648\u0627 \u0644\u0650\u0642\u064e\u0648\u0652\u0645\u0650\u0647\u0650\u0645\u0652 \u0625\u0650\u0646\u0651\u064e\u0627 \u0628\u064f\u0631\u064e\u0622\u0621\u064f \u0645\u0650\u0646\u0652\u0643\u064f\u0645\u0652 \u0648\u064e\u0645\u0650\u0645\u0651\u064e\u0627 \u062a\u064e\u0639\u0652\u0628\u064f\u062f\u064f\u0648\u0646\u064e \u0645\u0650\u0646\u0652 \u062f\u064f\u0648\u0646\u0650 \u0627\u0644\u0644\u0651\u064e\u0647\u0650 \u0643\u064e\u0641\u064e\u0631\u0652\u0646\u064e\u0627 \u0628\u0650\u0643\u064f\u0645\u0652 \u0648\u064e\u0628\u064e\u062f\u064e\u0627 \u0628\u064e\u064a\u0652\u0646\u064e\u0646\u064e\u0627 \u0648\u064e\u0628\u064e\u064a\u0652\u0646\u064e\u0643\u064f\u0645\u064f \u0627\u0644\u0652\u0639\u064e\u062f\u064e\u0627\u0648\u064e\u0629\u064f \u0648\u064e\u0627\u0644\u0652\u0628\u064e\u063a\u0652\u0636\u064e\u0627\u0621\u064f \u0623\u064e\u0628\u064e\u062f\u064b\u0627 \u062d\u064e\u062a\u0651\u064e\u0649 \u062a\u064f\u0624\u0652\u0645\u0650\u0646\u064f\u0648\u0627 \u0628\u0650\u0627\u0644\u0644\u0651\u064e\u0647\u0650 \u0648\u064e\u062d\u0652\u062f\u064e\u0647\u064f\ufd3e [\u0633\u0648\u0631\u0629 \u0627\u0644\u0645\u0645\u062a\u062d\u0646\u0629: 4].                    ","\n                    \u062c- \u0644\u0627 \u064a\u0642\u0628\u0644 \u0627\u0644\u0644\u0647 \u063a\u064a\u0631 \u0627\u0644\u0625\u0633\u0644\u0627\u0645.\n\u0642\u0627\u0644 \u062a\u064e\u0639\u064e\u0627\u0644\u064e\u0649: \ufd3f\u0648\u064e\u0645\u064e\u0646 \u064a\u064e\u0628\u06e1\u062a\u064e\u063a\u0650 \u063a\u064e\u064a\u06e1\u0631\u064e \u0671\u0644\u06e1\u0625\u0650\u0633\u06e1\u0644\u064e\u0670\u0645\u0650 \u062f\u0650\u064a\u0646\u0657\u0627 \u0641\u064e\u0644\u064e\u0646 \u064a\u064f\u0642\u06e1\u0628\u064e\u0644\u064e \u0645\u0650\u0646\u06e1\u0647\u064f \u0648\u064e\u0647\u064f\u0648\u064e \u0641\u0650\u064a \u0671\u0644\u06e1\u0623\u0653\u062e\u0650\u0631\u064e\u0629\u0650 \u0645\u0650\u0646\u064e \u0671\u0644\u06e1\u062e\u064e\u0670\u0633\u0650\u0631\u0650\u064a\u0646\u064e 85\ufd3e [\u0633\u0648\u0631\u0629 \u0622\u0644 \u0639\u0645\u0631\u0627\u0646 \u0668\u0665].                    ","\n                    \u062c- \u0645\u062b\u0627\u0644 \u0627\u0644\u0642\u0648\u0644: \u0633\u0628 \u0627\u0644\u0644\u0647 \u0633\u064f\u0628\u0652\u062d\u064e\u0627\u0646\u064e\u0647\u064f \u0623\u0648 \u0631\u0633\u0648\u0644\u0647 \ufdfa .\n\u0645\u062b\u0627\u0644 \u0627\u0644\u0639\u0645\u0644: \u0625\u0647\u0627\u0646\u0629 \u0627\u0644\u0645\u0635\u062d\u0641 \u0623\u0648 \u0627\u0644\u0633\u062c\u0648\u062f \u0644\u063a\u064a\u0631 \u0627\u0644\u0644\u0647 \u062a\u064e\u0639\u064e\u0627\u0644\u064e\u0649.\n\u0645\u062b\u0627\u0644 \u0627\u0644\u0627\u0639\u062a\u0642\u0627\u062f: \u0627\u0644\u0627\u0639\u062a\u0642\u0627\u062f \u0623\u0646 \u0647\u0646\u0627\u0643 \u0645\u0646 \u064a\u0633\u062a\u062d\u0642 \u0627\u0644\u0639\u0628\u0627\u062f\u0629 \u063a\u064a\u0631 \u0627\u0644\u0644\u0647 \u062a\u064e\u0639\u064e\u0627\u0644\u064e\u0649 \u0623\u0648 \u0623\u0646 \u0647\u0646\u0627\u0643 \u062e\u0627\u0644\u0642 \u0645\u0639 \u0627\u0644\u0644\u0647 \u062a\u064e\u0639\u064e\u0627\u0644\u064e\u0649.                    ","\n                    \u062c-\n\u0661- \u0627\u0644\u0646\u0641\u0627\u0642 \u0627\u0644\u0623\u0643\u0628\u0631: \u0648\u0647\u0648 \u0625\u0628\u0637\u0627\u0646 \u0627\u0644\u0643\u0641\u0631 \u0648\u0625\u0638\u0647\u0627\u0631 \u0627\u0644\u0625\u064a\u0645\u0627\u0646.\n\u0648\u064a\u064f\u062e\u0631\u062c \u0645\u0646 \u0627\u0644\u0625\u0633\u0644\u0627\u0645 \u0648\u0647\u0648 \u0645\u0646 \u0627\u0644\u0643\u0641\u0631 \u0627\u0644\u0623\u0643\u0628\u0631.\n\u0642\u0627\u0644 \u062a\u064e\u0639\u064e\u0627\u0644\u064e\u0649: \ufd3f\u0625\u0650\u0646\u0651\u064e \u0671\u0644\u06e1\u0645\u064f\u0646\u064e\u0670\u0641\u0650\u0642\u0650\u064a\u0646\u064e \u0641\u0650\u064a \u0671\u0644\u062f\u0651\u064e\u0631\u06e1\u0643\u0650 \u0671\u0644\u06e1\u0623\u064e\u0633\u06e1\u0641\u064e\u0644\u0650 \u0645\u0650\u0646\u064e \u0671\u0644\u0646\u0651\u064e\u0627\u0631\u0650 \u0648\u064e\u0644\u064e\u0646 \u062a\u064e\u062c\u0650\u062f\u064e \u0644\u064e\u0647\u064f\u0645\u06e1 \u0646\u064e\u0635\u0650\u064a\u0631\u064b\u0627 145\ufd3e [\u0633\u0648\u0631\u0629 \u0627\u0644\u0646\u0633\u0627\u0621 \u0661\u0664\u0665].\n\u0662- \u0627\u0644\u0646\u0641\u0627\u0642 \u0627\u0644\u0623\u0635\u063a\u0631:\n\u0645\u062b\u0644: \u0627\u0644\u0643\u0630\u0628 \u0648\u0625\u062e\u0644\u0627\u0641 \u0627\u0644\u0648\u0639\u062f \u0648\u062e\u064a\u0627\u0646\u0629 \u0627\u0644\u0623\u0645\u0627\u0646\u0629.\n\u0648\u0644\u0627 \u064a\u064f\u062e\u0631\u062c \u0645\u0646 \u0627\u0644\u0625\u0633\u0644\u0627\u0645\u060c \u0648\u0647\u0648 \u0645\u0646 \u0627\u0644\u0630\u0646\u0648\u0628 \u0648\u0635\u0627\u062d\u0628\u0647 \u0645\u0639\u0631\u0636 \u0644\u0644\u0639\u0630\u0627\u0628.\n- \u0642\u0627\u0644 \u0631\u0633\u0648\u0644 \u0627\u0644\u0644\u0647 \ufdfa : \xab\u0622\u064a\u0629 \u0627\u0644\u0645\u0646\u0627\u0641\u0642 \u062b\u0644\u0627\u062b: \u0625\u0630\u0627 \u062d\u062f\u062b \u0643\u0630\u0628\u060c \u0648\u0625\u0630\u0627 \u0648\u0639\u062f \u0623\u062e\u0644\u0641\u060c \u0648\u0625\u0630\u0627 \u0627\u0624\u062a\u0645\u0646 \u062e\u0627\u0646\xbb \u0631\u0648\u0627\u0647 \u0627\u0644\u0628\u062e\u0627\u0631\u064a \u0648\u0645\u0633\u0644\u0645.                    ","\n                    \u062c- \u0647\u0648 \u0645\u062d\u0645\u062f \ufdfa .\n\u0642\u0627\u0644 \u062a\u064e\u0639\u064e\u0627\u0644\u064e\u0649: \ufd3f\u0645\u0651\u064e\u0627 \u0643\u064e\u0627\u0646\u064e \u0645\u064f\u062d\u064e\u0645\u0651\u064e\u062f\u064c \u0623\u064e\u0628\u064e\u0627 \u0623\u064e\u062d\u064e\u062f \u0645\u0651\u0650\u0646 \u0631\u0651\u0650\u062c\u064e\u0627\u0644\u0650\u0643\u064f\u0645 \u0648\u064e\u0644\u064e\u0640\u0670\u0643\u0650\u0646 \u0631\u0651\u064e\u0633\u064f\u0648\u0644\u064e \u0671\u0644\u0644\u0651\u064e\u0647\u0650 \u0648\u064e\u062e\u064e\u0627\u062a\u064e\u0645\u064e \u0627\u0644\u0646\u0651\u064e\u0628\u0650\u064a\u0651\u0650\u064a\u0646\u064e\u06d7...\ufd3e [\u0633\u0648\u0631\u0629 \u0627\u0644\u0623\u062d\u0632\u0627\u0628 \u0664\u0660]. - \u0648\u0642\u0627\u0644 \u0631\u0633\u0648\u0644 \u0627\u0644\u0644\u0647 \ufdfa : \xab\u0648\u0623\u0646\u0627 \u062e\u0627\u062a\u0645 \u0627\u0644\u0646\u0628\u064a\u064a\u0646 \u0644\u0627 \u0646\u0628\u064a \u0628\u0639\u062f\u064a\xbb \u0631\u0648\u0627\u0647 \u0623\u0628\u0648 \u062f\u0627\u0648\u062f \u0648\u0627\u0644\u062a\u0631\u0645\u0630\u064a \u0648\u063a\u064a\u0631\u0647\u0645.                    ","\n                    \u062c- \u0627\u0644\u0645\u0639\u062c\u0632\u0629: \u0647\u064a \u0643\u0644 \u0645\u0627 \u0623\u0639\u0637\u0627\u0647 \u0627\u0644\u0644\u0647 \u0644\u0623\u0646\u0628\u064a\u0627\u0626\u0647 \u0645\u0646 \u062e\u0648\u0627\u0631\u0642 \u0627\u0644\u0639\u0627\u062f\u0627\u062a \u0644\u0644\u062f\u0644\u0627\u0644\u0629 \u0639\u0644\u0649 \u0635\u062f\u0642\u0647\u0645\u060c \u0645\u062b\u0644:\n- \u0634\u0642 \u0627\u0644\u0642\u0645\u0631 \u0644\u0644\u0646\u0628\u064a \ufdfa .\n- \u0648\u0634\u0642 \u0627\u0644\u0628\u062d\u0631 \u0644\u0645\u0648\u0633\u0649 \u0639\u064e\u0644\u064e\u064a\u0652\u0647\u0650 \u0627\u0644\u0633\u0651\u064e\u0644\u064e\u0627\u0645\u064f\u060c \u0648\u0625\u063a\u0631\u0627\u0642 \u0641\u0631\u0639\u0648\u0646 \u0648\u062c\u0646\u0648\u062f\u0647.                    ","\n                    \u062c- \u0627\u0644\u0635\u062d\u0627\u0628\u064a: \u0647\u0648 \u0645\u0646 \u0644\u0642\u064a \u0627\u0644\u0646\u0628\u064a \ufdfa \u0645\u0624\u0645\u0646\u064b\u0627 \u0628\u0647 \u0648\u0645\u0627\u062a \u0639\u0644\u0649 \u0627\u0644\u0625\u0633\u0644\u0627\u0645.\n- \u0646\u062d\u0628\u0647\u0645 \u0648\u0646\u0642\u062a\u062f\u064a \u0628\u0647\u0645\u060c \u0648\u0647\u0645 \u062e\u064a\u0631 \u0648\u0623\u0641\u0636\u0644 \u0627\u0644\u0646\u0627\u0633 \u0628\u0639\u062f \u0627\u0644\u0623\u0646\u0628\u064a\u0627\u0621.\n\u0648\u0623\u0641\u0636\u0644\u0647\u0645: \u0627\u0644\u062e\u0644\u0641\u0627\u0621 \u0627\u0644\u0623\u0631\u0628\u0639\u0629:\n\u0623\u0628\u0648 \u0628\u0643\u0631 \u0631\u064e\u0636\u0650\u064a\u064e \u0627\u0644\u0644\u0651\u064e\u0647\u064f \u0639\u064e\u0646\u0652\u0647\u064f.\n\u0639\u0645\u0631 \u0631\u064e\u0636\u0650\u064a\u064e \u0627\u0644\u0644\u0651\u064e\u0647\u064f \u0639\u064e\u0646\u0652\u0647\u064f.\n\u0639\u062b\u0645\u0627\u0646 \u0631\u064e\u0636\u0650\u064a\u064e \u0627\u0644\u0644\u0651\u064e\u0647\u064f \u0639\u064e\u0646\u0652\u0647\u064f.\n\u0639\u0644\u064a \u0631\u064e\u0636\u0650\u064a\u064e \u0627\u0644\u0644\u0651\u064e\u0647\u064f \u0639\u064e\u0646\u0652\u0647\u064f.                    ","\n                    \u062c- \u0647\u0646 \u0632\u0648\u062c\u0627\u062a \u0627\u0644\u0646\u0628\u064a \ufdfa .\n\u0642\u0627\u0644 \u062a\u064e\u0639\u064e\u0627\u0644\u064e\u0649: \ufd3f\u0671\u0644\u0646\u0651\u064e\u0628\u0650\u064a\u0651\u064f \u0623\u064e\u0648\u06e1\u0644\u064e\u0649 \u0628\u0650\u0671\u0644\u06e1\u0645\u064f\u0624\u06e1\u0645\u0650\u0646\u0650\u064a\u0646\u064e \u0645\u0650\u0646\u06e1 \u0623\u064e\u0646\u0641\u064f\u0633\u0650\u0647\u0650\u0645\u06e1\u06d6 \u0648\u064e\u0623\u064e\u0632\u06e1\u0648\u064e\u062c\u064f\u0647\u064f\u06e5\u0653 \u0623\u064f\u0645\u0651\u064e\u0647\u064e\u062a\u064f\u0647\u064f\u0645\u06e1\u06d7\ufd3e [\u0633\u0648\u0631\u0629 \u0627\u0644\u0623\u062d\u0632\u0627\u0628: \u0666 ].                    ","\n                    \u062c- \u0646\u062d\u0628\u0647\u0645 \u0648\u0646\u062a\u0648\u0644\u0627\u0647\u0645 \u0648\u0646\u0628\u063a\u0636 \u0645\u0646 \u064a\u0628\u063a\u0636\u0647\u0645 \u0648\u0644\u0627 \u0646\u063a\u0644\u0648 \u0641\u064a\u0647\u0645\u060c \u0648\u0647\u0645 \u0623\u0632\u0648\u0627\u062c\u0647 \u0648\u0630\u0631\u064a\u062a\u0647 \u0648\u0628\u0646\u0648 \u0647\u0627\u0634\u0645 \u0648\u0628\u0646\u0648 \u0627\u0644\u0645\u0637\u0644\u0628 \u0645\u0646 \u0627\u0644\u0645\u0624\u0645\u0646\u064a\u0646.                    ","\n                    \u062c- \u0648\u0627\u062c\u0628\u0646\u0627: \u0627\u062d\u062a\u0631\u0627\u0645\u0647\u0645 \u0648\u0627\u0644\u0633\u0645\u0639 \u0648\u0627\u0644\u0637\u0627\u0639\u0629 \u0644\u0647\u0645 \u0641\u064a \u063a\u064a\u0631 \u0645\u0639\u0635\u064a\u0629\u060c \u0648\u0639\u062f\u0645 \u0627\u0644\u062e\u0631\u0648\u062c \u0639\u0644\u064a\u0647\u0645\u060c \u0648\u0627\u0644\u062f\u0639\u0627\u0621 \u0648\u0627\u0644\u0646\u0635\u062d \u0644\u0647\u0645 \u0633\u0631\u0651\u064b\u0627.                    ","\n                    \u062c- \u0627\u0644\u062c\u0646\u0629\u060c \u0642\u0627\u0644 \u062a\u064e\u0639\u064e\u0627\u0644\u064e\u0649: \ufd3f\u0625\u0650\u0646\u0651\u064e \u0627\u0644\u0644\u0651\u064e\u0647\u064e \u064a\u064f\u062f\u0652\u062e\u0650\u0644\u064f \u0627\u0644\u0651\u064e\u0630\u0650\u064a\u0646\u064e \u0622\u0645\u064e\u0646\u064f\u0648\u0627 \u0648\u064e\u0639\u064e\u0645\u0650\u0644\u064f\u0648\u0627 \u0627\u0644\u0635\u0651\u064e\u0627\u0644\u0650\u062d\u064e\u0627\u062a\u0650 \u062c\u064e\u0646\u0651\u064e\u0627\u062a\u064d \u062a\u064e\u062c\u0652\u0631\u0650\u064a \u0645\u0650\u0646\u0652 \u062a\u064e\u062d\u0652\u062a\u0650\u0647\u064e\u0627 \u0627\u0644\u0652\u0623\u064e\u0646\u0652\u0647\u064e\u0627\u0631\u064f ...\ufd3e [\u0633\u0648\u0631\u0629 \u0645\u062d\u0645\u062f: 12].                    ","\n                    \u062c- \u0627\u0644\u0646\u0627\u0631\u060c \u0642\u0627\u0644 \u062a\u064e\u0639\u064e\u0627\u0644\u064e\u0649: \ufd3f\u0641\u064e\u0627\u062a\u0651\u064e\u0642\u064f\u0648\u0627 \u0627\u0644\u0646\u0651\u064e\u0627\u0631\u064e \u0627\u0644\u0651\u064e\u062a\u0650\u064a \u0648\u064e\u0642\u064f\u0648\u062f\u064f\u0647\u064e\u0627 \u0627\u0644\u0646\u0651\u064e\u0627\u0633\u064f \u0648\u064e\u0627\u0644\u0652\u062d\u0650\u062c\u064e\u0627\u0631\u064e\u0629\u064f \u0623\u064f\u0639\u0650\u062f\u0651\u064e\u062a\u0652 \u0644\u0650\u0644\u0652\u0643\u064e\u0627\u0641\u0650\u0631\u0650\u064a\u0646\u064e 24\ufd3e [\u0633\u0648\u0631\u0629 \u0627\u0644\u0628\u0642\u0631\u0629: 24].                    ","\n                    \u062c- \u0627\u0644\u062e\u0648\u0641: \u0647\u0648 \u0627\u0644\u062e\u0648\u0641 \u0645\u0646 \u0627\u0644\u0644\u0647 \u0648\u0645\u0646 \u0639\u0642\u0627\u0628\u0647.\n\u0627\u0644\u0631\u062c\u0627\u0621: \u0647\u0648 \u0631\u062c\u0627\u0621 \u062b\u0648\u0627\u0628 \u0627\u0644\u0644\u0647 \u0648\u0645\u063a\u0641\u0631\u062a\u0647 \u0648\u0631\u062d\u0645\u062a\u0647.\n\u0627\u0644\u062f\u0644\u064a\u0644: \u0642\u0648\u0644\u0647 \u062a\u064e\u0639\u064e\u0627\u0644\u064e\u0649: \ufd3f\u0623\u064f\u0648\u0644\u064e\u0626\u0650\u0643\u064e \u0627\u0644\u0651\u064e\u0630\u0650\u064a\u0646\u064e \u064a\u064e\u062f\u0652\u0639\u064f\u0648\u0646\u064e \u064a\u064e\u0628\u0652\u062a\u064e\u063a\u064f\u0648\u0646\u064e \u0625\u0650\u0644\u064e\u0649 \u0631\u064e\u0628\u0651\u0650\u0647\u0650\u0645\u064f \u0627\u0644\u0652\u0648\u064e\u0633\u0650\u064a\u0644\u064e\u0629\u064e \u0623\u064e\u064a\u0651\u064f\u0647\u064f\u0645\u0652 \u0623\u064e\u0642\u0652\u0631\u064e\u0628\u064f \u0648\u064e\u064a\u064e\u0631\u0652\u062c\u064f\u0648\u0646\u064e \u0631\u064e\u062d\u0652\u0645\u064e\u062a\u064e\u0647\u064f \u0648\u064e\u064a\u064e\u062e\u064e\u0627\u0641\u064f\u0648\u0646\u064e \u0639\u064e\u0630\u064e\u0627\u0628\u064e\u0647\u064f \u0625\u0650\u0646\u0651\u064e \u0639\u064e\u0630\u064e\u0627\u0628\u064e \u0631\u064e\u0628\u0651\u0650\u0643\u064e \u0643\u064e\u0627\u0646\u064e \u0645\u064e\u062d\u0652\u0630\u064f\u0648\u0631\u064b\u0627 57\ufd3e [\u0633\u0648\u0631\u0629 \u0627\u0644\u0625\u0633\u0631\u0627\u0621: 57]. \u0648\u0642\u0627\u0644 \u062a\u064e\u0639\u064e\u0627\u0644\u064e\u0649: \ufd3f\u0646\u064e\u0628\u0651\u0650\u0626\u0652 \u0639\u0650\u0628\u064e\u0627\u062f\u0650\u064a \u0623\u064e\u0646\u0651\u0650\u064a \u0623\u064e\u0646\u064e\u0627 \u0627\u0644\u0652\u063a\u064e\u0641\u064f\u0648\u0631\u064f \u0627\u0644\u0631\u0651\u064e\u062d\u0650\u064a\u0645\u064f 49 \u0648\u064e\u0623\u064e\u0646\u0651\u064e \u0639\u064e\u0630\u064e\u0627\u0628\u0650\u064a \u0647\u064f\u0648\u064e \u0627\u0644\u0652\u0639\u064e\u0630\u064e\u0627\u0628\u064f \u0627\u0644\u0652\u0623\u064e\u0644\u0650\u064a\u0645\u064f 50\ufd3e [\u0633\u0648\u0631\u0629 \u0627\u0644\u062d\u062c\u0631: 49\u060c 50]                    ","\n                    \u062c- \u0627\u0644\u0644\u0647\u060c \u0627\u0644\u0631\u0628\u060c \u0627\u0644\u0631\u062d\u0645\u0646\u060c \u0627\u0644\u0633\u0645\u064a\u0639\u060c \u0627\u0644\u0628\u0635\u064a\u0631\u060c \u0627\u0644\u0639\u0644\u064a\u0645\u060c \u0627\u0644\u0631\u0632\u0627\u0642\u060c \u0627\u0644\u062d\u064a\u060c \u0627\u0644\u0639\u0638\u064a\u0645 .... \u0625\u0644\u0649 \u063a\u064a\u0631 \u0630\u0644\u0643 \u0645\u0646 \u0627\u0644\u0623\u0633\u0645\u0627\u0621 \u0627\u0644\u062d\u0633\u0646\u0649 \u0648\u0627\u0644\u0635\u0641\u0627\u062a \u0627\u0644\u0639\u0644\u0649.                    ","\n                    \u062c- \u0627\u0644\u0644\u0647: \u0648\u0645\u0639\u0646\u0627\u0647 \u0627\u0644\u0625\u0644\u0647 \u0627\u0644\u0645\u0639\u0628\u0648\u062f \u0628\u062d\u0642\u060c \u0648\u062d\u062f\u0647 \u0644\u0627 \u0634\u0631\u064a\u0643 \u0644\u0647.\n\u0627\u0644\u0631\u0628: \u0623\u064a \u0627\u0644\u062e\u0627\u0644\u0642 \u0648\u0627\u0644\u0645\u0627\u0644\u0643 \u0627\u0644\u0631\u0627\u0632\u0642 \u0648\u0627\u0644\u0645\u062f\u0628\u0631 \u0648\u062d\u062f\u0647 \u0633\u064f\u0628\u0652\u062d\u064e\u0627\u0646\u064e\u0647\u064f.\n\u0627\u0644\u0633\u0645\u064a\u0639: \u0627\u0644\u0630\u064a \u0648\u0633\u0639 \u0633\u0645\u0639\u0647 \u0643\u0644 \u0634\u064a\u0621\u060c \u0648\u064a\u0633\u0645\u0639 \u0643\u0644 \u0627\u0644\u0623\u0635\u0648\u0627\u062a \u0639\u0644\u0649 \u0627\u062e\u062a\u0644\u0627\u0641\u0647\u0627 \u0648\u062a\u0646\u0648\u0639\u0647\u0627.\n\u0627\u0644\u0628\u0635\u064a\u0631: \u0627\u0644\u0630\u064a \u064a\u0631\u0649 \u0643\u0644 \u0634\u064a\u0621\u060c \u0648\u064a\u0628\u0635\u0631 \u0643\u0644 \u0634\u064a\u0621 \u0635\u063a\u0631 \u0623\u0648 \u0643\u0628\u0631.\n\u0627\u0644\u0639\u0644\u064a\u0645: \u0641\u0647\u0648 \u0627\u0644\u0630\u064a \u0623\u062d\u0627\u0637 \u0639\u0644\u0645\u0647 \u0628\u0643\u0644 \u0634\u064a\u0621 \u0628\u0627\u0644\u0645\u0627\u0636\u064a \u0648\u0627\u0644\u062d\u0627\u0636\u0631 \u0648\u0627\u0644\u0645\u0633\u062a\u0642\u0628\u0644.\n\u0627\u0644\u0631\u062d\u0645\u0646: \u0627\u0644\u0630\u064a \u0648\u0633\u0639\u062a \u0631\u062d\u0645\u062a\u0647 \u0643\u0644 \u0645\u062e\u0644\u0648\u0642 \u0648\u062d\u064a\u060c \u0641\u0643\u0644 \u0627\u0644\u0639\u0628\u0627\u062f \u0648\u0627\u0644\u0645\u062e\u0644\u0648\u0642\u0627\u062a \u062a\u062d\u062a \u0631\u062d\u0645\u062a\u0647.\n\u0627\u0644\u0631\u0632\u0627\u0642: \u0627\u0644\u0630\u064a \u0639\u0644\u064a\u0647 \u0631\u0632\u0642 \u062c\u0645\u064a\u0639 \u0627\u0644\u0645\u062e\u0644\u0648\u0642\u0627\u062a \u0645\u0646 \u0627\u0644\u0625\u0646\u0633 \u0648\u0627\u0644\u062c\u0646 \u0648\u062c\u0645\u064a\u0639 \u0627\u0644\u062f\u0648\u0627\u0628.\n\u0627\u0644\u062d\u064a: \u0627\u0644\u062d\u064a \u0627\u0644\u0630\u064a \u0644\u0627 \u064a\u0645\u0648\u062a\u060c \u0648\u0643\u0644 \u0627\u0644\u062e\u0644\u0642 \u064a\u0645\u0648\u062a.\n\u0627\u0644\u0639\u0638\u064a\u0645: \u0627\u0644\u0630\u064a \u0644\u0647 \u0627\u0644\u0643\u0645\u0627\u0644 \u0643\u0644\u0647 \u0648\u0627\u0644\u0639\u0638\u0645\u0629 \u0643\u0644\u0647\u0627 \u0641\u064a \u0623\u0633\u0645\u0627\u0626\u0647 \u0648\u0635\u0641\u0627\u062a\u0647 \u0648\u0623\u0641\u0639\u0627\u0644\u0647.                    ","\n                    \u062c- \u0646\u062d\u0628\u0647\u0645\u060c \u0648\u0646\u0631\u062c\u0639 \u0625\u0644\u064a\u0647\u0645 \u0641\u064a \u0627\u0644\u0645\u0633\u0627\u0626\u0644 \u0648\u0627\u0644\u0646\u0648\u0627\u0632\u0644 \u0627\u0644\u0634\u0631\u0639\u064a\u0629\u060c \u0648\u0644\u0627 \u0646\u0630\u0643\u0631\u0647\u0645 \u0625\u0644\u0627 \u0628\u0627\u0644\u062c\u0645\u064a\u0644\u060c \u0648\u0645\u0646 \u0630\u0643\u0631\u0647\u0645 \u0628\u063a\u064a\u0631 \u0630\u0644\u0643 \u0645\u0646 \u0627\u0644\u0633\u0648\u0621\u061b \u0641\u0647\u0648 \u0639\u0644\u0649 \u063a\u064a\u0631 \u0627\u0644\u0633\u0628\u064a\u0644.\n\u0642\u0627\u0644 \u062a\u064e\u0639\u064e\u0627\u0644\u064e\u0649: \ufd3f\u064a\u064e\u0631\u06e1\u0641\u064e\u0639\u0650 \u0671\u0644\u0644\u0651\u064e\u0647\u064f \u0671\u0644\u0651\u064e\u0630\u0650\u064a\u0646\u064e \u0621\u064e\u0627\u0645\u064e\u0646\u064f\u0648\u0627 \u0645\u0650\u0646\u0643\u064f\u0645\u06e1 \u0648\u064e\u0671\u0644\u0651\u064e\u0630\u0650\u064a\u0646\u064e \u0623\u064f\u0648\u062a\u064f\u0648\u0627 \u0671\u0644\u06e1\u0639\u0650\u0644\u06e1\u0645\u064e \u062f\u064e\u0631\u064e\u062c\u064e\u0640\u0670\u062a\u06da \u0648\u064e\u0671\u0644\u0644\u0651\u064e\u0647\u064f \u0628\u0650\u0645\u064e\u0627 \u062a\u064e\u0639\u06e1\u0645\u064e\u0644\u064f\u0648\u0646\u064e \u062e\u064e\u0628\u0650\u064a\u0631 11\ufd3e [\u0633\u0648\u0631\u0629 \u0627\u0644\u0645\u062c\u0627\u062f\u0644\u0629 \u0661\u0661].                    ","\n                    \u062c- \u0647\u0645 \u0627\u0644\u0645\u0624\u0645\u0646\u0648\u0646 \u0627\u0644\u0645\u062a\u0642\u0648\u0646.\n\u0642\u0627\u0644 \u062a\u064e\u0639\u064e\u0627\u0644\u064e\u0649: \ufd3f\u0623\u064e\u0644\u064e\u0627 \u0625\u0650\u0646\u0651\u064e \u0623\u064e\u0648\u0652\u0644\u0650\u064a\u064e\u0627\u0621\u064e \u0627\u0644\u0644\u0651\u064e\u0647\u0650 \u0644\u064e\u0627 \u062e\u064e\u0648\u0652\u0641\u064c \u0639\u064e\u0644\u064e\u064a\u0652\u0647\u0650\u0645\u0652 \u0648\u064e\u0644\u064e\u0627 \u0647\u064f\u0645\u0652 \u064a\u064e\u062d\u0652\u0632\u064e\u0646\u064f\u0648\u0646\u064e 62 \u0627\u0644\u0651\u064e\u0630\u0650\u064a\u0646\u064e \u0622\u0645\u064e\u0646\u064f\u0648\u0627 \u0648\u064e\u0643\u064e\u0627\u0646\u064f\u0648\u0627 \u064a\u064e\u062a\u0651\u064e\u0642\u064f\u0648\u0646\u064e 63\ufd3e [\u0633\u0648\u0631\u0629 \u064a\u0648\u0646\u0633: 62\u060c 63].                    ","\n                    \u062c- \u0627\u0644\u0625\u064a\u0645\u0627\u0646 \u0642\u0648\u0644 \u0648\u0639\u0645\u0644\u064c \u0648\u0627\u0639\u062a\u0642\u0627\u062f.                    ","\n                    \u062c- \u0627\u0644\u0625\u064a\u0645\u0627\u0646 \u064a\u0632\u064a\u062f \u0628\u0627\u0644\u0637\u0627\u0639\u0629 \u0648\u064a\u0646\u0642\u0635 \u0628\u0627\u0644\u0645\u0639\u0635\u064a\u0629.\n\u0642\u0627\u0644 \u062a\u064e\u0639\u064e\u0627\u0644\u064e\u0649: \ufd3f\u0625\u0650\u0646\u0651\u064e\u0645\u064e\u0627 \u0627\u0644\u0652\u0645\u064f\u0624\u0652\u0645\u0650\u0646\u064f\u0648\u0646\u064e \u0627\u0644\u0651\u064e\u0630\u0650\u064a\u0646\u064e \u0625\u0650\u0630\u064e\u0627 \u0630\u064f\u0643\u0650\u0631\u064e \u0627\u0644\u0644\u0651\u064e\u0647\u064f \u0648\u064e\u062c\u0650\u0644\u064e\u062a\u0652 \u0642\u064f\u0644\u064f\u0648\u0628\u064f\u0647\u064f\u0645\u0652 \u0648\u064e\u0625\u0650\u0630\u064e\u0627 \u062a\u064f\u0644\u0650\u064a\u064e\u062a\u0652 \u0639\u064e\u0644\u064e\u064a\u0652\u0647\u0650\u0645\u0652 \u0622\u064a\u064e\u0627\u062a\u064f\u0647\u064f \u0632\u064e\u0627\u062f\u064e\u062a\u0652\u0647\u064f\u0645\u0652 \u0625\u0650\u064a\u0645\u064e\u0627\u0646\u064b\u0627 \u0648\u064e\u0639\u064e\u0644\u064e\u0649 \u0631\u064e\u0628\u0651\u0650\u0647\u0650\u0645\u0652 \u064a\u064e\u062a\u064e\u0648\u064e\u0643\u0651\u064e\u0644\u064f\u0648\u0646\u064e 2\ufd3e [\u0633\u0648\u0631\u0629 \u0627\u0644\u0623\u0646\u0641\u0627\u0644: 2].                    ","\n                    \u062c- \u0623\u0646 \u062a\u0639\u0628\u062f \u0627\u0644\u0644\u0647 \u0643\u0623\u0646\u0643 \u062a\u0631\u0627\u0647\u060c \u0641\u0625\u0646 \u0644\u0645 \u062a\u0643\u0646 \u062a\u0631\u0627\u0647\u061b \u0641\u0625\u0646\u0647 \u064a\u0631\u0627\u0643.                    ","\n                    \u062c- \u0628\u0634\u0631\u0637\u064a\u0646:\n1- \u0625\u0630\u0627 \u0643\u0627\u0646\u062a \u062e\u0627\u0644\u0635\u0629 \u0644\u0648\u062c\u0647 \u0627\u0644\u0644\u0647 \u062a\u064e\u0639\u064e\u0627\u0644\u064e\u0649.\n2- \u0648\u0625\u0630\u0627 \u0643\u0627\u0646\u062a \u0639\u0644\u0649 \u0633\u0646\u0629 \u0627\u0644\u0646\u0628\u064a \ufdfa .                    ","\n                    \u062c- \u0647\u0648 \u0627\u0644\u0627\u0639\u062a\u0645\u0627\u062f \u0639\u0644\u0649 \u0627\u0644\u0644\u0647 \u062a\u064e\u0639\u064e\u0627\u0644\u064e\u0649 \u0641\u064a \u062c\u0644\u0628 \u0627\u0644\u0645\u0646\u0627\u0641\u0639 \u0648\u062f\u0641\u0639 \u0627\u0644\u0645\u0636\u0627\u0631\u060c \u0645\u0639 \u0627\u0644\u0623\u062e\u0630 \u0628\u0627\u0644\u0623\u0633\u0628\u0627\u0628.\n\u0642\u0627\u0644 \u062a\u064e\u0639\u064e\u0627\u0644\u064e\u0649: \ufd3f\u0648\u064e\u0645\u064e\u0646\u0652 \u064a\u064e\u062a\u064e\u0648\u064e\u0643\u0651\u064e\u0644\u0652 \u0639\u064e\u0644\u064e\u0649 \u0627\u0644\u0644\u0651\u064e\u0647\u0650 \u0641\u064e\u0647\u064f\u0648\u064e \u062d\u064e\u0633\u0652\u0628\u064f\u0647\u064f ...\ufd3e [\u0633\u0648\u0631\u0629 \u0627\u0644\u0637\u0644\u0627\u0642: 3].\n\ufd3f\u062d\u064e\u0633\u0652\u0628\u064f\u0647\u064f\ufd3e: \u0623\u064a \u0643\u0627\u0641\u064a\u0647.                    ","\n                    \u062c- \u0627\u0644\u0645\u0639\u0631\u0648\u0641: \u0647\u0648 \u0627\u0644\u0623\u0645\u0631 \u0628\u0643\u0644 \u0637\u0627\u0639\u0629 \u0644\u0644\u0647 \u0639\u064e\u0632\u0651\u064e \u0648\u064e\u062c\u064e\u0644\u0651\u064e\u060c \u0648\u0627\u0644\u0645\u0646\u0643\u0631: \u0647\u0648 \u0627\u0644\u0646\u0647\u064a \u0639\u0646 \u0643\u0644 \u0645\u0639\u0635\u064a\u0629 \u0644\u0644\u0647 \u0639\u064e\u0632\u0651\u064e \u0648\u064e\u062c\u064e\u0644\u0651\u064e.\n\u0642\u0627\u0644 \u062a\u064e\u0639\u064e\u0627\u0644\u064e\u0649: \ufd3f\u0643\u064f\u0646\u062a\u064f\u0645\u06e1 \u062e\u064e\u064a\u06e1\u0631\u064e \u0623\u064f\u0645\u0651\u064e\u0629\u064d \u0623\u064f\u062e\u06e1\u0631\u0650\u062c\u064e\u062a\u06e1 \u0644\u0650\u0644\u0646\u0651\u064e\u0627\u0633\u0650 \u062a\u064e\u0623\u06e1\u0645\u064f\u0631\u064f\u0648\u0646\u064e \u0628\u0650\u0671\u0644\u06e1\u0645\u064e\u0639\u06e1\u0631\u064f\u0648\u0641\u0650 \u0648\u064e\u062a\u064e\u0646\u06e1\u0647\u064e\u0648\u06e1\u0646\u064e \u0639\u064e\u0646\u0650 \u0671\u0644\u06e1\u0645\u064f\u0646\u0643\u064e\u0631\u0650 \u0648\u064e\u062a\u064f\u0624\u06e1\u0645\u0650\u0646\u064f\u0648\u0646\u064e \u0628\u0650\u0671\u0644\u0644\u0651\u064e\u0647\u0650\u06d7 ...\ufd3e [\u0633\u0648\u0631\u0629 \u0622\u0644 \u0639\u0645\u0631\u0627\u0646 \u0661\u0661\u0660].                    ","\n                    \u062c- \u0647\u0645 \u0645\u0646 \u0643\u0627\u0646 \u0639\u0644\u0649 \u0645\u062b\u0644 \u0645\u0627 \u0643\u0627\u0646 \u0639\u0644\u064a\u0647 \u0627\u0644\u0646\u0628\u064a \ufdfa \u0648\u0623\u0635\u062d\u0627\u0628\u0647 \u0641\u064a \u0627\u0644\u0642\u0648\u0644 \u0648\u0627\u0644\u0639\u0645\u0644 \u0648\u0627\u0644\u0627\u0639\u062a\u0642\u0627\u062f.\n\u0648\u0633\u0645\u0648\u0627 \u0623\u0647\u0644 \u0627\u0644\u0633\u0646\u0629: \u0644\u0627\u062a\u0628\u0627\u0639\u0647\u0645 \u0633\u0646\u0629 \u0627\u0644\u0646\u0628\u064a \ufdfa \u060c \u0648\u062a\u0631\u0643 \u0627\u0644\u0627\u0628\u062a\u062f\u0627\u0639.\n\u0648\u0627\u0644\u062c\u0645\u0627\u0639\u0629: \u0644\u0623\u0646\u0647\u0645 \u0627\u062c\u062a\u0645\u0639\u0648\u0627 \u0639\u0644\u0649 \u0627\u0644\u062d\u0642 \u0648\u0644\u0645 \u064a\u062a\u0641\u0631\u0642\u0648\u0627 \u0641\u064a\u0647.                    "]),t.s)
